INSERT INTO `news_review_details` (`id`, `news_page`, `category`, `news_image`, `brands`, `meta_description`, `title`, `product_name`, `slug`, `news_details`, `meta_tags`, `status`, `created_at`, `updated_at`) VALUES
(15, 'Articles', NULL, 'uploads/news/1732860100_newsOla Gig VS Ola Gig+.jpg', NULL, 'Ola Gig VS Ola Gig+: The Ola Gig and Ola Gig+ are newly launched electric scooters from Ola Electric, aimed primarily at gig workers and commercial users. Both', 'Ola Gig VS Ola Gig+ Scooter, Who Is Better', NULL, 'ola-gig-vs-ola-gig+-scooter,-who-is-better', '<p><span style=\"font-size: 1rem;\"><b>Ola Gig VS Ola Gig+:</b>&nbsp;</span>The Ola Gig and Ola Gig+ are newly launched electric scooters from Ola Electric, aimed primarily at gig workers and commercial users. Both models feature a practical design with a single seat and a large rear carrier, making them ideal for deliveries or short commutes.</p><h3>Key Differences:</h3><ol><li><p><strong>Price</strong>:</p><ul><li><strong>Ola Gig</strong>: 39,999</li><li><strong>Ola Gig+</strong>: 49,999</li></ul></li><li><p><strong>Motor Power and Speed</strong>:</p><ul><li><strong>Ola Gig</strong>: Equipped with a 250W motor, it has a top speed of 25 km/h, making it suitable for use without registration.</li><li><strong>Ola Gig+</strong>: Powered by a 1.5kW motor, it can reach a top speed of 45 km/h, which requires registration for road use.</li></ul></li><li><p><strong>Battery and Range</strong>:</p><ul><li>Both models have a single removable 1.5kWh battery pack that can double as a home inverter using the Ola PowerPod.</li><li><strong>Gig</strong> offers a maximum range of 112 km on a single charge.</li><li><strong>Gig+</strong> provides a range of 81 km with one battery but can be extended to 157 km with a second battery.</li></ul></li><li><p><strong>Usage Focus</strong>:</p><ul><li>The Ola Gig is designed for shorter trips and low-speed environments, suitable for intra-city deliveries.</li><li>The Ola Gig+ is better for longer commutes with its higher speed and extended range options.</li></ul></li></ol><p>Both models aim to support the gig economy with affordability and flexibility, offering app-based access and portable battery solutions. Deliveries are expected to begin in April 2025.</p>', 'Ola Gig VS Ola Gig+ Scooter, Ola Gig VS Ola Gig+ Scooter Who Is Better', '1', '2024-11-29 06:01:40', '2024-11-29 06:01:40'),
(16, 'Expert Review', NULL, 'uploads/news/1732861517_newsTata Zest 7.jpg', NULL, 'The Tata Zest is a compact sedan that offers a blend of performance, comfort, and value, making it a strong competitor in its segment. Available in both petrol', 'Tata Zest Is A Good Car From Tata Motors', NULL, 'tata-zest-is-a-good-car-from-tata-motors', '<p>The <strong>Tata Zest</strong> is a compact sedan that offers a blend of performance, comfort, and value, making it a strong competitor in its segment. Available in both petrol and diesel variants, it features:</p><h3>Key Specifications:</h3><ol><li><strong>Engines</strong>:<ul><li>Petrol: 1.2L Revotron turbocharged engine producing 90 PS and 140 Nm of torque.</li><li>Diesel: 1.3L Quadrajet engine with 90 PS and 200 Nm of torque.</li></ul></li><li><strong>Transmission</strong>:<ul><li>5-speed manual and an option for Automated Manual Transmission (AMT) in the diesel variant.</li></ul></li><li><strong>Driving Modes</strong>: Eco, City, and Sport modes for better control over fuel efficiency and performance.</li></ol><p><img src=\"data:image/jpeg;base64,\" data-filename=\"Tata Zest 1.jpg\" style=\"width: 686px;\"><br></p><h3>Features:</h3><ul><li><strong>Interior</strong>: Spacious cabin with premium upholstery, a Harman infotainment system, and voice command functionality.</li><li><strong>Safety</strong>: Dual airbags, ABS with EBD, and Corner Stability Control.</li><li><strong>Exterior</strong>: Projector headlamps with LED DRLs and a distinctive honeycomb grille.</li></ul><h3>Performance:</h3><p>The Zest is praised for its smooth ride quality and low cabin noise. The AMT version provides convenience for city driving, while the manual mode gives better control for highway cruising.</p>', 'Tata Zest Is The Good Car Tata Motors, Tata Zest Car, Best Car In India', '1', '2024-11-29 06:25:17', '2024-11-29 06:25:17');
