(19, 'Latest News', 'Electric', 'uploads/news/1732966410_newsmahindra-xuve9 1.jpg', 'TVS', 'Mahindra XEV 9e Car Price In India Start Rs 17.33 Lakh To 21.90 Lakh.  The Mahindra XEV 9e, set to launch in early 2025, is an all-electric SUV coupe that blend', 'Mahindra XEV 9e Car Is Launched, Know More About It', 'Shine', 'mahindra-xev-9e-car-is-launched,-know-more-about-it', '<p><strong style=\"box-sizing: inherit; font-weight: bold; color: rgb(255, 255, 255); font-family: &quot;Open Sans&quot;; background-color: rgb(17, 17, 17);\">Mahindra XEV 9e Car Price In India Start Rs 17.33 Lakh To 21.90 Lakh.</strong></p><p>The Mahindra XEV 9e, set to launch in early 2025, is an all-electric SUV coupe that blends futuristic design with high-end tech. Positioned as an electric version of the XUV700, it comes with two battery options: a 59 kWh pack offering around 542 km range and a 79 kWh pack that extends the range to approximately 656 km (MIDC).</p><p><img src=\"data:image/webp;base64,\" data-filename=\"mahindra-xuve9 2.webp\" style=\"width: 930px;\"><br></p><p></p><p>The XEV 9e delivers impressive performance with its electric motor producing 285 PS and 380 Nm of torque, enabling a 0-100 km/h sprint in just 6.8 seconds. It also boasts a top speed of 202 km/h<span style=\"font-size: 1rem;\">&nbsp;Inside, it features a striking triple-screen setup, including a 12.3-inch screen dedicated to the front passenger, with support for streaming video and other entertainment options. The vehicle also incorporates an advanced driver-assistance system (ADAS) and a high-quality Harman Kardon sound system.</span></p><p></p><p>Priced between 21.9 lakh and 35 lakh, the XEV 9e is built on Mahindra\'s INGLO EV platform and aims to compete with other mid-size electric SUVs by offering luxury, performance, and sustainability.</p><p><strong style=\"box-sizing: inherit; font-weight: bold; color: rgb(255, 255, 255); font-family: &quot;Open Sans&quot;; background-color: rgb(17, 17, 17);\">Last Updated On 30, November 2024.</strong></p>', 'Mahindra XEV 9e Car Price In India, Mahindra XEV 9e Car Price, Mahindra XEV 9e Car, Mahindra XEV 9e, Best  Car In India', '1', '2024-11-30 11:33:30', '2024-11-30 11:33:30');
