(3, 'New Scooters', 'new-scooters', '<p>Explore the latest collection of new scooters, designed for effortless commuting and urban mobility. Scooters offer a perfect blend of convenience, fuel efficiency, and easy maneuverability, making them an ideal choice for city riders. Whether you\'re a daily commuter, a student, or simply looking for a fun and eco-friendly way to get around, our range of scooters from top brands is here to meet your needs.</p>', '2024-10-24 05:14:39', '2024-10-24 05:14:39'),
