(11, 'Electric', 'Tata', 'Popular Cars', 'Electric Cars', '2', 'Tata Punch EV', 'tata-punch-ev', '9.99 Lakh', '14.29 Lakh', '18447', 'uploads/productimage/1731043861_productsmall_PUNCH_074ded8c69.webp', 'uploads/productimage/1731043861_productPunch_carbike360_8_09be583c75.jpg', 'uploads/productimage/1731043861_productPunch_carbike360_7_ad0fff83e1.jpg', 'uploads/productimage/1731043861_productPunch_carbike360_6_931b3ec92d.jpg', 'uploads/productimage/1731043861_productPunch_carbike360_5_01f05b048e.jpg', 'uploads/productimage/1731043861_productbad00417-c26d-46d1-b1f9-e6e5d9b2cd26--New Project - 2024-09-16T162752.139.webp', 'uploads/productimage/1731043861_product41759190-08e6-4b5c-b732-88fa1341de81--New Project - 2024-09-16T162917.452.webp', 'uploads/productimage/1731043861_product63c4df21-15cf-412c-95f8-dc67297bca20--New Project - 2024-09-16T163822.148.webp', 'SUV', 'Empowered Oxide Dual Tone, Seaweed Dual Tone, Daytona Grey Dual Tone, Fearless Red Dual Tone, Pristine White Dual Tone', '18', NULL, NULL, NULL, NULL, '0', NULL, 'Electric', 'Automatic', '5', '6 Airbags', NULL, '9-13 Hours', 'Tata Punch EV', 'Tata Punch EV, Tata Cars in India, Tata EV Cars', '<div class=\"d-flex flex-column flex-lg-row justify-content-between align-items-start align-items-lg-center mb-2\" style=\"font-family: system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, &quot;Noto Sans&quot;, &quot;Liberation Sans&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; row-gap: 0.75rem;\"><h2 style=\"font-weight: 600; font-size: 1.6rem;\"><p>The Tata Punch EV is a compact electric SUV that combines robust performance, advanced technology, and comprehensive safety features. Here are some of its key highlights:</p><p><strong>Performance:</strong></p><ul><li><strong>Motor and Power:</strong> Equipped with a Gen 2 motor, the Punch EV delivers a continuous power output of 90 kW and torque of 190 Nm. <span class=\"\" data-state=\"closed\"><div class=\"relative inline-flex items-center\"><a href=\"https://ev.tatamotors.com/punch/ev/specifications.html?utm_source=chatgpt.com\" target=\"_blank\" rel=\"noopener\" class=\"ml-1 inline-flex h-[22px] items-center rounded-xl bg-[#f4f4f4] px-2 text-[0.5em] font-medium text-token-text-secondary dark:bg-token-main-surface-secondary relative top-[-0.094rem] !text-token-text-secondary uppercase hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:hover:bg-token-text-primary group\"><span class=\"truncate\">Tata Motors</span></a></div></span></li><li><strong>Battery and Range:</strong> It features an IP67-rated, liquid-cooled battery pack, ensuring durability and suitability for various driving conditions. The vehicle offers impressive range options, with the Long Range (LR) version providing an extended driving distance. <span class=\"\" data-state=\"closed\"><div class=\"relative inline-flex items-center\"><a href=\"https://ev.tatamotors.com/punch/ev/specifications.html?utm_source=chatgpt.com\" target=\"_blank\" rel=\"noopener\" class=\"ml-1 inline-flex h-[22px] items-center rounded-xl bg-[#f4f4f4] px-2 text-[0.5em] font-medium text-token-text-secondary dark:bg-token-main-surface-secondary relative top-[-0.094rem] !text-token-text-secondary uppercase hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:hover:bg-token-text-primary group\"><span class=\"truncate\">Tata Motors</span></a></div></span></li><li><strong>Charging Options:</strong> Multiple charging solutions are available, including a DC fast charger that can charge the battery from 10% to 80% in just 56 minutes, a 7.2 kW AC fast charger, and a 15A portable charger for flexibility. <span class=\"\" data-state=\"closed\"><div class=\"relative inline-flex items-center\"><a href=\"https://ev.tatamotors.com/punch/ev.html?utm_source=chatgpt.com\" target=\"_blank\" rel=\"noopener\" class=\"ml-1 inline-flex h-[22px] items-center rounded-xl bg-[#f4f4f4] px-2 text-[0.5em] font-medium text-token-text-secondary dark:bg-token-main-surface-secondary relative top-[-0.094rem] !text-token-text-secondary uppercase hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:hover:bg-token-text-primary group\"><span class=\"truncate\">Tata Motors</span></a></div></span></li></ul><p><strong>Technology:</strong></p><ul><li><strong>Infotainment System:</strong> The Punch EV boasts a 26.03 cm HD touchscreen infotainment system by HARMAN, complemented by a 26.03 cm digital cockpit that provides essential driving information. <span class=\"\" data-state=\"closed\"><div class=\"relative inline-flex items-center\"><a href=\"https://ev.tatamotors.com/punch/ev.html?utm_source=chatgpt.com\" target=\"_blank\" rel=\"noopener\" class=\"ml-1 inline-flex h-[22px] items-center rounded-xl bg-[#f4f4f4] px-2 text-[0.5em] font-medium text-token-text-secondary dark:bg-token-main-surface-secondary relative top-[-0.094rem] !text-token-text-secondary uppercase hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:hover:bg-token-text-primary group\"><span class=\"truncate\">Tata Motors</span></a></div></span></li><li><strong>Connectivity:</strong> It supports wireless Android Auto and Apple CarPlay, along with multiple voice assistants, including \"Hey TATA,\" Alexa, Siri, and Google Assistant, ensuring seamless connectivity. <span class=\"\" data-state=\"closed\"><div class=\"relative inline-flex items-center\"><a href=\"https://ev.tatamotors.com/punch/ev.html?utm_source=chatgpt.com\" target=\"_blank\" rel=\"noopener\" class=\"ml-1 inline-flex h-[22px] items-center rounded-xl bg-[#f4f4f4] px-2 text-[0.5em] font-medium text-token-text-secondary dark:bg-token-main-surface-secondary relative top-[-0.094rem] !text-token-text-secondary uppercase hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:hover:bg-token-text-primary group\"><span class=\"truncate\">Tata Motors</span></a></div></span></li><li><strong>Additional Features:</strong> The vehicle includes a wireless smartphone charger, enhancing convenience for users. <span class=\"\" data-state=\"closed\"><div class=\"relative inline-flex items-center\"><a href=\"https://ev.tatamotors.com/punch/ev.html?utm_source=chatgpt.com\" target=\"_blank\" rel=\"noopener\" class=\"ml-1 inline-flex h-[22px] items-center rounded-xl bg-[#f4f4f4] px-2 text-[0.5em] font-medium text-token-text-secondary dark:bg-token-main-surface-secondary relative top-[-0.094rem] !text-token-text-secondary uppercase hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:hover:bg-token-text-primary group\"><span class=\"truncate\">Tata Motors</span></a></div></span></li></ul><p><strong>Safety:</strong></p><ul><li><strong>Airbags:</strong> The Punch EV is equipped with six airbags, providing enhanced protection for all occupants. <span class=\"\" data-state=\"closed\"><div class=\"relative inline-flex items-center\"><a href=\"https://cars.tatamotors.com.np/utility-vehicles/punch-ev/features.html?utm_source=chatgpt.com\" target=\"_blank\" rel=\"noopener\" class=\"ml-1 inline-flex h-[22px] items-center rounded-xl bg-[#f4f4f4] px-2 text-[0.5em] font-medium text-token-text-secondary dark:bg-token-main-surface-secondary relative top-[-0.094rem] !text-token-text-secondary uppercase hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:hover:bg-token-text-primary group\"><span class=\"truncate\">Tata Motors Cars</span></a></div></span></li><li><strong>Advanced Driver Assistance:</strong> Features such as a 360-degree surround view camera system, blind spot view monitor, electronic parking brake with auto hold, and electronic stability program contribute to a safer driving experience. <span class=\"\" data-state=\"closed\"><div class=\"relative inline-flex items-center\"><a href=\"https://cars.tatamotors.com.np/utility-vehicles/punch-ev/features.html?utm_source=chatgpt.com\" target=\"_blank\" rel=\"noopener\" class=\"ml-1 inline-flex h-[22px] items-center rounded-xl bg-[#f4f4f4] px-2 text-[0.5em] font-medium text-token-text-secondary dark:bg-token-main-surface-secondary relative top-[-0.094rem] !text-token-text-secondary uppercase hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:hover:bg-token-text-primary group\"><span class=\"truncate\">Tata Motors Cars</span></a></div></span></li><li><strong>Crash Test Ratings:</strong> It has achieved a 5-star rating for adult occupant protection and a 5-star rating for child occupant protection from Bharat NCAP, reflecting its robust safety credentials. <span class=\"\" data-state=\"closed\"><div class=\"relative inline-flex items-center\"><a href=\"https://en.wikipedia.org/wiki/Bharat_NCAP?utm_source=chatgpt.com\" target=\"_blank\" rel=\"noopener\" class=\"ml-1 inline-flex h-[22px] items-center rounded-xl bg-[#f4f4f4] px-2 text-[0.5em] font-medium text-token-text-secondary dark:bg-token-main-surface-secondary relative top-[-0.094rem] !text-token-text-secondary uppercase hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:hover:bg-token-text-primary group\"><span class=\"truncate\">Wikipedia</span></a></div></span></li></ul><p><strong>Design and Comfort:</strong></p><ul><li><strong>Sunroof:</strong> An electronically operated sunroof allows occupants to enjoy natural light and fresh air, enhancing the overall driving experience. <span class=\"\" data-state=\"closed\"><div class=\"relative inline-flex items-center\"><a href=\"https://cars.tatamotors.com.np/utility-vehicles/punch-ev/features.html?utm_source=chatgpt.com\" target=\"_blank\" rel=\"noopener\" class=\"ml-1 inline-flex h-[22px] items-center rounded-xl bg-[#f4f4f4] px-2 text-[0.5em] font-medium text-token-text-secondary dark:bg-token-main-surface-secondary relative top-[-0.094rem] !text-token-text-secondary uppercase hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:hover:bg-token-text-primary group\"><span class=\"truncate\">Tata Motors Cars</span></a></div></span></li><li><strong>Interior Features:</strong> The Punch EV offers front ventilated seats, an air purifier with AQI display, and 90-degree opening doors for easy ingress and egress, ensuring comfort and convenience for passengers. <span class=\"\" data-state=\"closed\"><div class=\"relative inline-flex items-center\"><a href=\"https://cars.tatamotors.com.np/utility-vehicles/punch-ev/features.html?utm_source=chatgpt.com\" target=\"_blank\" rel=\"noopener\" class=\"ml-1 inline-flex h-[22px] items-center rounded-xl bg-[#f4f4f4] px-2 text-[0.5em] font-medium text-token-text-secondary dark:bg-token-main-surface-secondary relative top-[-0.094rem] !text-token-text-secondary uppercase hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:hover:bg-token-text-primary group\"><span class=\"truncate\">Tata Motors Cars</span></a></div></span></li></ul><p>The Tata Punch EV stands out in the compact SUV segment with its blend of performance, technology, safety, and comfort, making it a compelling choice for urban and suburban commuters.</p><p></p></h2></div>', 1, '2024-11-08 00:01:01', '2024-12-27 12:22:25'),
(14, 'Cars', 'Honda', NULL, 'Upcoming Cars', '4', 'Maruti Dzire Images', 'maruti-dzire-images', '6.56 Lakh', '6.56 Lakh', '33', 'uploads/productimage/1731156014_productMaruti_Dzire_carbike360_com_ext_14_590b99a514.webp', 'uploads/productimage/1731156014_productMaruti_Dzire_carbike360_com_ext_8_46dc4501ec.webp', 'uploads/productimage/1731156014_productMaruti_Dzire_carbike360_com_ext_16_01c85bf47c.webp', 'uploads/productimage/1731156014_productMaruti_Dzire_carbike360_com_ext_13_9373ed936b.webp', 'uploads/productimage/1731156014_productMaruti_Dzire_carbike360_com_ext_12_5fb98e7099.webp', 'uploads/productimage/1731156014_productMaruti_Dzire_carbike360_com_ext_11_8442f6d05f.webp', 'uploads/productimage/1731156014_productMaruti_Dzire_carbike360_com_ext_10_f0311bbe21.webp', 'uploads/productimage/1731156014_productMaruti_Dzire_carbike360_com_ext_3_2385626062.webp', 'Sedan', 'blue', '15 kmpl', NULL, '5l', '180kg', '5f', '180', '1199 cc', 'Diesel', 'Automatic', '5', '2 Airbags', '150km', '5 h', 'Honda Activa, E: The Electric, Evolution, of a Legend', 'fasdfaf', '<h2 style=\"font-weight: 600; font-size: 1.6rem; font-family: system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, &quot;Noto Sans&quot;, &quot;Liberation Sans&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;;\">Maruti Dzire Price</h2><div class=\"undefined variant-section-content open\" style=\"max-height: 100%; overflow: hidden; margin-bottom: 0px; position: relative; font-family: system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, &quot;Noto Sans&quot;, &quot;Liberation Sans&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;;\">The Maruti Dzire offers a range of pricing options, starting at an attractive 6.56 Lakh for the ex-showroom rate. When it comes to on-road pricing in Kalyan, you can opt for the base model, which starts at 6.56 Lakh or go for the top-tier variant, priced at 9.39 Lakh. Additionally, if you\'re considering financing, EMI plans are available starting from just 12,122 per month, assuming a down payment of  65,646 and a flexible tenure of 5 years. Keep in mind that interest rates may vary depending on the bank.</div>', 1, '2024-11-09 07:10:14', '2024-12-12 09:04:43'),
(15, 'Scooters', 'Honda', NULL, 'Popular Scooters', '3', 'Honda Activa 6G', 'honda-activa-6g', '95,000', '95,000', NULL, 'uploads/productimage/1731305109_productd1dc34e3-6f91-49e4-8883-226676d6a38c--New2029.webp', 'uploads/productimage/1731305109_product10002_a2b3a6bde0.webp', 'uploads/productimage/1731305109_product10003_cafc87ae95.webp', 'uploads/productimage/1731305109_product10004_206556a770.webp', 'uploads/productimage/1731305109_product10005_beb190a266.webp', 'uploads/productimage/1731305109_product10006_cced5129a4.webp', 'uploads/productimage/1731305109_product10007_1a5ca34532.webp', 'uploads/productimage/1731305109_product10008_fdb4028165.webp', NULL, 'red', '18.8 kmpl - 26.99 km/kg', NULL, '5l', '180kg', '5f', '110', '160 cc', 'CNG / Petrol', 'Automatic / Manual', '5', NULL, '150km', '5 h', NULL, NULL, '<div class=\"d-flex flex-column flex-lg-row justify-content-between align-items-start align-items-lg-center mb-2\" style=\"font-family: system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, &quot;Noto Sans&quot;, &quot;Liberation Sans&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; row-gap: 0.75rem;\"><h2 style=\"font-weight: 600; font-size: 1.6rem;\">Honda Activa 6G Highlights</h2><div class=\"d-flex flex-row justify-content-center\" style=\"column-gap: 1rem;\"></div></div><div class=\"ProductPageNew_highlight_section_content__9iV_i highlight-section-content_new open\" style=\"max-height: 100%; overflow: hidden; margin-bottom: 0px; position: relative; color: var(--dark-4); font-family: system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, &quot;Noto Sans&quot;, &quot;Liberation Sans&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;;\"><p><span style=\"font-weight: bolder;\">Latest Update</span></p><p>The latest update for the Honda Activa 6G is the introduction of the H-Smart variant, which comes with a smart key and an idle start-stop system. This variant also gets alloy wheels and a limited edition colour option. The H-Smart variant is priced at Rs. 83,700 for the standard colour and Rs. 84,207 for the limited edition colour.</p><p><span style=\"font-weight: bolder;\">Introduction</span></p><p>It is the sixth generation of the popular scooter that has been ruling the Indian roads for over two decades. The Activa 6G was launched in January 2020 with a BS6-compliant engine and several new features. The Activa 6G is known for its reliability, practicality, and fuel efficiency.</p><p><span style=\"font-weight: bolder;\">Variant and Color</span></p><p>The Honda Activa 6G is available in five variants: Standard, Deluxe, Deluxe - Limited Edition, H-Smart, and H-Smart - Limited Edition. The Standard and Deluxe variants come with drum brakes and steel wheels, while the H-Smart variants come with drum brakes and alloy wheels.</p><p>The Standard variant is priced at Rs. 77,710, the Deluxe variant is priced at Rs. 80,210, the Deluxe - Limited Edition variant is priced at Rs. 82,207, the H-Smart variant is priced at Rs. 83,700, and the H-Smart - Limited Edition variant is priced at Rs. 84,207.&nbsp;</p><p>The Activa 6G is offered in nine colours: blue, red, yellow, black, white, grey, brown, silver, and gold.</p><p><span style=\"font-weight: bolder;\">Engine and Power</span></p><p>It is powered by a 109.51 cc single-cylinder, air-cooled engine that produces 7.73 bhp of power and 8.90 Nm of torque. The engine is equipped with the Enhanced Smart Power (eSP) technology that reduces friction and improves combustion efficiency. The engine also features a silent start system that eliminates the need for a starter motor.</p><p><span style=\"font-weight: bolder;\">Fuel Efficiency and Tank Capacity</span></p><p>The Honda Activa 6G boasts of an impressive fuel efficiency of 47 kmpl as reported by users. The scooter has a fuel tank capacity of 5.3 litres that gives it a decent range of over 200 km on a full tank. The scooter also has a double lid external fuel fill cap that allows easy refuelling without opening the seat.</p><p><span style=\"font-weight: bolder;\">Features and Boot Capacity</span></p><p>It comes with a host of features that enhance convenience and safety. It has a digital-analog instrument cluster that displays information such as speed, odometer, trip meter, fuel gauge, service due indicator, and malfunction indicator lamp. It also has an LED headlamp that provides better visibility at night.</p><p>The scooter has a large under-seat storage compartment that can accommodate a full-face helmet or other items. The storage compartment also has an optional USB charging port for charging mobile devices. The scooter also has a side stand engine cut-off switch that prevents the engine from starting when the side stand is engaged.</p><p><span style=\"font-weight: bolder;\">Wheel Size and Weight</span></p><p>It has a wheelbase of 1260 mm and a ground clearance of 171 mm that provide stability and agility on different road conditions. The scooter has a kerb weight of 105 kg (106 kg for H-Smart variants) that makes it easy to handle and manoeuvre. The scooter has a 12-inch front wheel and a 10-inch rear wheel that offer better grip and stability on various terrains.</p><p><span style=\"font-weight: bolder;\">Rivals</span></p><p>It faces competition from other scooters in its segment such as the&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.carbike360.com/scooters/tvs/jupiter\" style=\"color: inherit;\">TVS Jupiter</a>,&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.carbike360.com/scooters/hero/maestro-edge-110\" style=\"color: inherit;\">Hero Maestro Edge 110</a>,&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.carbike360.com/scooters/suzuki/access-125\" style=\"color: inherit;\">Suzuki Access 125</a>,&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.carbike360.com/scooters/yamaha/fascino\" style=\"color: inherit;\">Yamaha Fascino 125</a>, and&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.carbike360.com/scooters/bajaj/chetak\" style=\"color: inherit;\">Bajaj Chetak Electric</a>. These scooters offer similar or better performance, features, mileage, and design as compared to the Activa 6G.</p></div>', 1, '2024-11-11 00:35:09', '2024-11-11 00:35:09'),
