(20, 'Electric', 'Toyota', 'Latest Cars', 'Electric Cars', '2', 'Toyota Urban Cruiser Hyryder', 'toyota-urban-cruiser-hyryder', '11.14 Lakh', '11.14 Lakh', NULL, 'uploads/productimage/1731320855_productsmall_Toyota_Hyryder_90011e0795.webp', 'uploads/productimage/1731320855_productToyota_hyryder_5_c6b5986055.webp', 'uploads/productimage/1731320855_productToyota_Hyryder_6568675f38 (1).webp', 'uploads/productimage/1731320855_productToyota_Hyryder_6568675f38.webp', 'uploads/productimage/1731320855_productToyota_Urban_Cruiser_Hyryder_front_Airvents_db4d67c701.webp', 'uploads/productimage/1731320855_productToyota_Urban_Cruiser_Hyryder_gear_shifter_92959bfcf7.webp', 'uploads/productimage/1731320855_productToyota_Urban_Cruiser_Hyryder_knob_button_246de13268.webp', 'uploads/productimage/1731320855_productToyota_Urban_Cruiser_Hyryder_seats_7c75cde2db.webp', NULL, 'Black', '18.8 kmpl - 26.99 km/kg', NULL, '5l', '180kg', '4fEET', '140', '160 cc', 'bettery', 'Automatic / Manual', '5', '2 Airbags', '150km', '5 h', NULL, NULL, '<div class=\"ProductPageNew_product_page_section__ptsx0 undefined product-page-new\" style=\"margin-top: 1rem; padding: 0.75rem 0.5rem; box-shadow: 0 .1rem .15rem .1rem var(--gray-3); font-family: system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, &quot;Noto Sans&quot;, &quot;Liberation Sans&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;;\"><div class=\"d-flex flex-column flex-lg-row justify-content-between align-items-start align-items-lg-center mb-2\" style=\"row-gap: 0.75rem;\"><h2 style=\"font-weight: 600; font-size: 1.6rem;\">Toyota Urban Cruiser Hyryder Latest Update</h2><div class=\"d-flex flex-row justify-content-center\" style=\"column-gap: 1rem;\"></div></div><div class=\"ProductPageNew_highlight_section_content__9iV_i highlight-section-content_new open\" style=\"max-height: 100%; overflow: hidden; margin-bottom: 0px; position: relative; color: var(--dark-4);\"><h2 style=\"font-weight: 600; font-size: 1.6rem;\">Key Highlights</h2><p><span style=\"font-weight: bolder;\">Introduction</span></p><p>Urban Cruiser Hyryder is Toyotas version of the Maruti Suzuki Grand Vitara in the mid size SUV segment. Both the SUVs are identical in terms of feature list, dimension and specs.</p><p><span style=\"font-weight: bolder;\">Exterior and Design</span></p><p>Although it\'s a rebadged Maruti Grand Vitara, Hyryder gets a completely different design in the front, the rear, and the sides. Unlike Grand Vitara\'s tri element DRLs, the Hyryder gets horizontal DRLs that are split from the middle by a chrome strip that passes through the grille and connects both the ends. It also gets a huge lower air intake &amp; single barrel LED projector headlamps placed below the DRLs inside the bumper.</p><p>In the rear, the tail lamp design is also different from Maruti Grand Vitara\'s tri element taillamp design. Also, the alloys come with a different design compared to the Maruti Suzuki Grand Vitara.</p><p><span style=\"font-weight: bolder;\">Interior and Features</span></p><p>Toyota Hyryder gets the same set of features as the Maruti Grand Vitara. These include an HUD (heads up display), 9 inch smartplay pro plus touchscreen infotainment system, wireless android auto/apple carplay, auto dimming IRVM, tilt and telescopic steering adjustment, 360 degree camera system, ventilated front seats, paddle shifters, alexa integration, connected car tech, wireless phone charger, panoramic sunroof etc.</p><p><span style=\"font-weight: bolder;\">Engine and Transmission</span></p><p>Just like its rebadged cousin - Maruti Grand Vitara, Toyota Hyryder too gets multiple engine and gearbox combination options. The combinations include a 1.5 litre naturally aspirated petrol with mild hybrid tech producing 103.06 PS of power and 136.8 Nm of torque, a 1.5 litre naturally aspirated petrol with strong hybrid tech producing a combined power of 172.65 PS (engine: 92.45 PS + motor: 80.2 PS) and a combined torque of 263 Nm (engine: 122 Nm + motor: 141 Nm). The third option is the 1.5 litre petrol+CNG option.</p><p>The mild hybrid variants come with 5 speed manual or 6 speed torque converter auto and the strong hybrid variants come with an e-Drive auto. The CNG option gets only a 5 speed manual.</p><p><span style=\"font-weight: bolder;\">Drive Train</span></p><p>Toyota Hyryder comes in both configuration i.e. a front wheel drive configuration and an all wheel drive configuration.</p><p><span style=\"font-weight: bolder;\">Dimension</span></p><p>Toyota Hyryder measures 4,365 mm in length, 1,795 mm in width, 1,645 mm in height and 2,600 mm in wheelbase.</p><p><span style=\"font-weight: bolder;\">Variants and Colours</span></p><p>Toyota gives customers the option to choose from 7 monotone colours and 4 dual tone colours with black roof. For variants, one can choose from 2 variants for the CNG version, 4 variants for the Neodrive mild hybrid version (with or without AWD) and 3 variants for the Strong Hybrid version.</p><p><span style=\"font-weight: bolder;\">Segment and Rivals</span></p><p>Other competitors of Toyota Hyryder in the mid size SUV segment are Maruti&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.carbike360.com/cars/maruti/grand-vitara\" style=\"color: inherit;\">Grand Vitara</a>,&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.carbike360.com/cars/kia/seltos\" style=\"color: inherit;\">Kia Seltos</a>,&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.carbike360.com/cars/hyundai/creta-2024\" style=\"color: inherit;\">Hyundai Creta</a>,&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.carbike360.com/cars/mg/astor\" style=\"color: inherit;\">MG Astor</a>,&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.carbike360.com/cars/volkswagen/taigun\" style=\"color: inherit;\">Volkswagen Taigun</a>,&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.carbike360.com/cars/skoda/kushaq\" style=\"color: inherit;\">Skoda Kushaq</a>, and&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.carbike360.com/cars/honda/elevate\" style=\"color: inherit;\">Honda Elevate</a>.</p></div><div class=\"ProductPageNew_read_more_btn__HbLXH\"><button type=\"button\" class=\"btn btn-link btn-sm\" style=\"border-radius: var(--bs-btn-border-radius); font-family: var(--bs-btn-font-family); font-size: var(--bs-btn-font-size); line-height: var(--bs-btn-line-height); --bs-btn-padding-x: 0.5rem; --bs-btn-padding-y: 0.25rem; --bs-btn-font-family: ; --bs-btn-font-size: 0.875rem; --bs-btn-font-weight: 400; --bs-btn-line-height: 1.5; --bs-btn-color: var(--bs-link-color); --bs-btn-bg: transparent; --bs-btn-border-width: 1px; --bs-btn-border-color: transparent; --bs-btn-border-radius: 0.25rem; --bs-btn-hover-border-color: transparent; --bs-btn-box-shadow: none; --bs-btn-disabled-opacity: 0.65; --bs-btn-focus-box-shadow: 0 0 0 0.25rem rgba(var(--bs-btn-focus-shadow-rgb),0.5); font-weight: 600; color: var(--bs-btn-color); border: var(--bs-btn-border-width) solid var(--bs-btn-border-color); --bs-btn-hover-color: var(--bs-link-hover-color); --bs-btn-active-color: var(--bs-link-hover-color); --bs-btn-active-border-color: transparent; --bs-btn-disabled-color: #6c757d; --bs-btn-disabled-border-color: transparent; --bs-btn-focus-shadow-rgb: 49,132,253; padding-left: 0px !important;\">Read Less...</button></div></div><section id=\"variants-section\" class=\"undefined ProductPageNew_product_page_section__ptsx0 product-page-new\" style=\"margin-top: 1rem; padding: 0.75rem 0.5rem; box-shadow: 0 .1rem .15rem .1rem var(--gray-3); font-family: system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, &quot;Noto Sans&quot;, &quot;Liberation Sans&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;