(24, 'Electric', 'Lotus', 'Popular Cars', 'Electric Cars', '2', 'Land Rover Range Rover Images', 'land-rover-range-rover-images', '2.36 Cr', '2.36 Cr', '1250', 'uploads/productimage/1731328834_productsmall_Land_Rover_Range_Rover_2022_0d23dac948.webp', 'uploads/productimage/1731328834_product47cfaae2baea471ca9918359d3d0faf9.jpg', 'uploads/productimage/1731328834_product61f5a5fb19db46f7bb295841aea00782.jpg', 'uploads/productimage/1731328834_product879d8b554c3a4cd084e7ab12e2364833.jpg', 'uploads/productimage/1731328834_productcb31401625704d32b79302387e81c206.jpg', 'uploads/productimage/1731328834_productcf862aa504084473b153cde0857c4511.jpg', 'uploads/productimage/1731328834_productsmall_Land_Rover_Range_Rover_2022_0d23dac948.webp', 'uploads/productimage/1731328834_productcb31401625704d32b79302387e81c206.jpg', NULL, 'red', '18.8 kmpl - 26.99 km/kg', NULL, '5l', '180kg', '5f', '180', '160 cc', 'Electric', 'Automatic / Manual', '5', '2 Airbags', '150km', '5 h', 'Honda Activa, E: The Electric, Evolution, of a Legend', 'New Cars New Cars', '<div class=\"d-flex flex-column flex-lg-row justify-content-between align-items-start align-items-lg-center mb-2\" style=\"font-family: system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, &quot;Noto Sans&quot;, &quot;Liberation Sans&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; row-gap: 0.75rem;\"><h2 style=\"font-weight: 600; font-size: 1.6rem;\">Land Rover Range Rover Latest Update</h2><div class=\"d-flex flex-row justify-content-center\" style=\"column-gap: 1rem;\"></div></div><div class=\"ProductPageNew_highlight_section_content__9iV_i highlight-section-content_new open\" style=\"max-height: 100%; overflow: hidden; margin-bottom: 0px; position: relative; color: var(--dark-4); font-family: system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, &quot;Noto Sans&quot;, &quot;Liberation Sans&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;;\"><div class=\"ProductPageNew_highlight_section_content__9iV_i highlight-section-content\" style=\"color: var(--dark-4);\"><h2 style=\"font-weight: 600; font-size: 1.6rem;\">Key Highlights</h2><p><span style=\"font-weight: bolder;\">Exterior &amp; Design</span></p><p>Being the most luxurious and flagship model under Range Rover - the sub brand of Land Rover, the Range Rover offers premium experience in all aspects including the exterior design elements. In the front, it features slim headlamp units that are seamlessly integrated with the grille. In the rear, the unique looking taillamps remain hidden behind a a glossy black panel until they are illuminated. There\'s also 23 inch 15 spoke alloys that add character to the SUVs side profile.</p><p><span style=\"font-weight: bolder;\">Interior &amp; Features</span></p><p>In the cabin, it comes with class leading comfort and convenience features. Some of these features include Meridian surround sound system, Active Noise Cancellation, acoustic laminated glass, world-first headrest speakers, heated leather seats, Hot Stone Massage seats, etc.</p><p>On the tech front, it comes loaded with class defining features like 13 inch curved &amp; floating design Pivi Pro infotainment touchscreen with Haptic controls. The driver also gets a 13.7 inch interactive display.</p><p>Other key features include semi-aniline leather upholstery, wood veneer finish, metal accents, seats with heating &amp; ventilation, seats with massage functions, rear seats with recline options, standard Apple CarPlay and Android Auto, Four-zone automatic climate control, Customizable multiple color ambient lighting, Panoramic Sunroof etc.</p><p>It also offers Driver Assistance features like adaptive cruise control, lane-keeping assist, blind-spot monitoring, and a 360-degree camera system.</p><p><span style=\"font-weight: bolder;\">Engine &amp; Transmission</span></p><p>The Land Rover Range Rover offers a range of powerful and efficient engines paired with advanced transmission options to deliver exceptional performance:</p><ul style=\"padding-left: 2rem;\"><li><span style=\"font-weight: bolder;\">Engine Options</span>:<br>Petrol Engine: 3.0-liter inline-6 with mild hybrid technology<br>Diesel Engine: 3.0-liter inline-6<br>Petrol V8 Engine: 5.0-liter supercharged V8</li><li><span style=\"font-weight: bolder;\">Power Output</span>:<br>3.0-liter Petrol Engine: 400 PS or 394 bhp<br>3.0-liter Diesel Engine: 300 PS or 296 bhp<br>5.0-liter V8 Engine: 525 PS or 518 bhp</li><li><span style=\"font-weight: bolder;\">Torque Output</span>:<br>3.0-liter Petrol Engine: 550 Nm of torque<br>3.0-liter Diesel Engine: 650 Nm of torque<br>5.0-liter V8 Engine: 625 Nm of torque</li><li><span style=\"font-weight: bolder;\">Transmission</span>: All engine options are paired with an 8-speed automatic transmission.</li></ul><p><span style=\"font-weight: bolder;\">Dimensions</span></p><p>The dimensions of the Land Rover Range Rover emphasize its spacious and imposing presence, suitable for both luxury and off-road capabilities:</p><ul style=\"padding-left: 2rem;\"><li>Length: 5000 mm (Standard Wheelbase) / 5200 mm (Long Wheelbase)</li><li>Width: 2073 mm (excluding mirrors)</li><li>Height: 1869 mm</li><li>Wheelbase: 2922 mm (Standard Wheelbase) / 3122 mm (Long Wheelbase)</li><li>Boot Space: 707 liters with the seats up</li><li>Ground Clearance: Typically around 220 mm, adjustable with the air suspension system for varied terrain.</li></ul><p>These dimensions ensure the Range Rover provides ample interior space for passengers and luggage while maintaining a robust and capable stance, ideal for both urban environments and off-road adventures.</p><p><span style=\"font-weight: bolder;\">Colour Options</span></p><p>Customers of the Range Rover can choose from 4 premium colour shades.</p></div></div>', 1, '2024-11-11 07:10:34', '2024-12-09 23:33:41'),
(26, 'Electric', 'Yamaha', 'Upcoming Bikes', 'Electric Bikes', '2', 'Raptee Motors T 30', 'raptee-motors-t-30', '6.13 Lakh', '6.56 Lakh', NULL, 'uploads/productimage/1731390598_product326c2ca9-d1b3-4151-9911-76a029f837f2--New2029.webp', 'uploads/productimage/1731388836_product4fb30b9d-a4b0-49b7-af08-aa4a9fd8fd9d--New2029.webp', 'uploads/productimage/1731388836_product7e61bb30-7131-430a-8647-87a7db4a6507--New2029.webp', 'uploads/productimage/1731388836_product997bba8c-5e2b-4d48-85f6-443d6dc5457a--New2029.webp', 'uploads/productimage/1731388836_product81741d63-f15d-4333-9cc9-496b2b0d0345--New2029.webp', 'uploads/productimage/1731388836_productsmall_Land_Rover_Range_Rover_2022_0d23dac948.webp', 'uploads/productimage/1731388836_productsmall_Land_Rover_Defender_88a425d36a.webp', 'uploads/productimage/1731388836_product47cfaae2baea471ca9918359d3d0faf9.jpg', NULL, 'red', '18.8 kmpl - 26.99 km/kg', NULL, '5l', '180kg', '4fEET', '110', '1199 cc', 'Petrol', 'Automatic / Manual', '2', NULL, '150km', '5 h', NULL, NULL, '<div class=\"d-flex flex-column flex-lg-row justify-content-between align-items-start align-items-lg-center mb-2\" style=\"font-family: system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, &quot;Noto Sans&quot;, &quot;Liberation Sans&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; row-gap: 0.75rem;\"><h2 style=\"font-weight: 600; font-size: 1.6rem;\">Raptee Motors T 30 Highlights</h2><div class=\"d-flex flex-row justify-content-center\" style=\"column-gap: 1rem;\"></div></div><div class=\"ProductPageNew_highlight_section_content__9iV_i highlight-section-content_new open\" style=\"max-height: 100%; overflow: hidden; margin-bottom: 0px; position: relative; color: var(--dark-4); font-family: system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, &quot;Noto Sans&quot;, &quot;Liberation Sans&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;;\"><p><span style=\"font-weight: bolder;\">Introduction</span><br><br>The Raptee.hv T30 is Indias first high-voltage electric motorcycle, designed to offer a blend of performance and convenience. Developed by the Chennai-based startup Raptee, this bike leverages advanced technology typically found in electric cars.<br><br><span style=\"font-weight: bolder;\">Variants and Colors</span><br><br>The Raptee.hv T30 is available in multiple variants, each offering distinct features and performance levels. The color options include vibrant and sleek choices&nbsp;available in four colour options  Horizon Red, Arctic White, Mercury Grey, and Eclipse Black.<br><br><span style=\"font-weight: bolder;\">Design</span><br><br>The T30 features a modern and aggressive design, with a full fairing that gives it a sporty look. The bikes aesthetics are complemented by aerodynamic elements and a robust build, making it visually appealing and functional.<br><br><span style=\"font-weight: bolder;\">Powertrain</span><br><br>At the heart of the Raptee.hv T30 is a high-voltage powertrain that ensures efficient energy management and superior performance. This setup allows the bike to deliver quick acceleration and maintain high speeds with ease.<br><br><span style=\"font-weight: bolder;\">Battery</span><br><br>The T30 is equipped with a high-capacity battery pack that is IP67 rated for dust and water protection. The battery comes with an eight-year warranty or up to 80,000 kilometres, providing long-term reliability and peace of mind for riders.<br><br><span style=\"font-weight: bolder;\">Performance and Range</span><br><br>The Raptee.hv T30 boasts a real-world range of over 150 kilometres on a single charge. It can accelerate from 0 to 60 km/h in under 3.5 seconds, making it a competitive alternative to traditional 250-300cc internal combustion engine bikes.<br><br><span style=\"font-weight: bolder;\">Features</span><br><br>The T30 is packed with advanced features, including a custom-built operating system based on an automotive-grade Linux platform. This ensures responsive and intuitive control over the bikes performance and maintenance. Additionally, the bike supports fast charging at electric car charging stations, enhancing its practicality.<br><br><span style=\"font-weight: bolder;\">Dimension</span><br><br>The dimensions of the Raptee.hv T30 are designed to offer a comfortable and ergonomic riding experience. The bikes size and weight distribution make it suitable for both city commuting and longer rides.<br><br><span style=\"font-weight: bolder;\">Rivals</span><br><br>The primary competitors of the Raptee.hv T30 include the Ultraviolette F77 Mach 2 and other premium electric motorcycles in the market. The T30 stands out with its high-voltage technology and compatibility with car charging stations, giving it a unique edge.<br></p></div>', 1, '2024-11-11 23:50:36', '2024-11-12 00:19:58'),
