(29, 'Electric', 'TVS', 'Popular Scooters', 'Electric Scooters', '2', 'TVS X', 'tvs-x', '2.50 Lakh', '2.50 Lakh', NULL, 'uploads/productimage/1731392857_productsmall_TVS_X_front_left_side_bab056e277.webp', 'uploads/productimage/1731392857_productTVS_X_front_right_side_3784f6f182.webp', 'uploads/productimage/1731392857_productTVS_X_front_view_0d5d6d6957.webp', 'uploads/productimage/1731392857_productTVS_X_left_side_2410996e10.webp', 'uploads/productimage/1731392857_productTVS_X_left_side_2410996e10_24e9341065.webp', 'uploads/productimage/1731392857_productTVS_X_rear_left_side_view_3e28960800.webp', 'uploads/productimage/1731392857_productTVS_X_rear_right_side_35cab19d7b.webp', 'uploads/productimage/1731392857_productTVS_X_rear_view_9ed5ac14c8.webp', NULL, 'red', '18.8 kmpl - 26.99 km/kg', NULL, NULL, NULL, '4fEET', '110', '1199 cc', NULL, 'Automatic / Manual', '2', NULL, '150km', '5 h', NULL, NULL, '<div class=\"d-flex flex-column flex-lg-row justify-content-between align-items-start align-items-lg-center mb-2\" style=\"font-family: system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, &quot;Noto Sans&quot;, &quot;Liberation Sans&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; row-gap: 0.75rem;\"><h2 style=\"font-weight: 600; font-size: 1.6rem;\">TVS X Highlights</h2><div class=\"d-flex flex-row justify-content-center\" style=\"column-gap: 1rem;\"></div></div><div class=\"ProductPageNew_highlight_section_content__9iV_i highlight-section-content_new open\" style=\"max-height: 100%; overflow: hidden; margin-bottom: 0px; position: relative; color: var(--dark-4); font-family: system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, &quot;Noto Sans&quot;, &quot;Liberation Sans&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;;\"><p><span style=\"font-weight: bolder;\">Latest Update</span></p><p>TVS X is a premium electric scooter launched by&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.carbike360.com/bikes/tvs\" style=\"color: inherit;\">TVS Motor</a>&nbsp;Company in August 2023. It is based on the Creon concept showcased in 2018 and offers a sporty design, powerful performance, and advanced features.</p><p><span style=\"font-weight: bolder;\">Introduction</span></p><p>It is the second electric scooter from TVS Motor Company after the iQube. It is a crossover of disciplines, as it combines the design elements of a scooter and a motorcycle. It has a lean, mean, and clean look with sharp lines and creases. It has a digital instrument cluster, LED lights, and a large under-seat storage. It also has a unique X-shaped tail light that gives it a distinctive identity.</p><p><span style=\"font-weight: bolder;\">Variant and Color</span></p><p>It is available in only one variant - Standard. It comes in only one color option - Red. The ex-showroom price of TVS X Standard is Rs. 2.49 lakh. The charger price is separate and not included in the ex-showroom price. The final price will depend on the date of delivery and the state subsidies.</p><p><span style=\"font-weight: bolder;\">Battery and Charging</span></p><p>It is powered by a 4.44 kWh lithium-ion battery pack that is mated to an 11 kW (peak power) electric motor. The battery pack can be charged from 0 to 80 percent in 3 hours and 40 minutes using a portable 950 W charger. The electric motor delivers a peak torque of 33 Nm and can propel the scooter to a top speed of 105 kmph. The scooter can accelerate from 0 to 40 kmph in 2.6 seconds.</p><p><span style=\"font-weight: bolder;\">Range</span></p><p>TVS X has a claimed riding range of 140 km on a single charge. The actual range may vary depending on the riding mode, road conditions, and rider\'s weight. The scooter has three riding modes - Xtride, Xonic, and Xtealth - that can be selected using the touchscreen display.&nbsp;</p><p>The Xtride mode offers the best balance of performance and range, while the Xonic mode enhances the performance and thrill. The Xtealth mode enables silent riding and maximizes the range.</p><p><span style=\"font-weight: bolder;\">Features and Boot Capacity</span></p><p>This bike comes with a host of features that make it a smart and connected electric scooter. It has a 10.2-inch TFT touchscreen display that supports smartphone connectivity via TVS SmartXonnect app. The app allows the rider to access navigation, calls, SMS, custom home screens, wallpapers, themes, and profiles.</p><p>The scooter also gets OTA updates, cruise control, geo-fencing, anti-theft alarm, reverse assist, park assist, and regenerative braking. The scooter has a boot capacity of 25 litres that can accommodate a full-face helmet.</p><p><span style=\"font-weight: bolder;\">Wheel Size and Weight</span></p><p>TVS X has 12-inch alloy wheels that are shod with tubeless tyres. The front tyre size is 100/80-12 and the rear tyre size is 110/80-12. The scooter has telescopic forks at the front and an offset monoshock at the rear for suspension.&nbsp;</p><p>The braking system consists of 220 mm front disc and 195 mm rear disc with single-channel ABS. The scooter has a kerb weight of 140 kg and a seat height of 770 mm.</p><p><span style=\"font-weight: bolder;\">Rivals</span></p><p>It faces competition from other premium electric scooters in the Indian market such as&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.carbike360.com/scooters/ather-energy/450x\" style=\"color: inherit;\">Ather 450X</a>,&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.carbike360.com/scooters/ola-electric/s1-pro\" style=\"color: inherit;\">Ola S1 Pro</a>,&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.carbike360.com/scooters/bajaj/chetak\" style=\"color: inherit;\">Bajaj Chetak</a>,&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.carbike360.com/scooters/simple-energy/simple-one\" style=\"color: inherit;\">Simple One</a>,&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.carbike360.com/scooters/bgauss/b8\" style=\"color: inherit;\">BGauss B8</a>,&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.carbike360.com/scooters/okinawa/i-praise\" style=\"color: inherit;\">Okinawa iPraise+</a>, among others.</p></div>', 1, '2024-11-12 00:57:37', '2024-11-12 00:57:37'),
(30, 'Electric', 'Tesla', 'Upcoming Scooters', 'Electric Scooters', '2', 'Keeway Sixties 300i', 'keeway-sixties-300i', '3.30 Lakh', '3.30 Lakh', '33', 'uploads/productimage/1731393587_productKeeway_34750adeb0.webp', 'uploads/productimage/1731393587_productKeeway_1_a5b0b69c32.webp', 'uploads/productimage/1731393587_productKeeway_2_2a57e43325.webp', 'uploads/productimage/1731393587_productKeeway_2_2a57e43325.webp', 'uploads/productimage/1731393587_productKeeway_3_51d53dabab.webp', 'uploads/productimage/1731393587_productBMW_CE_02_phone_stand_431cb9ec8c.webp', 'uploads/productimage/1731393587_productBMW_CE_02_seat_552f84be17.webp', 'uploads/productimage/1731393587_productBMW_CE_02_display_4097571b49.webp', NULL, 'Black', '18.8 kmpl - 26.99 km/kg', NULL, NULL, NULL, '5f', '110', '160 cc', 'Electric', 'Automatic / Manual', '2', '2 Airbags', '150km', '5 h', 'asdf sadf f', 'fasdfaf', '<div class=\"d-flex flex-column flex-lg-row justify-content-between align-items-start align-items-lg-center mb-2\" style=\"font-family: system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, &quot;Noto Sans&quot;, &quot;Liberation Sans&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; row-gap: 0.75rem;\"><h2 style=\"font-weight: 600; font-size: 1.6rem;\">Keeway Sixties 300i Highlights</h2><div class=\"d-flex flex-row justify-content-center\" style=\"column-gap: 1rem;\"></div></div><div class=\"ProductPageNew_highlight_section_content__9iV_i highlight-section-content_new open\" style=\"max-height: 100%; overflow: hidden; margin-bottom: 0px; position: relative; color: var(--dark-4); font-family: system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, &quot;Noto Sans&quot;, &quot;Liberation Sans&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;;\"><div class=\"ProductPageNew_highlight_section_content__9iV_i highlight-section-content\" style=\"color: var(--dark-4);\"><p>The Keeway Sixties 300i is powered by an 279 cc engine, enabling it to reach a maximum speed of 120 kmph kmps.</p><bold style=\"font-weight: 600; margin-bottom: 0.5rem !important; font-size: 1.1rem !important;\">Variant and Colour</bold><br><p>There is a selection of 3 distinct variants for this bike, including options like Keeway Sixties 300i Matte Light Blue, Keeway Sixties 300i Matte Grey, Keeway Sixties 300i Matte White and more. Each variant caters to various preferences with unique price points and features. The given model is available in 0 different colors, including options like , and more.</p><bold style=\"font-weight: 600; margin-bottom: 0.5rem !important; font-size: 1.1rem !important;\">Tank Capacity and Mileage</bold><br><p>Featuring a fuel tank with a capacity of 10 Litres, the Sixties 300i provides a top-notch maximum mileage of 27.73 kmpl litres</p><bold style=\"font-weight: 600; margin-bottom: 0.5rem !important; font-size: 1.1rem !important;\">Height and Weight</bold><br><p>The scooter\'s total height measures 1170 mm, and it has a kerb weight of 146 Kg.</p><bold style=\"font-weight: 600; margin-bottom: 0.5rem !important; font-size: 1.1rem !important;\">Rivals</bold><br><p>In today\'s market, Keeway Sixties 300i faces competition from several contenders, including TVS X, Flycon Empire, EVeium CZAR, EVeium COMET, One Moto Byka, One Moto Electa and more.</p></div></div>', 1, '2024-11-12 01:09:47', '2024-12-09 23:45:44'),
