(33, 'Cars', 'Suzuki', NULL, 'Latest Cars', '3', 'Maruti Dzire', 'maruti-dzire', 'Rs 6.79 Lakh', 'Rs 7.64 Lakh', '15312', 'uploads/productimage/1734007884_productNew Suzuki Dzire 1.jpg', 'uploads/productimage/1734007884_productNew Suzuki Dzire 2.jpg', 'uploads/productimage/1734007884_productNew Suzuki Dzire .jpg', 'uploads/productimage/1734007884_productNew Suzuki Dzire 3.jpg', 'uploads/productimage/1734007884_productNew Suzuki Dzire 4.jpg', 'uploads/productimage/1734007884_productNew Suzuki Dzire 5.jpg', 'uploads/productimage/1734007884_productNew Suzuki Dzire 6.jpg', 'uploads/productimage/1734007884_productNew Suzuki Dzire 7.jpg', 'Sedan', 'White', '25.71 KMPL', '1197 CC', '37', '920-960', '1525 mm', '155 KPH', 'Z12E', 'Petrol', 'Automatic', '5', 'Anti-lock Braking System (ABS)', '913 KM To 1855 KM', NULL, 'The 2024 Maruti Suzuki Dzire is a feature-packed compact sedan offering modern upgrades in design, technology, and safety. 2024 Dzire has a fresh design with A', '2024 Maruti Suzuki Dzire, New Maruti Dzire, New Maruti Dzire Price', '<p>The 2024 Maruti Suzuki Dzire is a feature-packed compact sedan offering modern upgrades in design, technology, and safety.</p><h3>Design &amp; Dimensions</h3><ul><li><strong>Exterior:</strong> The 2024 Dzire has a fresh design with a bold grille, Crystal Vision LED headlamps, Y-shaped LED taillights, and dual-tone alloy wheels. Its clean and modern look sets it apart from its predecessors.</li><li><strong>Dimensions:</strong> It measures 3,995 mm in length, 1,735 mm in width, and 1,525 mm in height, making it compact and suitable for urban environments.</li></ul><h3>Interior Features</h3><ul><li><strong>Cabin:</strong> A dual-tone black-and-beige interior with faux wood accents and satin trims creates a premium feel. Features include a 9-inch touchscreen infotainment system with Apple CarPlay and Android Auto, wireless charging, auto climate control, and a single-pane sunroof.</li><li><strong>Comfort:</strong> Rear AC vents, cruise control, and a rear armrest enhance passenger comfort.</li></ul><h3>Performance &amp; Efficiency</h3><ul><li><strong>Engine Options:</strong>&nbsp;It,s Dzire Car Is A 1.2L 3-cylinder petrol engine produces 82 PS and 112 Nm of torque. It\'s paired with a 5-speed manual or AMT transmission. A CNG variant delivers 70 PS and offers fuel economy up to 33.73 km/kg.</li><li><strong>Mileage:</strong> Petrol variants provide 24.79 kmpl (manual) and 25.71 kmpl (AMT), making it one of the most fuel-efficient sedans.</li></ul><h3>Safety</h3><ul><li>The Dzire boasts a 5-star Global NCAP safety rating, a first for Maruti Suzuki sedans in India. Standard features include six airbags, ABS with EBD, electronic stability control, and a 360-degree camera.</li></ul><h3>Variants &amp; Pricing</h3><ul><li>This Car Is Available in four trims: LXi, VXi, ZXi, and ZXi Plus. Prices range from 6.79 lakh to 10.14 lakh (ex-showroom). Subscription options start at 18,248 per month.</li></ul><h3>Competition</h3><p>The Dzire competes with the Hyundai Aura, Tata Tigor, and the upcoming Honda Amaze. Its strong feature set, fuel efficiency, and safety enhancements position it well in the segment.</p><p></p><p>This makes the 2024 Maruti Dzire a well-rounded option for both budget-conscious buyers and those looking for modern features and safety.</p><p><b>Last Updated On 12 December 2024.</b></p>', 1, '2024-12-12 12:51:24', '2024-12-12 12:51:24'),
(34, 'Bikes', 'Bajaj', NULL, 'Popular Cars', '1', 'Kawasaki Ninja 1100SX', 'kawasaki-ninja-1100sx', '13.49 Lakh', '15.23 Lakh, Delhi', '41309', 'uploads/productimage/1734674299_productKawasaki Ninja 1100SX 360.jpg', 'uploads/productimage/1734674299_productKawasaki_Ninja_1100 SX car and.jpg', 'uploads/productimage/1734674299_productkawasaki-tft-instrument- Car ANd.webp', 'uploads/productimage/1734674299_productKawasaki Ninja 1100SX Rear Car And.jpg', 'uploads/productimage/1734674299_productninja rear 1100SX.jpg', 'uploads/productimage/1734674299_productninja-1100sx-engine All.webp', 'uploads/productimage/1734674299_productKawasaki Ninja 1100SX 1.webp', 'uploads/productimage/1734674299_product1100SX f.jpg', 'Coupe', 'Black, Green-Black,', '17.8 kmpl', '1099cc', '19 liters', 'Approximately 235 kg', '835 mm', '244 kmph', 'liquid-cooled, 4-stroke, DOHC 16-valve inline four-cylinder', 'Petrol Fuel injection with 38 mm throttle bodies', '6-speed with Kawasaki Quick Shifter (KQS) optimized for low-RPM performance', '2 Seater', 'Anti-lock Braking System (ABS)', '338 KM', NULL, 'Kawasaki Ninja 1100SX Price In India Starts Rs 13.49 Lakh.  The Kawasaki Ninja 1100SX is a sport-touring motorcycle that combines high-performance features with', 'Kawasaki Ninja 1100SX Price In India,Kawasaki Ninja 1100SX Price, Kawasaki Ninja 1100SX,  Ninja 1100SX Price', '<p><span style=\"font-weight: 700; color: rgb(0, 0, 0); font-family: &quot;Noto Sans&quot;, sans-serif; font-size: 15px; text-transform: capitalize;\">Kawasaki Ninja 1100SX Price In India Starts Rs 13.49 Lakh.</span></p><p>The Kawasaki Ninja 1100SX is a sport-touring motorcycle that combines high-performance features with touring capabilities. Below is an overview of its key specifications:</p><p><strong>Engine and Performance:</strong></p><ul><li><strong>Engine:</strong> 1,099cc liquid-cooled, 4-stroke, DOHC 16-valve inline four-cylinder</li><li><strong>Bore x Stroke:</strong> 77.0 x 59.0 mm</li><li><strong>Compression Ratio:</strong> 11.8:1</li><li><strong>Maximum Power:</strong> 136 PS (134 hp) @ 9,000 rpm</li><li><strong>Maximum Torque:</strong> 113 Nm @ 7,600 rpm</li><li><strong>Fuel System:</strong> Fuel injection with 38 mm throttle bodies</li><li><strong>Transmission:</strong> 6-speed with Kawasaki Quick Shifter (KQS) optimized for low-RPM performance</li></ul><p><strong>Chassis and Dimensions:</strong></p><ul><li><strong>Frame:</strong> Twin-tube aluminum</li><li><strong>Front Suspension:</strong> 41 mm inverted telescopic fork with adjustable compression and rebound damping, and spring preload adjustability</li><li><strong>Rear Suspension:</strong> hlins S46 gas-charged shock absorber with rebound damping and remotely adjustable spring preload</li><li><strong>Front Brakes:</strong> Dual 300 mm discs with radial-mount 4-piston Brembo M4.32 monobloc calipers</li><li><strong>Rear Brake:</strong> Single 260 mm disc with single-piston caliper</li><li><strong>Front Tire:</strong> 120/70ZR17</li><li><strong>Rear Tire:</strong> 190/50ZR17</li><li><strong>Wheelbase:</strong> 1,440 mm</li><li><strong>Seat Height:</strong> 835 mm</li><li><strong>Fuel Capacity:</strong> 19 liters</li><li><strong>Curb Weight:</strong> Approximately 235 kg</li></ul><p><strong>Features:</strong></p><ul><li><strong>Rider Aids:</strong> IMU-enhanced electronics package including traction control, multiple riding modes, and cornering ABS</li><li><strong>Comfort:</strong> Heated grips, handlebar-mounted USB-C outlet, and a relaxed riding position suitable for long-distance touring</li><li><strong>Touring Capability:</strong> Clean-mount pannier system for easy attachment and removal of luggage</li><li><strong>Styling:</strong> Supersport-style full-fairing bodywork offering wind protection and dynamic Ninja aesthetics</li></ul><p>These specifications highlight the Ninja 1100SX\'s blend of performance and comfort, making it a versatile choice for both spirited riding and extended tours.</p><p><span style=\"font-weight: 700; color: rgb(0, 0, 0); font-family: &quot;Noto Sans&quot;, sans-serif; font-size: 15px; text-transform: capitalize;\">Kawasaki Ninja 1100SX Price In India Starts Rs 13.49 Lakh Ex Showroom.</span></p>', 1, '2024-12-20 05:58:19', '2024-12-20 05:58:19'),
(35, 'Cars', 'Toyota', NULL, 'Popular Cars', '3', 'Toyota Fortuner', 'toyota-fortuner', '32.99 Lakh To 50.72 Lakh', '38.89 Lakh To 60.88 Lakh', '92,252', 'uploads/productimage/1734957306_productToyota Fortuner off road.jpg', 'uploads/productimage/1734957306_producttoyota-fortuner4x4-off Front.jpg', 'uploads/productimage/1734957306_productToyota-Fortuner-Dashboard.jpg', 'uploads/productimage/1734957306_productforturner-Set Interior.jpg', 'uploads/productimage/1734957306_productfortuner boot.jpg', 'uploads/productimage/1734957306_productfortuner-exterior-rear-door.webp', 'uploads/productimage/1734957306_productToyota Fortuner Auto R.webp', 'uploads/productimage/1734957306_productToyota Fortuner Auto f.webp', 'SUV', 'White, Black, Matt Black, Off White', 'Petrol: ~10-11 km/l Diesel: ~12-15 km/l', 'Petrol 2694cc / Diesel 2755cc', '80 Liter', '2080 To 2350 Kg', '1835mm', '190 Kmph', '2.8L Turbo-Diesel / 2.7L Naturally Aspirated', 'Petrol/Diesel', '6-speed Manual / 6-speed Automatic (with paddle shifters)', '7-seater SUV', '5-star safety rating from ASEAN NCAP', '8001136 km On A Full Tank', NULL, 'The Toyota Fortuner is a popular mid-size SUV known for its rugged design, reliability, and off-road capabilities. It\'s one of Toyota\'s best-selling SUVs in mar', '2024 Toyota Fortuner, 2024 Toyota Fortuner Specification, Toyota Fortuner Price', '<p>The <strong>Toyota Fortuner</strong> is a popular mid-size SUV known for its rugged design, reliability, and off-road capabilities. It\'s one of Toyota\'s best-selling SUVs in markets like India, Southeast Asia, and Australia.</p><hr><h3><strong>Overview</strong></h3><ul><li><strong>Manufacturer:</strong> Toyota</li><li><strong>Segment:</strong> Mid-size SUV</li><li><strong>Body Type:</strong> 7-seater SUV</li><li><strong>First Launch:</strong> 2005 (Global), 2009 (India)</li><li><strong>Latest Model:</strong> Toyota Fortuner Legender and GR-S (2024 update in some markets)</li></ul><hr><h3><strong>Specifications</strong></h3><h4><strong>Engine Options</strong> (India Market):</h4><ol><li><strong>Diesel Engine:</strong><ul><li>2.8L Turbo-Diesel</li><li>Power: 201 bhp</li><li>Torque: 500 Nm</li><li>Transmission: 6-speed Manual / 6-speed Automatic (with paddle shifters)</li><li>Drive Options: Rear-Wheel Drive (RWD) / Four-Wheel Drive (4WD)</li></ul></li><li><strong>Petrol Engine:</strong><ul><li>2.7L Naturally Aspirated</li><li>Power: 164 bhp</li><li>Torque: 245 Nm</li><li>Transmission: 6-speed Automatic / Manual</li><li>Drive Options: Rear-Wheel Drive (RWD)</li></ul></li></ol><hr><h3><strong>Key Features</strong></h3><h4><strong>Exterior Design:</strong></h4><ul><li>Bold front grille with chrome accents.</li><li>Sleek LED headlamps with DRLs.</li><li>Sculpted bonnet and sharp lines for a sporty look.</li><li>High ground clearance (around 225 mm), suitable for off-road driving.</li><li>18- or 20-inch alloy wheels (varies by variant).</li></ul><h4><strong>Interior Design:</strong></h4><ul><li>Premium leather upholstery (with dual-tone options in higher variants).</li><li>8-way power-adjustable driver and passenger seats.</li><li>Ambient lighting and a panoramic sunroof (available in select variants).</li><li>Spacious 7-seater layout with foldable third-row seats for extra luggage space.</li></ul><h4><strong>Infotainment:</strong></h4><ul><li>8-inch touchscreen infotainment system.</li><li>Android Auto and Apple CarPlay connectivity.</li><li>JBL premium sound system (available in higher variants).</li></ul><h4><strong>Safety Features:</strong></h4><ul><li>7 airbags.</li><li>Vehicle Stability Control (VSC) and Hill Assist Control.</li><li>Electronic Brakeforce Distribution (EBD) and Anti-lock Braking System (ABS).</li><li>360-degree camera (in Legender and GR-S variants).</li><li>Advanced Driver Assistance Systems (ADAS) in higher trims.</li></ul><hr><h3><strong>Mileage</strong></h3><ul><li><strong>Petrol:</strong> ~10-11 km/l</li><li><strong>Diesel:</strong> ~12-15 km/l</li></ul><hr><h3><strong>Variants</strong></h3><ol><li>Toyota Fortuner Standard</li><li>Toyota Fortuner Legender</li><li>Toyota Fortuner GR-S (Sport Edition)</li></ol><hr><h3><strong>Price Range (India, 2024)</strong></h3><ul><li><strong>Standard Variants:</strong> 32.99 lakh - 38.99 lakh</li><li><strong>Legender Variant:</strong> 42.82 lakh</li><li><strong>GR-S Variant:</strong> 50.72 lakh</li></ul><p><em>(Prices may vary based on location and taxes)</em></p><hr><h3><strong>Pros and Cons</strong></h3><h4><strong>Pros:</strong></h4><ol><li>Reliable and durable Toyota build.</li><li>Excellent off-road performance with 4WD capabilities.</li><li>Spacious and luxurious interiors.</li><li>High resale value.</li><li>Low maintenance costs.</li></ol><h4><strong>Cons:</strong></h4><ol><li>High price compared to competitors.</li><li>Stiff ride quality over uneven surfaces.</li><li>Lacks some modern features like a fully digital instrument cluster.</li><li>Lower mileage compared to smaller SUVs.</li></ol><hr><h3><strong>Competitors</strong></h3><ul><li>Mahindra Scorpio-N</li><li>MG Gloster</li><li>Ford Endeavour (Discontinued in India)</li><li>Skoda Kodiaq</li><li>Volkswagen Tiguan Allspace</li></ul><hr><h3><strong>Verdict</strong></h3><p>The Toyota Fortuner is ideal for those looking for a robust, premium SUV with proven reliability and off-road prowess. While its price is on the higher side, its performance, durability, and strong brand value make it a top choice in its segment.</p>', 1, '2024-12-23 12:35:06', '2024-12-23 12:35:06'),
(36, 'Scooters', 'Bajaj', NULL, 'Electric Scooters', '1', 'Bajaj Chetak', 'bajaj-chetak', '1.20 Lakh', '1.26 Lakh To 1.34 Lakh', '3611', 'uploads/productimage/1735024260_productchetak 4.jpg', 'uploads/productimage/1735024260_productChetak 1.jpg', 'uploads/productimage/1735024260_productchetak 2.jpg', 'uploads/productimage/1735024260_productchetak 3.jpg', 'uploads/productimage/1735024260_productchetak 5.jpg', 'uploads/productimage/1735024260_productchetak 6.jpg', 'uploads/productimage/1735024260_productBajaj Chetak Rear.webp', 'uploads/productimage/1735024260_productBajaj Chetak.jpg', 'Minivan', 'Green, Yellow, Black, Blue, White', '123 KM', 'Motor: 3.8 kW electric motor.', NULL, '134 Kg', NULL, '70 km/h', 'Motor: 3.8 kW electric motor.', 'Battery: 3 kWh Lithium-Ion battery.', 'Automatic', '2 Seater', NULL, '90 km per charge. Sport Mode: ~80 km per charge.', '5 hours for a full charge using a standard charger.', 'Bajaj Chetak Review: A Modern Classic The Bajaj Chetak, reborn as an electric scooter, brings a blend of nostalgia and modernity. It retains its classic design', 'Bajaj Chetak price, Bajaj Chetak EV, New Bajaj Chetak', '<h3><strong>Bajaj Chetak Review: A Modern Classic</strong></h3><p>The <strong>Bajaj Chetak</strong>, reborn as an electric scooter, brings a blend of nostalgia and modernity. It retains its classic design while adopting cutting-edge technology, catering to eco-conscious urban riders.</p><hr><h3><strong>Key Highlights</strong></h3><ul><li><strong>Type:</strong> Electric Scooter</li><li><strong>Launch:</strong> 2020 (Electric Version)</li><li><strong>Manufacturer:</strong> Bajaj Auto</li></ul><hr><h3><strong>Design and Build</strong></h3><ol><li><p><strong>Retro Appeal:</strong></p><ul><li>Rounded headlamp and curvy body panels evoke memories of the original Chetak.</li><li>Premium metal body ensures durability.</li></ul></li><li><p><strong>Color Options:</strong></p><ul><li>Vibrant and metallic shades with dual-tone finishes.</li></ul></li><li><p><strong>Build Quality:</strong></p><ul><li>Sturdy and well-finished, reflecting Bajaj\'s focus on durability and aesthetics.</li></ul></li></ol><hr><h3><strong>Performance</strong></h3><ol><li><p><strong>Motor and Battery:</strong></p><ul><li><strong>Motor:</strong> 3.8 kW electric motor.</li><li><strong>Battery:</strong> 3 kWh Lithium-Ion battery.</li></ul></li><li><p><strong>Range:</strong></p><ul><li><strong>Eco Mode:</strong> ~90 km per charge.</li><li><strong>Sport Mode:</strong> ~80 km per charge.</li></ul></li><li><p><strong>Top Speed:</strong></p><ul><li>Limited to ~70 km/h, ideal for city commuting.</li></ul></li><li><p><strong>Charging Time:</strong></p><ul><li>~5 hours for a full charge using a standard charger.</li></ul></li></ol><hr><h3><strong>Features</strong></h3><ol><li><p><strong>Connectivity:</strong></p><ul><li>Bluetooth-enabled instrument cluster for turn-by-turn navigation, call alerts, and more.</li></ul></li><li><p><strong>Smart Features:</strong></p><ul><li>Keyless start.</li><li>Reverse mode for easy parking.</li><li>Regenerative braking to extend battery life.</li></ul></li><li><p><strong>Safety:</strong></p><ul><li>Disc brakes (front) and drum brakes (rear) with a combined braking system (CBS).</li></ul></li><li><p><strong>Comfort:</strong></p><ul><li>Spacious footboard and comfortable seating for rider and pillion.</li></ul></li></ol><hr><h3><strong>Pros and Cons</strong></h3><h4><strong>Pros:</strong></h4><ol><li>Stylish retro-modern design.</li><li>Robust build quality.</li><li>Smooth and silent operation.</li><li>Eco-friendly with low running costs.</li><li>Ample storage space under the seat.</li></ol><h4><strong>Cons:</strong></h4><ol><li>Limited range compared to competitors.</li><li>Slightly higher price for its segment.</li><li>Charging infrastructure still developing in many areas.</li></ol><hr><h3><strong>Competitors</strong></h3><ul><li>TVS iQube Electric</li><li>Ather 450X</li><li>Ola S1 Pro</li><li>Hero Vida V1</li></ul><hr><h3><strong>Verdict</strong></h3><p>The Bajaj Chetak is a compelling choice for urban riders who value design, comfort, and eco-friendliness. While it comes at a premium price, its robust build, stylish appeal, and brand legacy make it a worthy investment for short-distance commuters seeking a blend of tradition and innovation.</p>', 1, '2024-12-24 07:11:00', '2024-12-24 07:11:00');
