(37, 'Cars', 'Nissan', NULL, 'Popular Cars', '3', 'Nissan Magnite', 'nissan-magnite', '6.00 Lakh - 11.66 Lakh *', '6.57 Lakh', '11,078', 'uploads/productimage/1735193435_product6 (1).webp', 'uploads/productimage/1735193435_product8 (1).webp', 'uploads/productimage/1735193435_product7 (1).webp', 'uploads/productimage/1735193435_product2 (1).webp', 'uploads/productimage/1735193435_product1 (1).webp', 'uploads/productimage/1735193435_product3 (1).webp', 'uploads/productimage/1735193435_product4 (1).webp', 'uploads/productimage/1735193435_product5 (1).webp', 'SUV', 'Storm White, Blade Silver, Sunrise Cooper Orange, Flare Garnet Red, Onyx Black, Pearl White, Vivid Blue, Sunrise Cooper Orange, Pearl White,', '17.9 - 19.9 kmpl', '999 cc', '40', NULL, NULL, NULL, '999 cc', 'Petrol', 'Automatic / Manual', '5', '6 Airbags', NULL, NULL, 'Nissan Magnite Price In India', 'Nissan Cars, Nissan Magnite, Nissan In India,', '<p>The Nissan Magnite is a compact SUV that stands out in its segment with its bold design, competitive pricing, and feature-rich offerings. Here are the highlights of the Nissan Magnite:</p><h3>1. <strong>Striking Exterior Design</strong></h3><ul><li><strong>Bold Front Grille</strong>: Features a large hexagonal grille with chrome accents and the new Nissan logo.</li><li><strong>Sleek LED Lighting</strong>: Includes LED bi-projector headlamps, LED DRLs, and LED fog lamps for a modern look.</li><li><strong>Sporty Stance</strong>: Muscular wheel arches, roof rails, and cladding add to the SUV\'s sporty appeal.</li><li><strong>Dual-Tone Color Options</strong>: Available in attractive dual-tone paint schemes.</li></ul><h3>2. <strong>Spacious and Feature-Rich Interior</strong></h3><ul><li><strong>Comfortable Seating</strong>: Spacious cabin with ergonomic seating and ample legroom and headroom.</li><li><strong>Digital Instrument Cluster</strong>: A 7-inch TFT display with customizable views.</li><li><strong>Infotainment System</strong>: An 8-inch touchscreen with wireless Apple CarPlay and Android Auto.</li><li><strong>Premium Features</strong>: Offers a 360-degree camera, ambient lighting, and rear AC vents.</li></ul><h3>3. <strong>Performance</strong></h3><ul><li><strong>Engine Options</strong>:<ul><li>1.0-liter naturally aspirated petrol engine (72 PS/96 Nm).</li><li>1.0-liter turbo-petrol engine (100 PS/160 Nm for manual; 152 Nm for CVT).</li></ul></li><li><strong>Transmission Choices</strong>: 5-speed manual or CVT automatic.</li><li><strong>Fuel Efficiency</strong>: Known for impressive mileage, particularly with the turbo engine.</li></ul><h3>4. <strong>Safety</strong></h3><ul><li><strong>5-Star ASEAN NCAP Rating</strong>: (Applicable to select variants in certain markets).</li><li><strong>Standard Safety Features</strong>: Dual airbags, ABS with EBD, rear parking sensors.</li><li><strong>Advanced Options</strong>: Vehicle dynamic control, traction control, hill start assist, and ISOFIX child seat anchors.</li></ul><h3>5. <strong>Affordability</strong></h3><ul><li><strong>Competitive Pricing</strong>: Positioned as one of the most affordable compact SUVs in its class.</li><li><strong>Value for Money</strong>: Offers a rich feature set at an accessible price point.</li></ul><h3>6. <strong>Warranty and Service</strong></h3><ul><li><strong>Best-in-Class Warranty</strong>: Typically includes a 2-5 year warranty with optional extensions.</li><li><strong>Low Maintenance Costs</strong>: Marketed with affordable service packages.</li></ul><p>The Nissan Magnite offers a strong combination of style, features, and affordability, making it a popular choice for budget-conscious SUV buyers.</p>', 1, '2024-12-26 06:10:35', '2024-12-28 06:29:00'),
(38, 'Cars', 'Nissan', NULL, 'Popular Cars', '3', 'Nissan X-Trail', 'nissan-x-trail', '49.92 Lakh - 49.92 Lakh', '57.72 Lakh', '92,177', 'uploads/productimage/1735199799_product1.jpg', 'uploads/productimage/1735199799_product2.jpg', 'uploads/productimage/1735199799_product3.jpg', 'uploads/productimage/1735199799_product4.jpg', 'uploads/productimage/1735199799_product5.jpg', 'uploads/productimage/1735199799_product6.jpg', 'uploads/productimage/1735199799_product7.jpg', 'uploads/productimage/1735199799_product8.jpg', 'SUV', 'Silver, Pearl White, and Diamond Black', '13.7 kmpl', '1498 cc', '40', NULL, NULL, NULL, '1498 cc', 'Petrol', 'Automatic', '7', '7 Airbags', NULL, NULL, 'Nissan Motor India with the 4th generation, Japan-manufactured Nissan X-TRAIL Relaunched in India on August 1st 2024.', 'Nissan X-Trail, Nissan Magnite, Nissan Cars in India,', '<p>The <strong>Nissan X-Trail</strong> is a larger, more premium SUV in Nissan\'s global lineup, known for its sophisticated design, advanced technology, and versatile utility. Here are the highlights of the <strong>Nissan X-Trail</strong>:</p><hr><h3><strong>1. Striking Exterior Design</strong></h3><ul><li><strong>Premium Styling</strong>: A modern and bold design with sharp LED headlights, a signature V-motion grille, and sleek character lines.</li><li><strong>Rugged Appeal</strong>: Aerodynamic roof rails, cladding, and robust proportions for an adventurous look.</li><li><strong>LED Lighting</strong>: Features LED daytime running lights, taillights, and fog lamps for enhanced visibility and style.</li><li><strong>Wheel Options</strong>: Large alloy wheels (17-19 inches depending on variants) complement its bold stance.</li></ul><hr><h3><strong>2. Luxurious and Spacious Interior</strong></h3><ul><li><strong>Flexible Seating</strong>: Available with 5- or 7-seat configurations for family-friendly versatility.</li><li><strong>Premium Materials</strong>: Leather upholstery, soft-touch materials, and a refined dashboard design.</li><li><strong>Panoramic Sunroof</strong>: Elevates the in-cabin experience.</li><li><strong>Infotainment</strong>: A large touchscreen with Apple CarPlay, Android Auto, and wireless charging.</li><li><strong>Digital Cluster</strong>: A fully digital instrument cluster for modern aesthetics and functionality.</li></ul><hr><h3><strong>3. Performance</strong></h3><ul><li><strong>Engine Options</strong>:<ul><li>Turbocharged petrol and hybrid powertrains (depending on market).</li><li>Smooth CVT or automatic transmission options.</li></ul></li><li><strong>e-POWER Technology</strong>: Hybrid variants use Nissans innovative e-POWER system for improved efficiency and performance.</li><li><strong>All-Wheel Drive (AWD)</strong>: Intelligent AWD system with drive mode selectors for better off-road capabilities.</li></ul><hr><h3><strong>4. Advanced Safety Features</strong></h3><ul><li><strong>Nissan Safety Shield 360</strong>: A suite of driver-assistance technologies, including:<ul><li>Automatic Emergency Braking.</li><li>Blind-Spot Monitoring.</li><li>Lane Departure Warning.</li><li>Adaptive Cruise Control.</li></ul></li><li><strong>ProPILOT Assist</strong>: Semi-autonomous driving technology for enhanced safety and comfort.</li><li><strong>High Crash-Test Ratings</strong>: Built with advanced high-strength materials and a rigid body structure.</li></ul><hr><h3><strong>5. Technology and Connectivity</strong></h3><ul><li><strong>Large Displays</strong>: Includes an advanced infotainment system and head-up display.</li><li><strong>Intelligent Around View Monitor</strong>: 360-degree camera system for easy parking and maneuvering.</li><li><strong>Smartphone Integration</strong>: Wireless Apple CarPlay, Android Auto, and in-car Wi-Fi.</li><li><strong>Premium Audio</strong>: Available Bose premium sound system for an immersive audio experience.</li></ul><hr><h3><strong>6. Versatility</strong></h3><ul><li><strong>Spacious Cargo</strong>: Large boot space with adjustable rear seats for enhanced storage.</li><li><strong>Hands-Free Tailgate</strong>: Electric opening for added convenience.</li><li><strong>Towing Capability</strong>: Equipped to handle moderate towing needs, ideal for adventure trips.</li></ul><hr><h3><strong>7. Warranty and Service</strong></h3><ul><li><strong>Comprehensive Warranty</strong>: Standard 2-5 year coverage, with extended warranty options.</li><li><strong>Maintenance Plans</strong>: Cost-effective service packages for peace of mind.</li></ul><hr><p><b>The Nissan X-Trail is an excellent choice for those seeking a stylish, versatile, and feature-packed SUV that performs well in urban and adventurous settings.</b></p>', 1, '2024-12-26 07:56:39', '2024-12-28 06:28:08'),
(39, 'Cars', 'Skoda', NULL, 'Popular Cars', '3', 'Skoda kushaq', 'skoda-kushaq', '10.89 - 18.79 Lakh', '12,84,050', '24,037/mo', 'uploads/productimage/1735280523_productskoda-kushaq_930x620.webp', 'uploads/productimage/1735280523_productfront-1-4-left-1155389058_930x620.webp', 'uploads/productimage/1735280523_productbumper-181459217_930x620.webp', 'uploads/productimage/1735280523_productorvm-1174891274_930x620.webp', 'uploads/productimage/1735280523_productwheel-arch-768466651_930x620.webp', 'uploads/productimage/1735280523_productfull-dashboard-center-1572308576_930x620.webp', 'uploads/productimage/1735280523_productinfotainment-system-main-menu-2132363344_930x620.webp', 'uploads/productimage/1735280523_productseat-adjustment-controls-levers-762762309_930x620.webp', 'SUV', 'Honey Orange, Tornado Red, Candy White, Brilliant Silver, Carbon Steel', '19.76 kmpl', '1.5 L', '50 L', NULL, NULL, NULL, '999 - 1498 cc', 'Petrol', 'Automatic / Manual', '5', '2 - 6 Airbags', NULL, NULL, 'The Skoda Kushaq stands out for its stylish and attractive exterior design, featuring a unique color scheme and matte finish in the Matte Edition variant.', 'skodakushaq #slavia #skodaslavia #cars #safety #carstagram #carsofinsta #manualcars #jharkhand', '<p>The <strong>koda Kushaq</strong> is a compact SUV that is a part of koda\'s global strategy for the Indian market. Launched in 2021, the Kushaq has been well-received for its modern design, advanced features, and impressive performance. Here are some key highlights of the koda Kushaq:</p><h3>1. <strong>Design and Exterior</strong></h3><ul><li><strong>Bold and Modern Styling</strong>: The Kushaq features koda\'s signature butterfly grille, sharp LED headlamps, and a sculpted body, giving it a strong and dynamic road presence.</li><li><strong>Dimensions</strong>: With a length of around 4221 mm, width of 1760 mm, and a height of 1612 mm, the Kushaq offers a well-balanced design, providing good cabin space.</li><li><strong>Sharp Profile</strong>: The SUV has a muscular side profile, complemented by a sloping roofline and pronounced wheel arches, adding to its sporty appeal.</li><li><strong>LED Tail Lights</strong>: The rear end also features a distinctive LED tail lamp design, providing a modern look.</li></ul><h3>2. <strong>Interior and Comfort</strong></h3><ul><li><strong>Spacious Cabin</strong>: The Kushaq offers a spacious interior with ample legroom and headroom for both front and rear passengers.</li><li><strong>Premium Materials</strong>: High-quality materials are used throughout the cabin, offering a premium feel. It includes soft-touch plastics, leatherette upholstery, and modern trim finishes.</li><li><strong>Infotainment System</strong>: The Kushaq is equipped with a <strong>10-inch touchscreen infotainment system</strong> with <strong>Apple CarPlay, Android Auto</strong>, and <strong>Wireless Android Auto</strong>. The system also supports <strong>connected car features</strong>.</li><li><strong>Virtual Cockpit</strong>: The fully digital instrument cluster (called Virtual Cockpit) adds a futuristic touch to the driving experience.</li></ul><h3>3. <strong>Performance</strong></h3><ul><li><strong>Engine Options</strong>: The Kushaq is available with two petrol engine options:<ul><li>A <strong>1.0-litre TSI 3-cylinder engine</strong> producing around 115 PS and 175 Nm of torque.</li><li>A more powerful <strong>1.5-litre TSI 4-cylinder engine</strong> generating 150 PS and 250 Nm of torque.</li></ul></li><li><strong>Transmission Options</strong>: The 1.0-litre engine comes with a <strong>6-speed manual</strong> or <strong>6-speed automatic transmission</strong>, while the 1.5-litre engine is available with a <strong>6-speed manual</strong> or <strong>7-speed DSG automatic</strong>.</li><li><strong>Driving Experience</strong>: The Kushaq offers a refined driving experience with excellent handling and stability, thanks to its well-tuned suspension and advanced technology.</li></ul><h3>4. <strong>Safety Features</strong></h3><ul><li><strong>Advanced Safety Tech</strong>: The Kushaq comes with a range of safety features, including <strong>6 airbags</strong>, <strong>ABS with EBD</strong>, <strong>ESC (Electronic Stability Control)</strong>, <strong>Hill Hold Assist</strong>, and <strong>Tire Pressure Monitoring System (TPMS)</strong>.</li><li><strong>Crisp Braking</strong>: It is equipped with disc brakes on all wheels, ensuring safe braking performance.</li><li><strong>Rear Parking Sensors and Camera</strong>: Standard across variants, making it easier to maneuver in tight spaces.</li></ul><h3>5. <strong>Technology and Features</strong></h3><ul><li><strong>Wireless Charging</strong>: The Kushaq comes with a wireless charging pad, along with USB Type-C ports for better connectivity.</li><li><strong>Panoramic Sunroof</strong>: The higher variants feature a large panoramic sunroof, adding to the cabin\'s airy feel.</li><li><strong>Automatic Climate Control</strong>: The SUV features a dual-zone automatic climate control system for optimal cabin comfort.</li><li><strong>Ambient Lighting</strong>: It offers customizable ambient lighting, giving the cabin a modern and luxurious atmosphere.</li></ul><h3>6. <strong>Pricing and Variants</strong></h3><ul><li>The koda Kushaq is available in multiple variants and prices vary based on the engine and feature configuration. As of the latest updates, it competes in the compact SUV segment with a strong value proposition.</li></ul><h3>7. <strong>Build Quality</strong></h3><ul><li><strong>Strong Platform</strong>: Built on the <strong>MQB-A0-IN platform</strong>, the same platform used in the koda Slavia, the Kushaq offers a sturdy build quality, which is a hallmark of koda vehicles.</li></ul><h3>8. <strong>Competition</strong></h3><ul><li>The koda Kushaq competes with the likes of the <strong>Kia Seltos</strong>, <strong>Hyundai Creta</strong>, <strong>Volkswagen Taigun</strong>, and <strong>Tata Harrier</strong> in the Indian market, offering a strong combination of premium features, performance, and safety.</li></ul><p>*Overall, the koda Kushaq is a well-rounded SUV that offers a premium feel, modern technology, excellent performance, and a comfortable ride, making it a compelling option for buyers in the competitive compact SUV segment*</p>', 1, '2024-12-26 10:25:37', '2024-12-27 12:22:54'),
(40, 'Cars', 'Skoda', NULL, 'Popular Cars', '3', 'Skoda slavia', 'skoda-slavia', '10.49 - 18.69 Lakh', '12,43,829', '21,270', 'uploads/productimage/1735302474_productSkoda Slavia (1).jpeg', 'uploads/productimage/1735302614_productFrom Dream to reality.jpeg', 'uploads/productimage/1735296682_product3.jpeg', 'uploads/productimage/1735302474_productFrom Dream to reality.jpeg', 'uploads/productimage/1735296682_product5.jpeg', 'uploads/productimage/1735296682_product6.jpeg', 'uploads/productimage/1735296682_product8.jpeg', 'uploads/productimage/1735302474_productSkoda Slavia (2).jpeg', 'Sedan', 'Brilliant Silver,Candy White,Tornado Red', '18.73 - 20.32 km/l', '1.5 L', '45 litre', NULL, NULL, '202 km/h (124 mph)', '999 cc - 1498 cc', 'Petrol', 'Manual, Automatic (TC), Automatic (DCT)', '5 People', 'crash test for both adults and children', NULL, NULL, 'The Skoda Slavia is a sedan car in the Midsize segment, known for its premium design and impressive exterior, making it visually appealing. It offers a well-put', 'skodakushaq #slavia #skodaslavia #cars #safety #carstagram #carsofinsta #manualcars #jharkhand', '<p>The <strong>koda Slavia</strong> is a compact sedan that has made a strong impression, particularly in markets like India. Here are the key highlights of the koda Slavia:</p><h3>1. <strong>Modern Design</strong>:</h3><ul><li><strong>Exterior</strong>: The Slavia features a sleek, modern design with a sharp, sculpted body, LED headlights, and a distinctive grille. The front bumper and wide air intakes give it an assertive stance, making it a standout in the segment.</li><li><strong>Interior</strong>: The cabin boasts a premium look with a clean and ergonomic layout. It offers high-quality materials, a touchscreen infotainment system, and a well-designed dashboard with an emphasis on comfort and tech features.</li></ul><h3>2. <strong>Performance and Engine Options</strong>:</h3><ul><li><strong>Engines</strong>: The Slavia is available with both petrol engines:<ul><li>A <strong>1.0-liter TSI</strong> turbocharged engine producing around <strong>115 PS</strong> of power.</li><li>A <strong>1.5-liter TSI</strong> turbocharged engine, delivering about <strong>150 PS</strong> of power.</li></ul></li><li><strong>Transmission Options</strong>: It offers multiple transmission choices, including a <strong>6-speed manual</strong>, <strong>6-speed automatic</strong> (for the 1.0 TSI), and a <strong>7-speed DSG automatic</strong> (for the 1.5 TSI), giving drivers a range of performance options.</li><li><strong>Fuel Efficiency</strong>: The TSI engines are known for their balance of performance and fuel efficiency, making the Slavia an attractive option for those looking for both power and economy.</li></ul><h3>3. <strong>Feature-Rich Cabin</strong>:</h3><ul><li><strong>Infotainment</strong>: It comes with a <strong>10-inch touchscreen infotainment system</strong> compatible with Apple CarPlay, Android Auto, and other connectivity features.</li><li><strong>Digital Cockpit</strong>: The fully digital <strong>driver\'s display</strong> is customizable and provides a modern tech-savvy experience.</li><li><strong>Premium Features</strong>: The cabin features leatherette upholstery, automatic climate control, wireless charging, and ambient lighting, elevating the overall in-cabin experience.</li></ul><h3>4. <strong>Safety Features</strong>:</h3><ul><li><strong>Advanced Safety</strong>: The koda Slavia is equipped with several safety features, such as <strong>6 airbags</strong>, <strong>ABS with EBD</strong>, <strong>ESC (Electronic Stability Control)</strong>, <strong>TPMS (Tyre Pressure Monitoring System)</strong>, and <strong>Rear Parking Sensors</strong>.</li><li><strong>Build Quality</strong>: Known for its solid build, the Slavia offers robust crash protection, contributing to a high level of occupant safety.</li></ul><h3>5. <strong>Ride and Handling</strong>:</h3><ul><li>The Slavia offers a <strong>well-tuned suspension</strong> system, balancing comfort and sportiness, with precise handling for a more engaging driving experience. Its light steering and composed dynamics make it well-suited for both city driving and highway cruising.</li></ul><h3>6. <strong>Price and Variants</strong>:</h3><ul><li>The koda Slavia is positioned as a premium compact sedan, offering a range of variants that cater to different buyer preferences. It provides great value, combining luxury features with a relatively competitive price point in its segment.</li></ul><h3>7. <strong>Comfort and Space</strong>:</h3><ul><li>The Slavia offers <strong>spacious interiors</strong> with ample legroom and headroom for both front and rear passengers. The large <strong>boot capacity</strong> (around 521 liters) also makes it one of the most practical sedans in its class for long trips or luggage storage.</li></ul><h3>8. <strong>Ride Comfort</strong>:</h3><ul><li>kodas suspension setup in the Slavia ensures a comfortable ride with good absorption of bumps, making it suitable for diverse road conditions while maintaining a solid and stable feel.</li></ul><h3>9. <strong>Market Positioning</strong>:</h3><ul><li>The koda Slavia competes with rivals like the <strong>Honda City</strong>, <strong>Maruti Suzuki Ciaz</strong>, and the <strong>Hyundai Verna</strong>, offering a more European design and engineering touch, which appeals to buyers seeking a more premium and driving-focused sedan experience.</li></ul><p>In summary, the koda Slavia stands out for its <strong>modern design</strong>, <strong>strong performance</strong>, <strong>premium features</strong>, and <strong>solid safety credentials</strong>, making it a well-rounded choice for those in the compact sedan segment.</p>', 1, '2024-12-27 09:30:57', '2024-12-28 06:26:56'),
(41, 'Electric', 'Tata', 'Popular Cars', 'Popular Cars', '2', 'Tata Nexon EV', 'tata-nexon-ev', '12.49 - 17.19 Lakh', '1454746', '27700', 'uploads/productimage/1735296380_productexterior-image-170.webp', 'uploads/productimage/1735296380_productfront-left-side-47.webp', 'uploads/productimage/1735296380_producthill-assist-161.webp', 'uploads/productimage/1735296380_productdashboard-59.webp', 'uploads/productimage/1735296380_productsteering-wheel-54.webp', 'uploads/productimage/1735296380_productac-controls-151.webp', 'uploads/productimage/1735296380_productglovebox-130.webp', 'uploads/productimage/1735296380_productseats-(aerial-view)-53.webp', 'SUV', 'Pristine White, Intensi teal, Flame Red, Daytona Grey, Fearless Purple, Creative Ocean, Empowered Dark.', '390-489 Km', NULL, NULL, NULL, NULL, NULL, NULL, 'Electric', 'Automatic', '5', '6 Airbags', NULL, '11-15 Hours', 'Tata Nexon EV', 'Tata Nexon EV, Tata Cars in India, Tata EV Cars', '<p>The Tata Nexon EV is a subcompact electric SUV that combines performance, technology, and safety, making it a popular choice in India\'s electric vehicle market. Here are its key highlights:</p><p><strong>Performance:</strong></p><ul><li><strong>Motor and Power:</strong> The Nexon EV is equipped with an electric motor producing 94.7 kW (approximately 127 hp) and 245 Nm of torque, enabling acceleration from 0 to 100 km/h in under 9.9 seconds. <span class=\"\" data-state=\"closed\"><div class=\"relative inline-flex items-center\"><a href=\"https://en.wikipedia.org/wiki/Tata_Nexon?utm_source=chatgpt.com\" target=\"_blank\" rel=\"noopener\" class=\"ml-1 inline-flex h-[22px] items-center rounded-xl bg-[#f4f4f4] px-2 text-[0.5em] font-medium text-token-text-secondary dark:bg-token-main-surface-secondary relative top-[-0.094rem] !text-token-text-secondary uppercase hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:hover:bg-token-text-primary group\"><span class=\"truncate\">Wikipedia</span></a></div></span></li><li><strong>Battery and Range:</strong> It offers two battery options: a 30 kWh pack with a range of up to 312 km, and a 40.5 kWh pack providing a range of up to 465 km on a single charge. <span class=\"\" data-state=\"closed\"><div class=\"relative inline-flex items-center\"><a href=\"https://ackodrive.com/car-guide/tata-nexon-ev-features-explained/?utm_source=chatgpt.com\" target=\"_blank\" rel=\"noopener\" class=\"ml-1 inline-flex h-[22px] items-center rounded-xl bg-[#f4f4f4] px-2 text-[0.5em] font-medium text-token-text-secondary dark:bg-token-main-surface-secondary relative top-[-0.094rem] !text-token-text-secondary uppercase hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:hover:bg-token-text-primary group\"><span class=\"truncate\">Ackodrive</span></a></div></span></li><li><strong>Charging Options:</strong> The Nexon EV supports fast charging, allowing the battery to charge from 10% to 80% in just 56 minutes. It can also be charged using a standard 15A power socket, suitable for overnight charging. <span class=\"\" data-state=\"closed\"><div class=\"relative inline-flex items-center\"><a href=\"https://ackodrive.com/car-guide/tata-nexon-ev-features-explained/?utm_source=chatgpt.com\" target=\"_blank\" rel=\"noopener\" class=\"ml-1 inline-flex h-[22px] items-center rounded-xl bg-[#f4f4f4] px-2 text-[0.5em] font-medium text-token-text-secondary dark:bg-token-main-surface-secondary relative top-[-0.094rem] !text-token-text-secondary uppercase hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:hover:bg-token-text-primary group\"><span class=\"truncate\">Ackodrive</span></a></div></span></li></ul><p><strong>Technology:</strong></p><ul><li><strong>Infotainment System:</strong> The vehicle features a 31.24 cm (12.3-inch) cinematic touchscreen infotainment system by HARMAN, providing an immersive user experience. <span class=\"\" data-state=\"closed\"><div class=\"relative inline-flex items-center\"><a href=\"https://ev.tatamotors.com/nexon/ev.html?utm_source=chatgpt.com\" target=\"_blank\" rel=\"noopener\" class=\"ml-1 inline-flex h-[22px] items-center rounded-xl bg-[#f4f4f4] px-2 text-[0.5em] font-medium text-token-text-secondary dark:bg-token-main-surface-secondary relative top-[-0.094rem] !text-token-text-secondary uppercase hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:hover:bg-token-text-primary group\"><span class=\"truncate\">Tata Motors</span></a></div></span></li><li><strong>Connectivity:</strong> It offers multiple voice assistants, including Alexa, ensuring seamless connectivity and hands-free control. <span class=\"\" data-state=\"closed\"><div class=\"relative inline-flex items-center\"><a href=\"https://ev.tatamotors.com/nexon/ev.html?utm_source=chatgpt.com\" target=\"_blank\" rel=\"noopener\" class=\"ml-1 inline-flex h-[22px] items-center rounded-xl bg-[#f4f4f4] px-2 text-[0.5em] font-medium text-token-text-secondary dark:bg-token-main-surface-secondary relative top-[-0.094rem] !text-token-text-secondary uppercase hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:hover:bg-token-text-primary group\"><span class=\"truncate\">Tata Motors</span></a></div></span></li><li><strong>Additional Features:</strong> The Nexon EV includes a fully reconfigurable 26.03 cm (10.25-inch) HD instrument cluster, providing essential driving information at a glance. <span class=\"\" data-state=\"closed\"><div class=\"relative inline-flex items-center\"><a href=\"https://ev.tatamotors.com/nexon/ev.html?utm_source=chatgpt.com\" target=\"_blank\" rel=\"noopener\" class=\"ml-1 inline-flex h-[22px] items-center rounded-xl bg-[#f4f4f4] px-2 text-[0.5em] font-medium text-token-text-secondary dark:bg-token-main-surface-secondary relative top-[-0.094rem] !text-token-text-secondary uppercase hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:hover:bg-token-text-primary group\"><span class=\"truncate\">Tata Motors</span></a></div></span></li></ul><p><strong>Safety:</strong></p><ul><li><strong>Airbags:</strong> The SUV is equipped with multiple airbags, enhancing occupant safety.</li><li><strong>Advanced Driver Assistance:</strong> Features such as Hill Hold Assist provide additional support during inclined starts. <span class=\"\" data-state=\"closed\"><div class=\"relative inline-flex items-center\"><a href=\"https://cars.tatamotors.com.np/utility-vehicles/nexon-ev-max/features.html?utm_source=chatgpt.com\" target=\"_blank\" rel=\"noopener\" class=\"ml-1 inline-flex h-[22px] items-center rounded-xl bg-[#f4f4f4] px-2 text-[0.5em] font-medium text-token-text-secondary dark:bg-token-main-surface-secondary relative top-[-0.094rem] !text-token-text-secondary uppercase hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:hover:bg-token-text-primary group\"><span class=\"truncate\">Tata Motors Cars</span></a></div></span></li><li><strong>Crash Test Ratings:</strong> The Nexon EV is based on the Tata Nexon platform, which has received favorable safety ratings, reflecting its robust build quality.</li></ul><p><strong>Design and Comfort:</strong></p><ul><li><strong>Sunroof:</strong> An electronically operated sunroof allows occupants to enjoy natural light and fresh air, enhancing the overall driving experience.</li><li><strong>Interior Features:</strong> The Nexon EV offers a spacious cabin with comfortable seating, ensuring a pleasant journey for all passengers.</li></ul><p>The Tata Nexon EV stands out with its blend of performance, advanced technology, safety features, and comfort, making it a compelling choice for those considering an electric vehicle in India.</p>', 1, '2024-12-27 10:46:20', '2024-12-27 12:21:15'),
(42, 'Electric', 'Tata', 'Popular Cars', 'Electric Cars', '3', 'Tata Tiago EV', 'tata-tiago-ev', '7.99 - 11.89 Lakh', '832960', '14852', 'uploads/productimage/1735299741_productfront-1-4-left-1043266345_930x620.webp', 'uploads/productimage/1735299741_productfront-205250836_930x620.webp', 'uploads/productimage/1735299741_productrear-back-2083758081_930x620.webp', 'uploads/productimage/1735299741_producttop-view-1176232854_930x620.webp', 'uploads/productimage/1735299741_producttata_tiago_ev_adjustable_driver_seat_a7b0532794.jpg', 'uploads/productimage/1735299741_producttata_tiago_ev_Entertainment_21f7b298b2.jpg', 'uploads/productimage/1735299741_producttata_tiago_ev_leatherette_upholstery_4cb4673a79.jpg', 'uploads/productimage/1735299741_producttata_tiago_ev_steering_wheel_d82ac43dbb.jpg', 'Hatchback', 'Midnight Plum Black Roof, Pristine White Dual Tone, Daytona Grey With Black Roof, Teal Blue Black Roof, Tropical Mist With Black Roof', '315 km/charge', NULL, NULL, NULL, NULL, NULL, NULL, 'Electric', 'Automatic', '5', '6 Airbags', NULL, '3.6H-7.2 kW (10-100%)', 'Tata Tiago EV', 'Tata Tiago EV, Tata Cars in India, Tata EV Cars', '<p>The Tata Tiago.ev is a compact electric hatchback that combines performance, technology, and safety, making it an appealing choice for urban commuters. Here are its key highlights:</p><p><strong>Performance:</strong></p><ul><li><strong>Motor and Power:</strong> The Tiago.ev offers two variants:<ul><li><strong>Long Range (LR):</strong> Equipped with a 55 kW motor delivering 114 Nm of torque, enabling acceleration from 0 to 60 km/h in 5.7 seconds. <span class=\"\" data-state=\"closed\"><div class=\"relative inline-flex items-center\"><a href=\"https://ev.tatamotors.com/tiago/ev/specifications.html?utm_source=chatgpt.com\" target=\"_blank\" rel=\"noopener\" class=\"ml-1 inline-flex h-[22px] items-center rounded-xl bg-[#f4f4f4] px-2 text-[0.5em] font-medium text-token-text-secondary dark:bg-token-main-surface-secondary relative top-[-0.094rem] 