(43, 'Bikes', 'Hero', NULL, 'Popular Bikes', '6', 'Hero Splendor Plus', 'hero-splendor-plus', '74991-78564', '88365', '1385', 'uploads/productimage/1735300594_productHero_Splendor_right_side_view_dd71e52ca8.jpg', 'uploads/productimage/1735300594_productHero_Splendor_rear_view_3b33ff0a9f.jpg', 'uploads/productimage/1735300594_productHero_Splendor_rear_left_side_view_54f1042028.jpg', 'uploads/productimage/1735300594_productHero_Splendor_left_side_view_bb931a3a10.jpg', 'uploads/productimage/1735300594_productHero_Splendor_front_right_side_view_9135fda3d5.jpg', 'uploads/productimage/1735300594_productHero_Splendor_front_left_side_view_fd31d71657.jpg', 'uploads/productimage/1735300594_productHero_Splendor_front_fd1bc8ee73.jpg', 'uploads/productimage/1735300594_productUntitled_2_717fa37b24.jpg', NULL, 'Black with Silver, Black with Purple, Black with Sports Red, Heavy Grey with Green, Firefly Golden, Candy Red and Cloud Silver.', '70 Kmpl', '97 cc', '9.8 L', '112 kg', '1045 mm - 1052 mm', '87 Kmph', '97 cc', 'Petrol', 'Manual', '2', NULL, NULL, NULL, 'Hero Splendor Plus', 'Hero Splendor, Hero Splendor Plus, Hero Bikes in India', '<p>The Hero Splendor Plus is one of the most popular and reliable commuter motorcycles in India, known for its practicality, affordability, and low maintenance costs. Here are the key highlights of the Hero Splendor Plus:</p><h3>1. <strong>Design and Styling</strong></h3><ul><li>Classic commuter bike design with minimalistic aesthetics.</li><li>Available in multiple vibrant color options and graphics.</li><li>Lightweight and easy to handle, making it ideal for city commutes.</li></ul><h3>2. <strong>Engine and Performance</strong></h3><ul><li>Equipped with a 97.2cc single-cylinder, air-cooled engine.</li><li>Produces 8.02 PS of power at 8000 rpm and 8.05 Nm of torque at 6000 rpm.</li><li>i3S (Idle Stop-Start System) technology in select variants improves fuel efficiency.</li></ul><h3>3. <strong>Mileage</strong></h3><ul><li>Excellent fuel efficiency of approximately 65-80 km/l, depending on riding conditions.</li><li>Perfect for daily commuting with low running costs.</li></ul><h3>4. <strong>Features</strong></h3><ul><li>Analogue speedometer and odometer.</li><li>i3S technology for improved mileage.</li><li>Integrated braking system (IBS) for enhanced safety.</li><li>Comfortable seat and ergonomic design for rider and pillion comfort.</li></ul><h3>5. <strong>Suspension and Braking</strong></h3><ul><li>Telescopic front forks and twin hydraulic shock absorbers at the rear for a smooth ride.</li><li>130mm drum brakes on both front and rear wheels.</li></ul><h3>6. <strong>Dimensions and Weight</strong></h3><ul><li>Kerb weight: Approximately 112 kg (varies by variant).</li><li>Fuel tank capacity: 9.8 liters, with a usable reserve of about 1 liter.</li></ul><h3>7. <strong>Variants</strong></h3><ul><li>Hero Splendor Plus comes in multiple variants, including models with and without i3S technology and self-start options.</li></ul><h3>8. <strong>Price</strong></h3><ul><li>Affordable pricing typically starts around 72,000 to 76,000 (ex-showroom), depending on the variant and location.</li></ul><h3>9. <strong>Durability and Maintenance</strong></h3><ul><li>Known for robust build quality and long-lasting performance.</li><li>Easy availability of spare parts and wide service network.</li></ul><h3>10. <strong>Target Audience</strong></h3><ul><li>Ideal for budget-conscious buyers looking for a dependable and fuel-efficient motorcycle for everyday commuting.</li></ul>', 1, '2024-12-27 11:56:34', '2024-12-27 12:20:19'),
(44, 'Bikes', 'Hero', NULL, 'Popular Bikes', '6', 'Hero HF Deluxe', 'hero-hf-deluxe', '59998-68768', '73100', '1138', 'uploads/productimage/1735301173_productHero_HF_Deluxe_Purple_with_Black_fcff474bb8.jpg', 'uploads/productimage/1735301173_productHf_deluxe_abea445381.jpg', 'uploads/productimage/1735301173_productHero_HF_deluxe_side_stand_da2326c8f8.jpg', 'uploads/productimage/1735301173_productHero_HF_deluxe_rear_brake_b31812f530.jpg', 'uploads/productimage/1735301173_productHero_HF_Deluxe_Black_with_Sports_Red_06cf9ba041.jpg', 'uploads/productimage/1735301173_productHero_HF_deluxe_fuel_saving_5b0a219319.jpg', 'uploads/productimage/1735301173_productHero_HF_Deluxe_Purple_with_Black_fcff474bb8.jpg', 'uploads/productimage/1735301173_productHf_deluxe_abea445381.jpg', NULL, 'Techno Blue, Heavy Grey with Green, Black with Purple, Black with Red, Heavy Grey with Black, Candy Blazing Red, Black with Silver, Boon Silver Metallic, Classy Maroon Metallic, Cloud Silver and Cool Mint Green.', '70 Kmpl', '98 cc', '9.6 L', '109 kg', '1045 mm', '85 Kmph', '98 cc', NULL, 'Manual', '2', NULL, NULL, NULL, 'Hero HF Deluxe', 'Hero Deluxe, Hero Bike In India', '<p>The Hero HF Deluxe is another popular commuter bike in Hero\'s lineup, renowned for its affordability, durability, and excellent fuel efficiency. Here\'s a detailed look at its highlights:</p><hr><h3><strong>1. Design and Styling</strong></h3><ul><li>Simple and functional design with modern graphics.</li><li>Available in multiple attractive color combinations.</li><li>Lightweight and compact design, making it ideal for city use.</li></ul><hr><h3><strong>2. Engine and Performance</strong></h3><ul><li>Powered by a 97.2cc single-cylinder, air-cooled engine.</li><li>Produces 8.02 PS of power at 8000 rpm and 8.05 Nm of torque at 6000 rpm.</li><li>Features Hero\'s i3S (Idle Stop-Start System) for better fuel efficiency in select variants.</li><li>Smooth performance for daily commuting needs.</li></ul><hr><h3><strong>3. Mileage</strong></h3><ul><li>Delivers impressive fuel efficiency of approximately 65-70 km/l, depending on riding conditions.</li><li>Excellent for reducing running costs over time.</li></ul><hr><h3><strong>4. Features</strong></h3><ul><li>i3S technology (available in select variants) enhances fuel economy.</li><li>Integrated Braking System (IBS) for added safety.</li><li>Analogue speedometer and odometer.</li><li>Comfortable and well-padded seat for rider and pillion comfort.</li><li>Durable alloy wheels and tubeless tires in higher variants.</li></ul><hr><h3><strong>5. Suspension and Braking</strong></h3><ul><li>Telescopic hydraulic front forks and 2-step adjustable rear shock absorbers.</li><li>Drum brakes at the front and rear with the Integrated Braking System (IBS) for safe braking.</li></ul><hr><h3><strong>6. Dimensions and Weight</strong></h3><ul><li>Kerb weight: Around 110 kg (varies based on variant).</li><li>Fuel tank capacity: 9.6 liters.</li><li>Ground clearance: 165 mm for tackling uneven roads.</li></ul><hr><h3><strong>7. Variants</strong></h3><ul><li>Hero HF Deluxe is offered in multiple variants, including kick-start, self-start, and i3S technology options.</li></ul><hr><h3><strong>8. Price</strong></h3><ul><li>Affordable pricing starts around 60,000 to 68,000 (ex-showroom), depending on the variant and location.</li></ul><hr><h3><strong>9. Durability and Maintenance</strong></h3><ul><li>Known for its sturdy build and reliable engine performance.</li><li>Low maintenance costs with easy availability of spare parts and service centers.</li></ul><hr><h3><strong>10. Target Audience</strong></h3><ul><li>Ideal for budget-conscious riders who prioritize fuel efficiency and reliability for daily commuting.</li></ul>', 1, '2024-12-27 12:06:13', '2024-12-27 12:19:46');
