(45, 'Bikes', 'Bajaj', NULL, 'Popular Bikes', '6', 'Bajaj Pulsar 125 Neon', 'bajaj-pulsar-125-neon', '80416-94138', '81389', '1485', 'uploads/productimage/1735301797_productBajaj_Pulsar_125_Neon_carbike360_10_089eaf4613.jpg', 'uploads/productimage/1735301797_productBajaj_Pulsar_125_Neon_carbike360_94a483e191.jpg', 'uploads/productimage/1735301797_productBajaj_Pulsar_125_Neon_carbike360_3_546730690c.jpg', 'uploads/productimage/1735301797_productBajaj_Pulsar_125_Neon_carbike360_4_6c2f47e6a3.jpg', 'uploads/productimage/1735301797_productBajaj_Pulsar_125_Neon_carbike360_8_c43ba6f891.jpg', 'uploads/productimage/1735301797_productBajaj_Pulsar_125_Neon_carbike360_9_1648ef5f81.jpg', 'uploads/productimage/1735301797_productBajaj_Pulsar_125_Neon_carbike360_9_1648ef5f81.jpg', 'uploads/productimage/1735301797_productBajaj_Pulsar_125_Neon_carbike360_11_f6db4aff6f.jpg', NULL, 'Neon Green, Black Silver, Black Red, Platinum Silver, Neon Blue, Solar Red, and more.', '51.46 Kmpl', '125 CC', '11.5 L', '140 kg', '1060 mm', '105 Kmph', '125 CC', 'Pertrol', NULL, '2', NULL, NULL, NULL, 'Bajaj Pulsar 125 Neon', 'Bajaj Pulsar, Bajaj Bike In India', '<p>The <strong>Bajaj Pulsar 125 Neon</strong> is a sporty and affordable entry-level model in the Pulsar lineup. It\'s designed to appeal to riders who want a balance of performance, style, and fuel efficiency in the 125cc segment. Here are its key highlights:</p><hr><h3><strong>1. Design and Styling</strong></h3><ul><li>Retains the iconic muscular design of the Pulsar family.</li><li>Neon-colored accents on the tank logo, grab rail, and headlamp eyebrows for a sporty appearance.</li><li>Aggressive-looking halogen headlamp with twin pilot lamps.</li><li>Split grab rails and a sculpted fuel tank enhance its aesthetic appeal.</li></ul><hr><h3><strong>2. Engine and Performance</strong></h3><ul><li>Powered by a 124.4cc, single-cylinder, air-cooled DTS-i engine.</li><li>Delivers 11.8 PS of power at 8500 rpm and 10.8 Nm of torque at 6500 rpm.</li><li>Mated to a 5-speed gearbox for smooth gear transitions.</li><li>Offers a punchy performance suitable for city rides and occasional highway trips.</li></ul><hr><h3><strong>3. Mileage</strong></h3><ul><li>Provides a fuel efficiency of around <strong>50-60 km/l</strong>, depending on riding conditions and habits.</li><li>Balanced between performance and economy, ideal for daily use.</li></ul><hr><h3><strong>4. Features</strong></h3><ul><li>Analogue-digital instrument cluster with a tachometer, trip meter, and fuel gauge.</li><li>Backlit switches and premium finish for an upscale feel.</li><li>Clip-on handlebars for sporty ergonomics.</li><li>Dual-tone seat upholstery adds a premium touch.</li></ul><hr><h3><strong>5. Suspension and Braking</strong></h3><ul><li><strong>Front Suspension</strong>: Telescopic forks.</li><li><strong>Rear Suspension</strong>: Twin gas-filled shock absorbers.</li><li><strong>Braking System</strong>:<ul><li>Front disc (optional) and rear drum brakes for controlled stopping.</li><li>Combi-Braking System (CBS) enhances safety during braking.</li></ul></li></ul><hr><h3><strong>6. Dimensions and Weight</strong></h3><ul><li><strong>Kerb Weight</strong>: Around 140 kg, providing stability on the road.</li><li><strong>Fuel Tank Capacity</strong>: 11.5 liters, offering a good range.</li><li><strong>Ground Clearance</strong>: 165 mm, suitable for Indian road conditions.</li></ul><hr><h3><strong>7. Variants</strong></h3><ul><li>Available in both drum and disc brake variants.</li><li>Neon accents come in color options like Neon Red, Neon Silver, and Neon Lime Green.</li></ul><hr><h3><strong>8. Price</strong></h3><ul><li>Starts at approximately <strong>81,000 to 90,000</strong> (ex-showroom), depending on the variant and location.</li></ul><hr><h3><strong>9. Durability and Maintenance</strong></h3><ul><li>Known for Bajaj\'s robust build quality and low maintenance costs.</li><li>Extensive service network ensures easy access to spares and service.</li></ul><hr><h3><strong>10. Target Audience</strong></h3><ul><li>Perfect for young riders and students seeking an affordable, sporty bike with decent performance and style.</li></ul>', 1, '2024-12-27 12:16:37', '2024-12-27 12:18:43'),
(46, 'Electric', 'Tata', 'Popular Cars', 'Electric Cars', '3', 'Tata Curvv EV', 'tata-curvv-ev', '17.49 - 21.99 Lakh', '18,39,926', '32610', 'uploads/productimage/1735302343_producttata-curvv-ev_930x620.webp', 'uploads/productimage/1735302343_productfront-1-4-left-795406188_930x620.webp', 'uploads/productimage/1735302343_productrear-3-4-left-1079484394_930x620.webp', 'uploads/productimage/1735302343_productfull-dashboard-center-1869647332_930x620.webp', 'uploads/productimage/1735302343_productsteering-close-up-49898684_930x620.webp', 'uploads/productimage/1735302343_productignition-749402585_930x620.webp', 'uploads/productimage/1735302343_productrear-interior-from-right-side-door-716106914_930x620.webp', 'uploads/productimage/1735302343_productsunroof-1899140381_930x620.webp', 'SUV', 'Empowered Oxide, Pure Grey, Flame Red, Pristine White, Virtual Sunrise', 'range of approximately 400500 km on a single charge', NULL, NULL, NULL, NULL, NULL, NULL, 'Electric', 'Automatic', '5', '6 Airbags', NULL, '10 to 80 percent in just 40 minutes, using a 70 kW', 'Tata Curvv EV', 'Tata Curvv EV, Tata Cars in India, Tata EV Cars', '<p>The <strong>Tata Curvv EV</strong> is a futuristic coup-style electric SUV that represents Tata Motors\' bold step into next-generation electric mobility. Here are the key highlights:</p><hr><h3><strong>Design:</strong></h3><ul><li><strong>Coup-SUV Silhouette:</strong><ul><li>Combines the ruggedness of an SUV with the sleek aesthetics of a coup.</li><li>A sloping roofline, angular body lines, and a bold front fascia give it a futuristic appearance.</li></ul></li><li><strong>LED Lighting:</strong><ul><li>Slim LED DRLs and signature tail lamps enhance its modern appeal.</li></ul></li></ul><hr><h3><strong>Performance:</strong></h3><ul><li><p><strong>Electric Powertrain:</strong></p><ul><li>Available with two motor options, offering up to <strong>123 kW (165 hp)</strong> for strong performance.</li><li>Acceleration from 0-100 km/h in approximately <strong>8.6 seconds</strong>.</li></ul></li><li><p><strong>Range:</strong></p><ul><li>Offers an impressive range of up to <strong>585 km</strong> (55 kWh variant) on a single charge.</li><li>A smaller battery option (45 kWh) provides up to <strong>502 km</strong> of range.</li></ul></li><li><p><strong>Charging:</strong></p><ul><li>Fast charging capability: <strong>10%-80% in about 40 minutes</strong> with a DC fast charger.</li><li>Supports AC charging with options like a <strong>7.2 kW home wall box charger</strong>.</li></ul></li></ul><hr><h3><strong>Interior &amp; Technology:</strong></h3><ul><li><p><strong>Premium Cabin:</strong></p><ul><li>Spacious and modern interior with a focus on minimalism.</li><li>Dual-screen setup with infotainment and driver information display.</li></ul></li><li><p><strong>Connected Car Features:</strong></p><ul><li>Advanced connectivity through apps and smartwatch integration.</li><li>Remote diagnostics, real-time range updates, and geofencing.</li></ul></li><li><p><strong>Customizable Features:</strong></p><ul><li>Fully digital instrument cluster and adaptive climate control.</li></ul></li></ul><hr><h3><strong>Safety:</strong></h3><ul><li><p><strong>Advanced Safety Features:</strong></p><ul><li>Equipped with multiple airbags, ABS with EBD, and ESP.</li><li>Likely to include <strong>ADAS (Advanced Driver Assistance Systems)</strong> features like lane assist and emergency braking.</li></ul></li><li><p><strong>Strong Build:</strong></p><ul><li>Based on Tatas Generation 2 EV architecture for robust structural safety.</li></ul></li></ul><hr><h3><strong>Launch and Pricing:</strong></h3><ul><li>Expected to be launched in <strong>mid-2024</strong>.</li><li>Anticipated price range: 17.49 lakh to 21.99 lakh (ex-showroom).</li></ul><hr><p>The Tata Curvv EV is a showcase of innovation, blending cutting-edge technology, eco-friendly performance, and bold design, making it an exciting option in the electric vehicle market.</p>', 1, '2024-12-27 12:25:43', '2024-12-27 12:25:43'),
(47, 'Electric', 'Tata', 'Popular Cars', 'Electric Cars', '3', 'Tata Tigor EV', 'tata-tigor-ev', '12.49 - 13.75 Lakh', '1323507', '23883', 'uploads/productimage/1735303330_producttigor-ev-exterior-right-front-three-quarter-2.webp', 'uploads/productimage/1735303330_producttigor-ev-exterior-left-side-view.webp', 'uploads/productimage/1735303330_producttigor-ev-exterior-left-front-three-quarter.webp', 'uploads/productimage/1735303330_producttigor-ev-interior-dashboard-2.webp', 'uploads/productimage/1735303330_producttigor-ev-interior-engine-start-button.webp', 'uploads/productimage/1735303330_producttigor-ev-interior-infotainment-system.webp', 'uploads/productimage/1735303330_producttigor-ev-interior-rear-seats-2.webp', 'uploads/productimage/1735303330_producttigor-ev-interior-horn-boss.webp', 'Sedan', 'Daytona Grey, Magnetic Red, Signature Teal Blue', '315 kms/charge', NULL, NULL, NULL, NULL, NULL, NULL, 'Electric', 'Automatic', '5', '2 Airbags', NULL, '9.4 Hrs @ 220 Volt', 'Tata Tigor EV', 'Tata Tigor EV, Tata Cars in India, Tata EV Cars', '<p>The <strong>Tata Tigor EV</strong> is a compact electric sedan that combines practicality, performance, and eco-friendliness. Here are its key highlights:</p><hr><h3><strong>Performance:</strong></h3><ul><li><p><strong>Electric Motor:</strong></p><ul><li>Powered by a <strong>55 kW (74.7 hp)</strong> permanent magnet synchronous motor.</li><li>Offers a peak torque of <strong>170 Nm</strong>, ensuring a smooth and responsive drive.</li></ul></li><li><p><strong>Acceleration:</strong></p><ul><li>0 to 60 km/h in just <strong>5.7 seconds</strong> for quick city maneuvers.</li></ul></li><li><p><strong>Drive Modes:</strong></p><ul><li>Features multiple driving modes: <strong>Drive</strong> and <strong>Sport</strong>, for efficiency and performance.</li></ul></li></ul><hr><h3><strong>Battery and Range:</strong></h3><ul><li><p><strong>Battery Capacity:</strong></p><ul><li>Equipped with a <strong>26 kWh lithium-ion battery pack</strong>, IP67-rated for water and dust resistance.</li></ul></li><li><p><strong>Range:</strong></p><ul><li>Certified range of <strong>315 km (ARAI)</strong> on a single charge.</li><li>Real-world range typically around <strong>250270 km</strong>, depending on driving conditions.</li></ul></li><li><p><strong>Charging Options:</strong></p><ul><li><strong>DC Fast Charging:</strong> 0% to 80% in approximately <strong>60 minutes</strong>.</li><li><strong>Standard AC Charging:</strong> 0% to 100% in <strong>8.5 hours</strong> using a 15A home socket.</li></ul></li></ul><hr><h3><strong>Safety:</strong></h3><ul><li><p><strong>5-Star Safety Rating:</strong></p><ul><li>Rated 5 stars by Global NCAP for adult safety, making it one of the safest EVs in its segment.</li></ul></li><li><p><strong>Standard Safety Features:</strong></p><ul><li>Dual airbags, ABS with EBD, rear parking sensors, and a rear-view camera.</li><li>Hill ascent and descent assist for added control on slopes.</li></ul></li></ul><hr><h3><strong>Design:</strong></h3><ul><li><p><strong>Exterior:</strong></p><ul><li>Features a bold front grille with a tri-arrow pattern and projector headlamps.</li><li>LED DRLs and stylish alloy wheels add a premium touch.</li></ul></li><li><p><strong>Interior:</strong></p><ul><li>Premium dual-tone cabin with a 7-inch touchscreen infotainment system.</li><li>Supports Android Auto, Apple CarPlay, and Tatas ConnectNext app.</li></ul></li></ul><hr><h3><strong>Technology:</strong></h3><ul><li><p><strong>Connected Car Features:</strong></p><ul><li>Includes features like remote commands, vehicle health monitoring, and real-time location tracking via the ZConnect app.</li></ul></li><li><p><strong>Regenerative Braking:</strong></p><ul><li>Allows energy recovery during deceleration, enhancing range.</li></ul></li></ul><hr><h3><strong>Cost Efficiency:</strong></h3><ul><li><strong>Running Cost:</strong><ul><li>Approximately 1 per kilometer, making it significantly cheaper than ICE vehicles.</li></ul></li></ul><hr><h3><strong>Pricing:</strong></h3><ul><li>Ex-showroom price ranges between <strong>12.49 lakh and 13.75 lakh</strong>, depending on the variant.</li></ul><hr><p>The Tata Tigor EV stands out as a practical and safe electric sedan, ideal for urban commuting and eco-conscious buyers seeking affordability and reliability.</p>', 1, '2024-12-27 12:42:10', '2024-12-27 12:42:10'),
(48, 'Cars', 'Skoda', NULL, 'Popular Cars', '3', 'Skoda kylaq', 'skoda-kylaq', '7.89 - 14.40 Lakh', '9,15,438', '15,998 for 5 Years', 'uploads/productimage/1735362835_product0.jpg', 'uploads/productimage/1735362835_product1.jpg', 'uploads/productimage/1735362835_productkylaq 3.jpg', 'uploads/productimage/1735362835_productkylaq 4.jpg', 'uploads/productimage/1735362835_product6.jpg', 'uploads/productimage/1735362835_product6.jpg', 'uploads/productimage/1735362835_product7.jpg', 'uploads/productimage/1735362835_productkylaq 3.jpg', 'SUV', 'Olive Gold, Tornado Red, Carbon Steel, Brilliant Silver, Candy White, Lava Blue, Deep Black', '18 kilometers per liter', NULL, '45 litre', NULL, NULL, '188 km/h', '1498 cc', 'Petrol', 'Manual, Automatic (TC)', '5', '6 Airbags', 'FWD', NULL, 'Skoda has revealed the full variant-wise prices of the Skoda Kylaq which range between Rs 7.89 lakh and Rs 14.40 lakh (introductory ex-showroom, pan-India). The', 'skodakushaq #slavia #skodaslavia #cars #safety #carstagram #carsofinsta #manualcars #jharkhand', '<p><div class=\"md:pt-0 dark:border-white/20 md:border-transparent md:dark:border-transparent w-full\"><div><div class=\"m-auto text-base px-3 md:px-4 w-full md:px-5 lg:px-4 xl:px-5\"><div class=\"mx-auto flex flex-1 gap-4 text-base md:gap-5 lg:gap-6 md:max-w-3xl\"><div class=\"flex justify-center\"></div></div></div></div></div></p><div class=\"flex-1 overflow-hidden @container/thread\"><div class=\"h-full\"><div class=\"react-scroll-to-bottom--css-yriyn-79elbk h-full\"><div class=\"react-scroll-to-bottom--css-yriyn-1n7m0yu\"><div class=\"flex flex-col text-sm md:pb-9\"><article class=\"w-full scroll-mb-[var(--thread-trailing-height,150px)] text-token-text-primary focus-visible:outline-2 focus-visible:outline-offset-[-4px]\" dir=\"auto\" data-testid=\"conversation-turn-5\" data-scroll-anchor=\"true\"><div class=\"m-auto text-base py-[18px] px-3 md:px-4 w-full md:px-5 lg:px-4 xl:px-5\"><div class=\"mx-auto flex flex-1 gap-4 text-base md:gap-5 lg:gap-6 md:max-w-3xl\"><div class=\"group/conversation-turn relative flex w-full min-w-0 flex-col agent-turn\"><div class=\"flex-col gap-1 md:gap-3\"><div class=\"flex max-w-full flex-col flex-grow\"><div data-message-author-role=\"assistant\" data-message-id=\"1f4973e7-c285-4757-a56e-2d2313875ff8\" dir=\"auto\" class=\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words text-start [.text-message+&amp;]:mt-5\" data-message-model-slug=\"gpt-4o-mini\"><div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\"><div class=\"markdown prose w-full break-words dark:prose-invert light\"><p>The <strong>koda Kylac</strong> is a notable SUV expected to be a key player in koda\'s lineup. While I can\'t access the latest data right now, here are the highlights and key features that have been discussed in various previews of the Kylac:</p><ol><li><p><strong>Design and Size</strong>:</p><ul><li>The koda Kylac is a mid-size SUV, part of koda\'s push into more premium, larger vehicle segments.</li><li>It features a bold, modern design with sharp lines and a sleek profile, incorporating koda\'s latest design language seen in models like the Enyaq iV.</li><li>A large front grille, aggressive LED headlights, and sculpted side panels add to its dynamic appeal.</li></ul></li><li><p><strong>Interior and Comfort</strong>:</p><ul><li>Spacious, with three rows of seating, the Kylac is designed to cater to families with a more luxurious and tech-heavy interior.</li><li>Premium materials and customizable options for a high-end feel.</li><li>Advanced infotainment systems, including a large touchscreen display and digital cockpit, along with Apple CarPlay, Android Auto, and possibly over-the-air software updates.</li></ul></li><li><p><strong>Technology and Features</strong>:</p><ul><li>Strong focus on connectivity, including advanced driver assistance systems (ADAS) like lane-keeping assist, adaptive cruise control, and possibly semi-autonomous driving capabilities.</li><li>Enhanced safety features, with multiple airbags and automatic emergency braking.</li></ul></li><li><p><strong>Powertrain Options</strong>:</p><ul><li>Likely to feature a combination of petrol, diesel, and possibly hybrid powertrains to cater to various markets.</li><li>An electric variant might be available, in line with koda\'s commitment to sustainability, with the MEB platform from Volkswagen Group.</li></ul></li><li><p><strong>Off-Road and Performance</strong>:</p><ul><li>Expected to have solid off-road capabilities with a rugged build and all-wheel drive options.</li><li>The koda Kylac could also feature various driving modes for different terrains, making it versatile for both urban and off-road adventures.</li></ul></li><li><p><strong>Price and Market Position</strong>:</p><ul><li>Positioned as a premium SUV, the Kylac will likely compete against other mid-size SUVs like the Volkswagen Tiguan, Hyundai Santa Fe, and the Toyota Highlander.</li></ul></li></ol><p>*These highlights reflect koda\'s effort to combine luxury, technology, and practicality in the competitive SUV market. As more details emerge, you can expect specifications to evolve.*</p></div></div></div></div><div class=\"mb-2 flex gap-3 empty:hidden -ml-2\"><div class=\"items-center justify-start rounded-xl p-1 flex\"><div class=\"flex items-center\"><span class=\"\" data-state=\"closed\"><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\" aria-label=\"Copy\" data-testid=\"copy-turn-action-button\"><span class=\"flex h-[30px] w-[30px] items-center justify-center\"><svg width=\"24\" height=\"24\" viewBox=\"0 0 24 24\" fill=\"none\" xmlns=\"http://www.w3.org/2000/svg\" class=\"icon-md-heavy\"><path fill-rule=\"evenodd\" clip-rule=\"evenodd\" d=\"M7 5C7 3.34315 8.34315 2 10 2H19C20.6569 2 22 3.34315 22 5V14C22 15.6569 20.6569 17 19 17H17V19C17 20.6569 15.6569 22 14 22H5C3.34315 22 2 20.6569 2 19V10C2 8.34315 3.34315 7 5 7H7V5ZM9 7