-author-role=\"assistant\" data-message-id=\"5b5fb616-6fd8-4c6a-99fe-4144763930d0\" dir=\"auto\" class=\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words text-start [.text-message+&amp;]:mt-5\" data-message-model-slug=\"gpt-4o\"><div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\"><div class=\"markdown prose w-full break-words dark:prose-invert light\"><p>The <strong>TVS Apache RTR 160</strong> is a popular performance-oriented commuter motorcycle in India. It is known for its sporty design, reliable engine, and advanced features. Here are the key highlights of the TVS Apache RTR 160:</p><h3>1. <strong>Design &amp; Styling</strong></h3><ul><li>Aggressive design with sharp body lines.</li><li>LED headlamp with signature DRLs (Daytime Running Lights).</li><li>Aerodynamic tank with edgy graphics for a sporty appeal.</li><li>Rear LED tail lamp with a unique claw-styled design.</li></ul><h3>2. <strong>Engine &amp; Performance</strong></h3><ul><li>Powered by a 159.7cc, single-cylinder, air-cooled engine.</li><li><strong>Two variants</strong>:<ul><li>Carburetor model: Produces 15.53 PS of power.</li><li>Fuel-injection model (Fi): Produces 16.04 PS of power.</li></ul></li><li>Maximum torque: 13.9 Nm.</li><li>Mated to a 5-speed gearbox.</li><li>Offers a smooth performance with a good balance of power and efficiency.</li></ul><h3>3. <strong>Handling &amp; Comfort</strong></h3><ul><li>Race-tuned KYB telescopic front forks and gas-filled twin shock absorbers at the rear.</li><li>Lightweight chassis for excellent handling and stability.</li><li>Available with single and dual-disc brake options.</li><li>Ergonomic seating position for comfortable rides in city and highway conditions.</li></ul><h3>4. <strong>Technology &amp; Features</strong></h3><ul><li>Fully digital instrument cluster with features like lap timer, top speed recorder, and service reminder.</li><li>Glide Through Technology (GTT) for smooth low-speed rides in heavy traffic.</li><li>Dual-mode riding setup for sport and city preferences.</li><li>Grippy tyres for confident handling on various terrains.</li></ul><h3>5. <strong>Safety</strong></h3><ul><li>Single-channel ABS (Anti-lock Braking System) for enhanced safety during braking.</li><li>Durable tubeless tyres for reduced chances of sudden punctures.</li></ul><h3>6. <strong>Mileage &amp; Pricing</strong></h3><ul><li>Claimed mileage: Around 45-50 km/l, depending on riding conditions.</li><li>Pricing: Approximately 1.18 lakh to 1.25 lakh (ex-showroom, may vary based on the variant and location).</li></ul><h3>7. <strong>Colors</strong></h3><ul><li>Available in attractive colors like Racing Red, Gloss Black, Pearl White, Matte Blue, and T-Grey.</li></ul></div></div></div></div></div></div>', 1, '2024-12-28 06:42:21', '2024-12-30 05:41:33'),
(50, 'Cars', 'Mercedes', NULL, 'Popular Cars', '3', 'Merecedes-Benz-GLS', 'merecedes-benz-gls', '1.32 - 1.37 Crore', '1,57,05,326', '2,68,155', 'uploads/productimage/1735368550_product1.jpg', 'uploads/productimage/1735368550_product2.jpg', 'uploads/productimage/1735368550_product3.jpg', 'uploads/productimage/1735368550_product4.jpg', 'uploads/productimage/1735368550_product5.jpg', 'uploads/productimage/1735368550_product6.jpg', 'uploads/productimage/1735368550_product7.jpg', 'uploads/productimage/1735368550_product8.jpg', 'SUV', 'Polar White,Obsidian Black,High-tech Silver,Selenite Silver,Sodalite Blue', 'Mercedes-Benz GLS mileage claimed by owners is 10 kmpl.', '4 L', '90 L', NULL, NULL, '250 kmph', '2989 cc & 2999 cc', 'Petrol & Diesel', '9-speed automatic', '7', 'The GLS has nine airbags, including front, side, and knee airbags', 'AWD', NULL, 'The price of Mercedes-Benz GLS, a 7 seater SUV, ranges from Rs. 1.32 - 1.37 Crore. It is available in 2 variants, with engine options ranging from 2989 to 2999', '#gls #amg #gle #mercedes #mercedesbenz #s #gay #lgbt #w #maybach #c #g #glc #mercedesamg #lgbtq #gaysp #x #cls #gla', '<p>The <strong>Mercedes-Benz GLS</strong> is a luxury full-size SUV that combines opulence, power, and cutting-edge technology. Here are some of its key highlights:</p><h3>1. <strong>Powerful Engine Options</strong></h3><ul><li>The GLS offers a variety of engine choices, including V6 and V8 engines.</li><li><strong>GLS 450</strong>: 3.0-liter inline-six turbocharged engine with mild-hybrid technology, producing around <strong>362 hp</strong>.</li><li><strong>GLS 580</strong>: 4.0-liter twin-turbo V8 engine, generating around <strong>483 hp</strong>.</li><li><strong>AMG GLS 63</strong>: The high-performance variant with a <strong>4.0-liter twin-turbo V8</strong>, delivering <strong>603 hp</strong>.</li></ul><h3>2. <strong>Luxurious Interior</strong></h3><ul><li>Spacious three-row seating that accommodates up to <strong>7 passengers</strong>.</li><li>Premium materials such as <strong>leather upholstery</strong>, <strong>wood trim</strong>, and <strong>ambient lighting</strong>.</li><li><strong>MBUX (Mercedes-Benz User Experience)</strong> system, with <strong>dual 12.3-inch screens</strong> for infotainment and digital displays.</li><li>Optional <strong>heated, ventilated, and massaging seats</strong>, along with <strong>advanced climate control</strong> for a more comfortable experience.</li></ul><h3>3. <strong>Advanced Technology &amp; Safety Features</strong></h3><ul><li>Standard <strong>driver assistance features</strong> like <strong>Active Brake Assist</strong>, <strong>Blind Spot Assist</strong>, <strong>Lane Keeping Assist</strong>, and <strong>Adaptive Cruise Control</strong>.</li><li>Available <strong>Surround View Camera</strong> and <strong>Night View Assist</strong> to enhance visibility.</li><li><strong>MBUX Voice Control</strong> allows intuitive interaction with the infotainment system.</li><li><strong>Augmented Reality Navigation</strong> provides real-time street views and guidance.</li></ul><h3>4. <strong>Dynamic Performance</strong></h3><ul><li>The GLS features <strong>air suspension</strong> with <strong>AIRMATIC</strong> technology for a smooth and adaptive ride.</li><li><strong>4MATIC all-wheel drive</strong> is standard, offering excellent traction and handling across various terrains.</li><li><strong>AMG GLS 63</strong> comes with an <strong>AMG-tuned suspension</strong> for sporty handling and enhanced performance.</li></ul><h3>5. <strong>Design</strong></h3><ul><li>Bold, commanding exterior with <strong>LED headlamps</strong>, sleek lines, and large alloy wheels.</li><li>Refined, aggressive design for the AMG models with unique grille and styling details.</li><li>Panoramic sunroof, chrome accents, and various exterior color options elevate the vehicle\'s appearance.</li></ul><h3>6. <strong>Comfort &amp; Convenience</strong></h3><ul><li>Available <strong>Massaging Seats</strong> for front and rear passengers, providing added relaxation.</li><li><strong>Power-folding rear seats</strong> and a <strong>generous cargo area</strong>, with an option for <strong>powered tailgate</strong> for convenience.</li><li>Optional <strong>Executive Rear Seats</strong>, offering reclining and enhanced legroom for a first-class experience.</li></ul><h3>7. <strong>Off-Road Capability</strong></h3><ul><li>Equipped with <strong>off-road driving modes</strong>, the GLS can tackle various terrains, thanks to its <strong>adjustable air suspension</strong> and <strong>4MATIC all-wheel drive</strong> system.</li></ul><h3>8. <strong>Customizable Options</strong></h3><ul><li>A wide range of personalization options for both interior and exterior, including different wheel designs, trim materials, and ambient lighting choices.</li><li>Available <strong>Driver Assistance Packages</strong> and <strong>Premium Packages</strong> for added luxury and technology.</li></ul><h3>9. <strong>Hybrid Technology (Mild-Hybrid)</strong></h3><ul><li>Mild-hybrid technology in certain models like the GLS 450, which improves fuel efficiency and provides additional torque via an integrated electric motor.</li></ul><h3>10. <strong>Price Range</strong></h3><ul><li>The GLS is positioned as a premium luxury vehicle, with prices starting at around <strong>$80,000</strong> for base models, and can exceed <strong>$150,000</strong> for higher trims like the AMG GLS 63.</li></ul><p>*The Mercedes-Benz GLS stands as an ideal choice for buyers seeking a high-performance, luxurious, and tech-loaded full-size SUV*</p>', 1, '2024-12-28 06:49:10', '2024-12-28 07:22:38'),
(51, 'Bikes', 'Royal Enfield', NULL, 'Popular Bikes', '6', 'Royal Enfield Classic 350', 'royal-enfield-classic-350', '1.93 Lakh - 2.24 Lakh', '2.45', '3566', 'uploads/productimage/1735369162_product8a68d5ca-ba91-4688-8438-a4a0834d5335--New Project (66) (1).webp', 'uploads/productimage/1735369162_productUntitled_8_c170d43579.jpg', 'uploads/productimage/1735369162_productUntitled_9_b29b82c516.jpg', 'uploads/productimage/1735369162_productUntitled_10_6082a5d2e2.jpg', 'uploads/productimage/1735369162_productUntitled_6_0b5d005037.jpg', 'uploads/productimage/1735369162_product4_2e75435a16.jpg', 'uploads/productimage/1735369162_product8a68d5ca-ba91-4688-8438-a4a0834d5335--New Project (66) (1).webp', 'uploads/productimage/1735369162_productUntitled_9_b29b82c516.jpg', NULL, 'Halcyon Black, Halcyon Green, Halcyon Grey, Signals Desert Sand, Signals Marsh Grey, Dark Stealth Black, Dark Gunmetal Grey, Chrome Red, and Chrome Bronze.', '41.55 Kmpl', '350 cc', '13 L', '195 kg', '1090 mm', '115 KMPH', '350 CC', 'Petrol', NULL, '2', NULL, NULL, NULL, 'Royal Enfield Classic 350', 'Royal Enfield, Royal Enfield Bikes in India', '<p>The <strong>Royal Enfield Classic 350</strong> is one of the most iconic motorcycles in India, known for its timeless design, robust build, and comfortable riding experience. Here are the key highlights of the Royal Enfield Classic 350:</p><hr><h3>1. <strong>Design &amp; Styling</strong></h3><ul><li>Retro-inspired design with a modern touch.</li><li>Classic round headlamp with chrome bezels.</li><li>Teardrop-shaped fuel tank with signature 3D badging.</li><li>Comfortable wide seat with a well-cushioned design for long rides.</li><li>Available in a variety of stylish color options, including dual-tone and matte finishes.</li></ul><hr><h3>2. <strong>Engine &amp; Performance</strong></h3><ul><li>Powered by a 349cc, single-cylinder, air-and-oil-cooled engine.</li><li>Output: <strong>20.2 PS of power</strong> and <strong>27 Nm of torque</strong>.</li><li>Mated to a smooth 5-speed gearbox.</li><li>Equipped with an advanced counterbalance system to reduce vibrations.</li><li>Refined and reliable J-Series engine platform ensures improved performance and efficiency.</li></ul><hr><h3>3. <strong>Handling &amp; Comfort</strong></h3><ul><li>Dual-cradle frame for better stability and handling.</li><li>Telescopic front suspension and twin shock absorbers at the rear.</li><li>Upright riding posture for fatigue-free long-distance rides.</li><li>Generous ground clearance for tackling uneven roads.</li></ul><hr><h3>4. <strong>Technology &amp; Features</strong></h3><ul><li>Semi-digital instrument cluster with an analog speedometer and digital display for odometer, fuel gauge, and trip meters.</li><li><strong>Turn-by-turn navigation</strong> with Royal Enfields Tripper Navigation system (select variants).</li><li>Halogen headlamp for a vintage feel and adequate illumination.</li><li>USB charging port for on-the-go convenience.</li></ul><hr><h3>5. <strong>Safety</strong></h3><ul><li>Dual-channel ABS (Anti-lock Braking System) for confident braking.</li><li>Disc brakes on both front and rear wheels.</li><li>Wider tyres for better grip and stability.</li></ul><hr><h3>6. <strong>Mileage &amp; Pricing</strong></h3><ul><li>Claimed mileage: Around <strong>35-40 km/l</strong>, depending on riding style and conditions.</li><li>Pricing: Starts at approximately 1.93 lakh and goes up to 2.24 lakh (ex-showroom, varies by variant and location).</li></ul><hr><h3>7. <strong>Colors &amp; Variants</strong></h3><ul><li>Wide range of color options, including <strong>Halcyon Black</strong>, <strong>Signals Marsh Grey</strong>, <strong>Gunmetal Grey</strong>, and <strong>Chrome Red</strong>.</li><li>Available in multiple variants: <strong>Single-channel ABS</strong> and <strong>Dual-channel ABS</strong> options.</li></ul><hr><p>The <strong>Royal Enfield Classic 350</strong> is perfect for those seeking a combination of classic charm, robust build, and modern reliability. It caters to riders who value a relaxed and enjoyable riding experience for both city commutes and long highway journeys.</p>', 1, '2024-12-28 06:59:22', '2024-12-28 06:59:22'),
