ta-message-id=\"f87f56f3-9732-4184-97fc-6f59bfe1ec4b\" dir=\"auto\" class=\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words text-start [.text-message+&amp;]:mt-5\" data-message-model-slug=\"gpt-4o\"><div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\"><div class=\"markdown prose w-full break-words dark:prose-invert light\"><p>The Hero Xtreme 125R is a sporty commuter motorcycle that combines performance, style, and efficiency, making it a compelling choice in the 125cc segment.</p><p><strong>Key Highlights:</strong></p><ul><li><p><strong>Engine and Performance:</strong> Powered by a 124.7cc, air-cooled, single-cylinder engine, the Xtreme 125R delivers 11.4 bhp at 8,250 rpm and 10.5 Nm of torque at 6,500 rpm. This setup ensures responsive acceleration, with the bike achieving 0-60 km/h in approximately 5.9 seconds. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Fuel Efficiency:</strong> The motorcycle offers an impressive mileage of around 66 km/l, making it economical for daily commuting. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Design and Features:</strong> The Xtreme 125R boasts a sporty design with a low-slung LED headlamp, muscular fuel tank, and split-step seat. It comes equipped with full-LED lighting, a fully digital instrument console, and optional Bluetooth connectivity for call and text alerts. Additional features include hazard lamps and a choice between Integrated Braking System (IBS) and single-channel ABS for enhanced safety. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Chassis and Suspension:</strong> Built on a diamond-type frame, the bike is fitted with 37mm telescopic front forks and a rear monoshock, providing a balanced and comfortable ride. The braking system includes a 276mm front disc and an optional rear disc or drum brake, depending on the variant. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Dimensions and Weight:</strong> With a wheelbase of 1,319 mm and a ground clearance of 180 mm, the Xtreme 125R offers stability and agility. It has a fuel tank capacity of 10 liters and a curb weight of 136 kg, contributing to its nimble handling. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Variants and Pricing:</strong> Available in two variantsIBS and single-channel ABSthe Xtreme 125R is priced between 95,000 and 99,500 (ex-showroom). It comes in three color options: Firestorm Red, Cobalt Blue, and Stallion Black. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li></ul><p>Overall, the Hero Xtreme 125R stands out as a well-rounded motorcycle, offering a blend of performance, efficiency, and modern features tailored for urban riders.</p><p>For a visual overview and more insights, you might find this video review helpful:</p></div></div></div></div></div></div>', 1, '2024-12-28 07:09:19', '2024-12-28 07:10:36');
