(53, 'Bikes', 'TVS', NULL, 'Popular Bikes', '6', 'TVS Raider', 'tvs-raider', '84,869 - 1.04 Lakh', '1.14 Lakh', '1568', 'uploads/productimage/1735370393_product1.JPG', 'uploads/productimage/1735370393_product2.jpg', 'uploads/productimage/1735370393_product3.jpg', 'uploads/productimage/1735370393_product4.jpg', 'uploads/productimage/1735370393_product1.JPG', 'uploads/productimage/1735370393_product2.jpg', 'uploads/productimage/1735370393_product3.jpg', 'uploads/productimage/1735370393_product4.jpg', NULL, 'Fiery Yellow, Blazing Blue, Striking Red, and Wicked Black', '71.94 Kmpl', '125 cc', '10 L', '123 kg to 122 kg', '1028 mm', '99 Kmph', '125 cc', 'Petrol', NULL, '2', NULL, NULL, NULL, 'TVS Raider', 'TVS Raider, TVS Bikes In India', '<p>The TVS Raider 125 is a dynamic and feature-rich motorcycle in the 125cc segment, designed to offer a blend of performance, efficiency, and modern technology.</p><p><strong>Key Highlights:</strong></p><ul><li><p><strong>Engine and Performance:</strong> The Raider 125 is equipped with a 124.8cc, air and oil-cooled, single-cylinder engine that produces 11.38 PS at 7,500 rpm and 11.2 Nm of torque at 6,000 rpm. This setup enables the bike to accelerate from 0 to 60 km/h in approximately 5.9 seconds, offering a responsive and engaging ride. <span class=\"\" data-state=\"closed\"></span></p><div class=\"relative inline-flex items-center\"><br></div><p></p></li><li><p><strong>Fuel Efficiency:</strong> The motorcycle boasts an impressive mileage of around 71.94 km/l, making it an economical choice for daily commuting. <span class=\"\" data-state=\"closed\"></span></p><div class=\"relative inline-flex items-center\"><strong style=\"font-size: 1rem;\">Design and Features:</strong><span style=\"font-size: 1rem;\"> The Raider 125 features a sporty and aggressive design, highlighted by a distinctive LED headlamp and a sculpted fuel tank. It comes with a first-in-segment reverse LCD digital cluster and offers ride modes, enhancing the riding experience. Additionally, the bike includes under-seat storage with a USB charging port, providing practical convenience for riders.</span></div></li><li><br><p></p></li><li><p><strong>Chassis and Suspension:</strong> Built on a robust frame, the Raider 125 is fitted with telescopic front forks and a rear monoshock with 5-step adjustability, ensuring a comfortable and stable ride across various terrains. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Braking System:</strong> The motorcycle is available in variants with front disc and rear drum brakes, equipped with Synchronized Braking Technology (SBT) for enhanced safety and control. <span class=\"\" data-state=\"closed\"></span></p><div class=\"relative inline-flex items-center\"><br></div><p></p></li><li><p><strong>Dimensions and Weight:</strong> With a wheelbase of 1,326 mm and a ground clearance of 180 mm, the Raider 125 offers stability and agility. It has a fuel tank capacity of 10 liters and a kerb weight of 123 kg, contributing to its nimble handling. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Variants and Pricing:</strong> The TVS Raider 125 is available in multiple variants, with prices starting from 85,010 for the base drum brake variant and going up to 1,04,471 for the top-end SX variant (ex-showroom, Delhi). It comes in several color options, including Striking Red, Wicked Black, Fiery Yellow, and Blazing Blue. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li></ul><p>Overall, the TVS Raider 125 stands out as a well-rounded motorcycle, offering a compelling mix of performance, efficiency, and advanced features tailored for modern riders.</p><p>For a visual overview and more insights, you might find this video review helpful:</p>', 1, '2024-12-28 07:19:53', '2024-12-28 07:19:53'),
(54, 'Bikes', 'Bajaj', NULL, 'Popular Bikes', '6', 'Bajaj Pulsar 150', 'bajaj-pulsar-150', '1.10 Lakh - 1.15 Lakh', '1.26', '2039', 'uploads/productimage/1735372455_productBajaj_Pulsar_150_carbike360_8_ff095e159a.jpg', 'uploads/productimage/1735372455_productBajaj_Pulsar_150_carbike360_9_c439fb8bf3.jpg', 'uploads/productimage/1735372455_productBajaj_Pulsar_150_carbike360_2_a075e5e674.jpg', 'uploads/productimage/1735372455_productBajaj_Pulsar_150_carbike360_5_4e111f329c.jpg', 'uploads/productimage/1735372455_product5.jpg', 'uploads/productimage/1735372455_productBajaj_Pulsar_150_carbike360_8_ff095e159a.jpg', 'uploads/productimage/1735372455_productBajaj_Pulsar_150_carbike360_2_a075e5e674.jpg', 'uploads/productimage/1735372455_product5.jpg', NULL, 'Sapphire Blue, Pearl White, Neon Lime Green, Neon Silver, Volcanic Red', '48 Kmpl', '150 CC', '15 L', '148 kg', '1115 mm', '115 Kmph', '150 CC', 'Petrol', NULL, '2', NULL, NULL, NULL, 'Bajaj Pulsar 150', 'Bajaj Pulsar 150, Bajaj Bikes In India', '<p>The Bajaj Pulsar 150 is a popular commuter motorcycle in India, known for its blend of performance, efficiency, and reliability.</p><p><strong>Key Highlights:</strong></p><ul><li><p><strong>Engine and Performance:</strong> The Pulsar 150 is powered by a 149.5cc, air-cooled, single-cylinder, DTS-i engine that produces 14 PS of power at 8,500 rpm and 13.25 Nm of torque at 6,500 rpm. This setup offers a balanced performance suitable for both city commuting and occasional highway rides. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Fuel Efficiency:</strong> The motorcycle offers a mileage of approximately 47.5 km/l, making it an economical choice for daily use. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Design and Features:</strong> The Pulsar 150 features a muscular fuel tank, sporty decals, and a comfortable split-seat design. It comes equipped with a digital-analog instrument cluster, providing essential information to the rider. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Chassis and Suspension:</strong> Built on a double-cradle frame, the bike is fitted with telescopic front forks and a twin shock absorber setup at the rear, ensuring a comfortable ride over various terrains. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Braking System:</strong> The Pulsar 150 is available in variants with front disc and rear drum brakes, equipped with an anti-lock braking system (ABS) for enhanced safety and control. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Dimensions and Weight:</strong> The motorcycle has a wheelbase of 1,320 mm, ground clearance of 165 mm, and a kerb weight of 148 kg, contributing to its stability and handling. It also features a fuel tank capacity of 15 liters, suitable for long rides without frequent refueling. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Variants and Pricing:</strong> The Bajaj Pulsar 150 is available in multiple variants, with prices starting from 1,10,419 (ex-showroom, Delhi). It comes in several color options, including Sparkle Black Red, Sparkle Black Blue, and Sparkle Black Silver. <span class=\"\" data-state=\"closed\"></span></p><div class=\"relative inline-flex items-center\"><span style=\"font-size: 1rem;\">Overall, the Bajaj Pulsar 150 continues to be a strong contender in the 150cc segment, offering a combination of performance, fuel efficiency, and features that cater to a wide range of riders</span></div></li></ul>', 1, '2024-12-28 07:54:15', '2024-12-28 07:54:15'),
(55, 'Bikes', 'Hero', NULL, 'Popular Bikes', '6', 'Hero Passion Plus', 'hero-passion-plus', '78,451 - 78,451', '94227', '1449', 'uploads/productimage/1735372840_product1.jpg', 'uploads/productimage/1735372840_product2.jpg', 'uploads/productimage/1735372840_product3.jpg', 'uploads/productimage/1735372840_product4.jpg', 'uploads/productimage/1735372840_product5.jpg', 'uploads/productimage/1735372840_product2.jpg', 'uploads/productimage/1735372840_product4.jpg', 'uploads/productimage/1735372840_product1.jpg', NULL, 'black with sports red, black with heavy grey, black with frost blue, and sports red.', '68 Kmpl', '97 cc', '11 L', '115 KG', '1087 mm', '85 Kmph', '97 CC', 'Petrol', NULL, '2', NULL, NULL, NULL, 'Hero Passion Plus', 'Hero Passion Plus, Hero Bikes in India', '<p>The Hero Passion Plus is a popular commuter motorcycle in India, known for its reliability, fuel efficiency, and practical features.</p><p><strong>Key Highlights:</strong></p><ul><li><p><strong>Engine and Performance:</strong> The Passion Plus is powered by a 97.2cc, air-cooled, single-cylinder, 4-stroke engine that produces 5.9 kW (approximately 7.91 bhp) at 8,000 rpm and 8.05 Nm of torque at 6,000 rpm. This engine is equipped with fuel injection technology, ensuring efficient fuel delivery and compliance with BS6 emission norms. <span class=\"\" data-state=\"closed\"></span></p><div class=\"relative inline-flex items-center\"><br></div><p></p></li><li><p><strong>Fuel Efficiency:</strong> The motorcycle offers an impressive mileage of approximately 60 km/l, making it an economical choice for daily commuting. <span class=\"\" data-state=\"closed\"></span></p><div class=\"relative inline-flex items-center\"><br></div><p></p></li><li><p><strong>Design and Features:</strong> The Passion Plus features a sleek and stylish design with vibrant color options, including Sports Red, Black Nexus Blue, and Black Heavy Grey. It comes equipped with a digital-analog instrument cluster, providing essential information to the rider. The bike also includes practical features such as tubeless tires and a comfortable seat, enhancing the overall riding experience. <span class=\"\" data-state=\"closed\"></span></p><div class=\"relative inline-flex items-center\"><br></div><p></p></li><li><p><strong>Chassis and Suspension:</strong> Built on a double cradle frame, the bike is fitted with telescopic front forks and twin rear shock absorbers, ensuring a comfortable ride over various terrains. <span class=\"\" data-state=\"closed\"></span></p><div class=\"relative inline-flex items-center\"><br></div><p></p></li><li><p><strong>Braking System:</strong> The Passion Plus is equipped with drum brakes on both ends, complemented by the Integrated Braking System (IBS) for enhanced safety and control. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Dimensions and Weight:</strong> The motorcycle has a kerb weight of 115 kg, a seat height of 790 mm, and a ground clearance of 168 mm, contributing to its stability and ease of handling. It also features a fuel tank capacity of 11 liters, suitable for long rides without frequent refueling. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Pricing:</strong> The Hero Passion Plus is priced at 78,451 (ex-showroom, Delhi), offering a value-for-money proposition in the commuter segment.</p></li></ul>', 1, '2024-12-28 08:00:40', '2024-12-28 08:00:40'),
(56, 'Bikes', 'Hero', NULL, 'Popular Bikes', '6', 'Hero Glamour', 'hero-glamour', '82,598 - 86,598', '93350', '1526', 'uploads/productimage/1735373282_product1.jpg', 'uploads/productimage/1735373282_product2.jpg', 'uploads/productimage/1735373282_product3.jpg', 'uploads/productimage/1735373282_product4.jpg', 'uploads/productimage/1735373282_product5.jpg', 'uploads/productimage/1735373282_product6.jpg', 'uploads/productimage/1735373282_product7.jpg', 'uploads/productimage/1735373282_product2.jpg', NULL, 'Black-Sports Red, Candy Blazing Red, and Techno Blue met Black', '55 Kmpl', '125 CC', '10L', '122 KG', '1074 mm', '95 KMPH', '125 CC', 'Petrol', NULL, '2', NULL, NULL, NULL, 'Hero Glamour', 'Hero Glamour, Hero Bikes in India', '<p>The Hero Glamour is a well-regarded commuter motorcycle in India, offering a blend of performance, fuel efficiency, and modern features.</p><p><strong>Key Highlights:</strong></p><ul><li><p><strong>Engine and Performance:</strong> The Glamour is powered by a 125cc air-cooled, single-cylinder engine that delivers 10.53 PS at 7,500 rpm and 10.4 Nm of torque at 6,000 rpm. This engine is mated to a 5-speed gearbox, providing smooth acceleration and a comfortable riding experience. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Fuel Efficiency:</strong> The motorcycle boasts an impressive mileage of approximately 63 km/l, making it an economical choice for daily commuting. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Design and Features:</strong> The Glamour features a muscular fuel tank, stylish body graphics, and split alloy wheels that enhance its visual appeal. It comes equipped with a full digital console for improved visibility, a real-time mileage indicator to monitor fuel efficiency, and a mobile charging port for on-the-go connectivity. Additionally, the bike includes an LED headlamp for better illumination and a side stand indicator for enhanced safety. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Chassis and Suspension:</strong> Built on a robust frame, the Glamour is fitted with telescopic front forks and adjustable rear shock absorbers, ensuring a comfortable ride over various terrains. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Braking System:</strong> The motorcycle is available with front disc and rear drum brakes, providing adequate stopping power for urban and highway riding. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Dimensions and Weight:</strong> The Glamour has a ground clearance of 170 mm, contributing to its stability and ease of handling. It features a fuel tank capacity of 10 liters, suitable for long rides without frequent refueling. <span class=\"\" data-state=\"closed\"></span></p><br><p></p></li><li><p><strong>Variants and Pricing:</strong> The Hero Glamour is available in multiple variants, with prices starting from 82,598 (ex-showroom, Delhi). It comes in several color options, allowing riders to choose according to their preferences</p></li></ul>', 1, '2024-12-28 08:08:02', '2024-12-28 08:08:02'),
(57, 'Cars', 'Mercedes', NULL, 'Popular Cars', '3', 'Mercedes-Benz GLE', 'mercedes-benz-gle', '97.85 Lakh - 1.15 Crore', '1,18,41,741', '1,87,112', 'uploads/productimage/1735375696_product1.jpg', 'uploads/productimage/1735375696_product2.jpg', 'uploads/productimage/1735375696_product3.jpg', 'uploads/productimage/1735375696_product4.jpg', 'uploads/productimage/1735375696_product5.jpg', 'uploads/productimage/1735375696_product6.jpg', 'uploads/productimage/1735375696_product7.jpg', 'uploads/productimage/1735375696_product8.jpg', 'SUV', 'Selenite Grey Metallic, Polar White, High-Tech Silver Metallic, Obsidian Black Metallic, Sodalite Blue ...', '7.11 kmpl', NULL, '93 liters', NULL, NULL, '230 to 250 kmph', '1993 cc, 2989 cc & 2999 cc', 'Diesel & Hybrid', '9-speed automatic transmission', 'five passengers, with an optional third row for two more passengers.', NULL, 'AWD', NULL, 'A new GLE 300d AMG-Line variant has been introduced in the GLE lineup, while the old 300d variant has been discontinued.', 'gle are #gle #amg #s #mercedesbenz #c #mercedes #w #mercedesamg #brabus #coupe #g #benz #cls #e #glc #cars #glecoupe ...', '<p><div class=\"md:pt-0 dark:border-white/20 md:border-transparent md:dark:border-transparent w-full\"><div><div class=\"m-auto text-base px-3 md:px-4 w-full md:px-5 lg:px-4 xl:px-5\"><div class=\"mx-auto flex flex-1 gap-4 text-base md:gap-5 lg:gap-6 md:max-w-3xl\"><div class=\"flex justify-center\"></div></div></div></div></div></p><div class=\"flex-1 overflow-hidden @container/thread\"><div class=\"h-full\"><div class=\"react-scroll-to-bottom--css-stcvq-79elbk h-full\"><div class=\"react-scroll-to-bottom--css-stcvq-1n7m0yu\"><div class=\"flex flex-col text-sm md:pb-9\"><article class=\"w-full scroll-mb-[var(--thread-trailing-height,150px)] text-token-text-primary focus-visible:outline-2 focus-visible:outline-offset-[-4px]\" dir=\"auto\" data-testid=\"conversation-turn-3\" data-scroll-anchor=\"true\"><div class=\"m-auto text-base py-[18px] px-3 md:px-4 w-full md:px-5 lg:px-4 xl:px-5\"><div class=\"mx-auto flex flex-1 gap-4 text-base md:gap-5 lg:gap-6 md:max-w-3xl\"><div class=\"group/conversation-turn relative flex w-full min-w-0 flex-col agent-turn\"><div class=\"flex-col gap-1 md:gap-3\"><div class=\"flex max-w-full flex-col flex-grow\"><div data-message-author-role=\"assistant\" data-message-id=\"7cff173d-f63c-4e55-ab19-2bde6da48ed6\" dir=\"auto\" class=\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words text-start [.text-message+&amp;]:mt-5\" data-message-model-slug=\"gpt-4o-mini\"><div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\"><div class=\"markdown prose w-full break-words dark:prose-invert light\"><p>The <strong>Mercedes-Benz GLE</strong> is a luxury midsize SUV that blends sophisticated design, advanced technology, and strong performance capabilities. Here are some of the key highlights of the 2024 model:</p><h3>1. <strong>Engine Options and Performance</strong></h3><ul><li><strong>Variety of Powertrains</strong>: The GLE offers a range of engines, including turbocharged 4-cylinder and V6 options. It also features a powerful <strong>GLE 580</strong> with a 4.0L twin-turbo V8 engine. For hybrid enthusiasts, theres the <strong>GLE 350e 4MATIC</strong>, a plug-in hybrid combining a turbocharged engine and an electric motor.</li><li><strong>AMG Performance</strong>: For high-performance enthusiasts, the <strong>Mercedes-AMG GLE 53</strong> and <strong>GLE 63 S</strong> models feature robust engines and sport-tuned suspension for thrilling driving dynamics.</li><li><strong>4MATIC All-Wheel Drive</strong>: Most models come with Mercedes\' signature 4MATIC all-wheel drive, offering enhanced stability and traction across various driving conditions.</li></ul><h3>2. <strong>Interior and Comfort</strong></h3><ul><li><strong>Luxurious Cabin</strong>: The GLE features a refined, upscale interior with high-quality materials such as leather, wood, and metal accents. The cabin is spacious, offering comfortable seating for five or seven passengers, depending on the configuration.</li><li><strong>MBUX Infotainment System</strong>: Mercedes\' advanced MBUX system, including a <strong>dual 12.3-inch digital displays</strong> and an intuitive voice assistant, offers seamless connectivity and ease of use. It supports features like navigation, media control, and voice-activated commands.</li><li><strong>Premium Audio Options</strong>: The GLE offers a <strong>Burmester surround sound system</strong>, delivering a premium audio experience for music lovers.</li></ul><h3>3. <strong>Advanced Technology and Safety Features</strong></h3><ul><li><strong>Active Safety Systems</strong>: The GLE comes with an extensive suite of safety features, including <strong>Active Brake Assist</strong>, <strong>Blind Spot Assist</strong>, <strong>Lane Keeping Assist</strong>, and <strong>Attention Assist</strong>.</li><li><strong>Driver Assistance Packages</strong>: Advanced driver aids, such as <strong>Adaptive Cruise Control</strong>, <strong>Active Steering Assist</strong>, and <strong>Evasive Steering Assist</strong>, enhance safety and convenience on the road.</li><li><strong>360-degree Camera</strong>: The GLE can be equipped with a 360-degree camera and parking sensors to provide full visibility and ease of parking.</li></ul><h3>4. <strong>Exterior Design</strong></h3><ul><li><strong>Sporty and Elegant Design</strong>: The GLE has a muscular yet refined exterior, with a wide grille, sleek LED headlamps, and strong lines that accentuate its athletic stance. Optional AMG exterior styling enhances the sporty appeal.</li><li><strong>LED Lighting</strong>: Standard <strong>LED headlights and taillights</strong> provide enhanced visibility and a modern look.</li><li><strong>Adaptive Suspension</strong>: Available <strong>AIRMATIC air suspension</strong> adjusts to road conditions and driving style, offering a smoother ride while improving handling performance.</li></ul><h3>5. <strong>Cargo and Practicality</strong></h3><ul><li><strong>Spacious Cargo Area</strong>: The GLE has generous cargo space, with a split-folding rear seat configuration allowing for more flexibility. The <strong>GLE 350</strong> offers around 33 cubic feet of cargo space with the rear seats up, expanding to over 74 cubic feet with the seats down.</li><li><strong>Towing Capacity</strong>: The GLE is capable of towing up to 7,700 lbs, depending on the engine choice, making it suitable for hauling trailers or recreational vehicles.</li></ul><h3>6. <strong>Customization Options</strong></h3><ul><li><strong>AMG Styling</strong>: For those who prefer a sportier look and feel, Mercedes-Benz offers AMG-specific models and packages that enhance the SUVs design and performance.</li><li><strong>Interior Choices</strong>: Customers can choose from a variety of upholstery options, including premium leather and unique trim materials. There are also different wheel sizes and designs for a personalized look.</li></ul><h3>7. <strong>Hybrid and Electric Options</strong></h3><ul><li>The <strong>GLE 350e</strong> and <strong>GLE 580e</strong> (in some markets) are plug-in hybrid options, offering a balance of power and efficiency. These models offer electric-only driving range, along with the capability to switch to hybrid mode for extended range.</li></ul><p>*The <strong>Mercedes-Benz GLE</strong> stands out as a versatile and sophisticated luxury SUV, with a strong balance between performance, comfort, and cutting-edge technology. Whether you need a spacious family vehicle or a high-performance driving machine, the GLE delivers both*.</p></div></div></div></div><div class=\"mb-2 flex gap-3 empty:hidden -ml-2\"><div class=\"items-center justify-start rounded-xl p-1 flex\"><div class=\"flex items-center\"><span class=\"\" data-state=\"closed\"><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\" aria-label=\"Copy\" data-testid=\"copy-turn-action-button\"><span class=\"flex h-[30px] w-[30px] items-center justify-center\"><svg width=\"24\" height=\"24\" viewBox=\"0 0 24 24\" fill=\"none\" xmlns=\"http://www.w3.org/2000/svg\" class=\"icon-md-heavy\"><path fill-rule=\"evenodd\" clip-rule=\"evenodd\" d=\"M7 5C7 3.34315 8.34315 2 10 2H19C20.6569 2 22 3.34315 22 5V14C22 15.6569 20.6569 17 19 17H17V19C17 20.6569 15.6569 22 14 22H5C3.34315 22 2 20.6569 2 19V10C2 8.34315 3.34315 7 5 7H7V5ZM9 7H14C15.6569 7 17 8.34315 17 10V15H19C19.5523 15 20 14.5523 20 14V5C20 4.44772 19.5523 4 19 4H10C9.44772 4 9 4.44772 9 5V7ZM5 9C4.44772 9 4 9.44772 4 10V19C4 19.5523 4.44772 20 5 20H14C14.5523 20 15 19.5523 15 19V10C15 9.44772 14.5523 9 14 9H5Z\" fill=\"currentColor\"></path></svg></span></button></span><span class=\"hidden\"></span></div></div></div><div class=\"pr-2 lg:pr-0\"></div><div class=\"mt-3 w-full empty:hidden\"><div class=\"text-center\"></div></div></div><div class=\"absolute\"><span class=\"\" data-state=\"closed\"><button class=\"btn relative btn-secondary btn-small shadow-lg\"><div class=\"flex items-center justify-center\"><svg width=\"24\" height=\"24\" viewBox=\"0 0 24 24\" fill=\"none\" xmlns=\"http://www.w3.org/2000/svg\" class=\"icon-md\"><path d=\"M7.5 13.25C7.98703 13.25 8.45082 13.1505 8.87217 12.9708C8.46129 14.0478 7.62459 15.5792 6.35846 15.76C5.81173 15.8382 5.43183 16.3447 5.50993 16.8914C5.58804 17.4382 6.09457 17.8181 6.6413 17.7399C9.19413 17.3753 10.7256 14.4711 11.169 12.1909C11.4118 10.942 11.3856 9.58095 10.8491 8.44726C10.2424 7.16517 8.92256 6.24402 7.48508 6.25001C5.55895 6.25805 4 7.82196 4 9.74998C4 11.683 5.567 13.25 7.5 13.25Z\" fill=\"currentColor\"></path><path d=\"M16.18 13.25C16.667 13.25 17.1308 13.1505 17.5522 12.9708C17.1413 14.0478 16.3046 15.5792 15.0385 15.76C14.4917 15.8382 14.1118 16.3447 14.1899 16.8914C14.268 17.4382 14.7746 17.8181 15.3213 17.7399C17.8741 17.3753 19.4056 14.4711 19.849 12.1909C20.0918 10.942 20.0656 9.58095 19.5291 8.44726C18.92