(58, 'Cars', 'Mercedes', NULL, 'Popular Cars', '3', 'Mercedes-Benz AMG GLE Coupe 53', 'mercedes-benz-amg-gle-coupe-53', '1.85 Crore', '2,13,06,341', '3,54,241', 'uploads/productimage/1735377832_product1.jpg', 'uploads/productimage/1735377832_product2.jpg', 'uploads/productimage/1735377832_product3.jpg', 'uploads/productimage/1735377832_product4.jpg', 'uploads/productimage/1735377832_product5.jpg', 'uploads/productimage/1735377832_product6.jpg', 'uploads/productimage/1735377832_product7.jpg', 'uploads/productimage/1735377832_product8.jpg', NULL, 'High Tech Silver,Sodalite Blue,Selenite Grey,Polar White Metallic,', '8.9 kmpl', '2999 cc', '85 L', NULL, NULL, '250 kmph', 'M256M 3.0L turbo', 'Petrol', 'Automatic (TC) - 9 Gears, Paddle Shift, Sport Mode', '5', '9 Airbags (Driver, Front Passenger, 2 Curtain, Driver Knee, Driver Side, Front Passenger Side, 2 Rear Passenger Side)', '809 Kilometers', NULL, 'The facelifted Mercedes-AMG GLE 53 has been launched in India', 'Sports SUV Mercedes SUV Turbocharged AMG Performance SUV Coupe Mercedes-Benz GLE Four-door Coupe High-performance vehicle Luxury vehicle SUV with style Mercedes-Benz performance All-wheel drive', '<p><div class=\"md:pt-0 dark:border-white/20 md:border-transparent md:dark:border-transparent w-full\"><div><div class=\"m-auto text-base px-3 md:px-4 w-full md:px-5 lg:px-4 xl:px-5\"><div class=\"mx-auto flex flex-1 gap-4 text-base md:gap-5 lg:gap-6 md:max-w-3xl\"><div class=\"flex justify-center\"></div></div></div></div></div></p><div class=\"flex-1 overflow-hidden @container/thread\"><div class=\"h-full\"><div class=\"react-scroll-to-bottom--css-ezzck-79elbk h-full\"><div class=\"react-scroll-to-bottom--css-ezzck-1n7m0yu\"><div class=\"flex flex-col text-sm md:pb-9\"><article class=\"w-full scroll-mb-[var(--thread-trailing-height,150px)] text-token-text-primary focus-visible:outline-2 focus-visible:outline-offset-[-4px]\" dir=\"auto\" data-testid=\"conversation-turn-3\" data-scroll-anchor=\"true\"><div class=\"m-auto text-base py-[18px] px-3 md:px-4 w-full md:px-5 lg:px-4 xl:px-5\"><div class=\"mx-auto flex flex-1 gap-4 text-base md:gap-5 lg:gap-6 md:max-w-3xl\"><div class=\"group/conversation-turn relative flex w-full min-w-0 flex-col agent-turn\"><div class=\"flex-col gap-1 md:gap-3\"><div class=\"flex max-w-full flex-col flex-grow\"><div data-message-author-role=\"assistant\" data-message-id=\"949ec01e-7204-45f2-bf57-e98a514673bd\" dir=\"auto\" class=\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words text-start [.text-message+&amp;]:mt-5\" data-message-model-slug=\"gpt-4o-mini\"><div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\"><div class=\"markdown prose w-full break-words dark:prose-invert light\"><p>The <strong>Mercedes-Benz AMG GLE 53 Coupe</strong> is a high-performance luxury SUV that blends powerful performance with elegant design. Here are some of its key highlights:</p><h3>1. <strong>Powerful Performance</strong></h3><ul><li><strong>Engine</strong>: The GLE 53 Coupe is powered by a <strong>3.0-liter inline-six turbocharged engine</strong> paired with an <strong>EQ Boost electric motor</strong>, delivering a combined output of <strong>429 horsepower</strong> and <strong>384 lb-ft of torque</strong>.</li><li><strong>Acceleration</strong>: It can accelerate from 0 to 60 mph in about <strong>5.2 seconds</strong>, making it impressively quick for an SUV of its size.</li><li><strong>AMG Performance 4MATIC+</strong>: This advanced all-wheel-drive system ensures optimal traction and stability, enhancing the vehicle\'s handling and performance on various terrains.</li><li><strong>AMG SpeedShift TCT 9-speed transmission</strong>: Offers quick gear shifts and a more responsive driving experience.</li></ul><h3>2. <strong>Luxurious and High-Tech Interior</strong></h3><ul><li><strong>MBUX Infotainment System</strong>: Features dual <strong>12.3-inch displays</strong> for the instrument cluster and infotainment screen, with advanced voice command technology (\"Hey Mercedes\").</li><li><strong>Premium Materials</strong>: The interior is crafted with high-quality materials, including <strong>leather upholstery</strong>, <strong>Aluminum</strong> and <strong>wood trim</strong>, and optional <strong>AMG-specific accents</strong>.</li><li><strong>Space</strong>: Despite its coupe styling, the GLE 53 provides ample seating for up to five passengers and a practical amount of cargo space, making it both luxurious and functional.</li></ul><h3>3. <strong>Dynamic Driving Experience</strong></h3><ul><li><strong>AMG Ride Control+ Suspension</strong>: This adaptive air suspension system provides a smooth ride while also being adjustable for performance-oriented handling. It allows drivers to tailor the vehicle\'s ride quality based on their driving preferences.</li><li><strong>AMG Dynamic Select</strong>: Offers multiple driving modes, including <strong>Comfort, Sport, and Sport+</strong>, adjusting various aspects like throttle response, suspension firmness, and steering.</li><li><strong>Active Brake Assist</strong> and <strong>E-Active Body Control</strong> contribute to safety and stability, especially during cornering or on rough terrain.</li></ul><h3>4. <strong>Striking Exterior Design</strong></h3><ul><li><strong>Sporty Coupe Styling</strong>: The GLE 53 Coupe features a distinctive coupe-like roofline that gives it a sleek, athletic appearance, paired with a powerful front end dominated by the AMG grille and a wider stance.</li><li><strong>19-inch or 21-inch Wheels</strong>: The vehicle is available with a range of wheel sizes, contributing to both its sporty aesthetic and performance.</li><li><strong>AMG-specific Design Elements</strong>: The front and rear bumpers, side skirts, and quad exhaust outlets are tailored for the AMG model, giving the GLE 53 Coupe a more aggressive, dynamic look.</li></ul><h3>5. <strong>Advanced Safety Features</strong></h3><ul><li><strong>Mercedes-Benz Safety System</strong>: Includes <strong>active lane-keeping assist</strong>, <strong>active blind-spot assist</strong>, <strong>pre-collision assist</strong>, and <strong>adaptive cruise control</strong>.</li><li><strong>360-degree Camera</strong>: Aiding parking and low-speed maneuvers, providing a bird\'s-eye view of the surroundings.</li><li><strong>PRE-SAFE</strong>: A system that can detect potential collisions and prepare the vehicle and occupants for impact by tightening seatbelts and adjusting seat positions.</li></ul><h3>6. <strong>High-End Features &amp; Comfort</strong></h3><ul><li><strong>Panoramic Sunroof</strong>: Adding to the premium feel, it allows for an expansive view and more natural light in the cabin.</li><li><strong>Burmester Surround Sound System</strong>: For audiophiles, this optional upgrade provides excellent sound quality throughout the cabin.</li><li><strong>Heated and Ventilated Seats</strong>: Available for both front and rear passengers for added comfort in all weather conditions.</li></ul><h3>7. <strong>Customization Options</strong></h3><ul><li><strong>AMG Night Package</strong>: Includes blacked-out accents and trim for a more aggressive and sporty look.</li><li><strong>Wide Array of Color Choices</strong>: Available in various exclusive and metallic paint finishes, allowing owners to personalize their vehicles appearance.</li></ul><p>*The Mercedes-AMG GLE 53 Coupe offers an impressive mix of sportiness, luxury, and cutting-edge technology, making it an appealing choice for those seeking a high-performance, yet practical, SUV with a coupe\'s sleek design*</p></div></div></div></div><div class=\"mb-2 flex gap-3 empty:hidden -ml-2\"><div class=\"items-center justify-start rounded-xl p-1 flex\"><div class=\"flex items-center\"><span class=\"\" data-state=\"closed\"><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\" aria-label=\"Copy\" data-testid=\"copy-turn-action-button\"><span class=\"flex h