(59, 'Bikes', 'Bajaj', NULL, 'Popular Bikes', '6', 'Bajaj Pulsar NS200', 'bajaj-pulsar-ns200', '1.49 Lakh', '1.68 Lakh', '2758', 'uploads/productimage/1735380594_product1.jpg', 'uploads/productimage/1735380594_product2.jpg', 'uploads/productimage/1735380594_product3.jpg', 'uploads/productimage/1735380594_product4.jpg', 'uploads/productimage/1735380594_product5.jpg', 'uploads/productimage/1735380594_product6.jpg', 'uploads/productimage/1735380594_product7.jpg', 'uploads/productimage/1735380594_product8.jpg', NULL, 'Burnt Red, Pewter Grey, white pearl', '40.84 Kmpl', '200 cc', '12 L', '159.5 kg', '1075 mm', '136 kmph', '200cc', 'Petrol', NULL, '2', NULL, NULL, NULL, 'Bajaj Pulsar NS200', 'Bajaj Pulsar NS200, Bajaj Bikes in India', '<p>The Bajaj Pulsar NS200 is a prominent model in the 200cc motorcycle segment, known for its performance and design. Here are its key highlights:</p><p><strong>Engine and Performance:</strong></p><ul><li><strong>Engine:</strong> 199.5cc, liquid-cooled, single-cylinder.</li><li><strong>Power Output:</strong> 24.13 bhp at 9,750 rpm.</li><li><strong>Torque:</strong> 18.74 Nm at 8,000 rpm.</li><li><strong>Transmission:</strong> 6-speed gearbox.</li><li><strong>Compliance:</strong> E20 fuel compliant. <span class=\"\" data-state=\"closed\"><br></span></li></ul><p><strong>Design and Features:</strong></p><ul><li><strong>Frame:</strong> Pressed steel perimeter frame for enhanced stability.</li><li><strong>Suspension:</strong> Front inverted (USD) telescopic forks; rear 7-step adjustable Nitrox mono-shock.</li><li><strong>Brakes:</strong> Front 300mm and rear 230mm hydraulic disc brakes with dual-channel ABS.</li><li><strong>Tires:</strong> Tubeless; front 100/80-17, rear 130/70-17.</li><li><strong>Lighting:</strong> Full LED setup, including headlamp with DRLs.</li><li><strong>Instrument Cluster:</strong> Fully digital with Bluetooth connectivity and turn-by-turn navigation.</li><li><strong>Additional Features:</strong> Slip-and-assist clutch for smoother gear shifts. <span class=\"\" data-state=\"closed\"><br></span></li></ul><p><strong>Dimensions:</strong></p><ul><li><strong>Wheelbase:</strong> 1,363 mm.</li><li><strong>Seat Height:</strong> 805 mm.</li><li><strong>Fuel Tank Capacity:</strong> 12 liters.</li></ul><p><strong>Performance Metrics:</strong></p><ul><li><strong>Top Speed:</strong> Approximately 140 km/h.</li><li><strong>Fuel Efficiency:</strong> Around 35 km/L in city conditions and 40 km/L on highways.</li></ul>', 1, '2024-12-28 10:09:54', '2024-12-30 05:40:24'),
(60, 'Bikes', 'TVS', NULL, 'Popular Bikes', '6', 'TVS Sport', 'tvs-sport', '61,021 - 66,430', '77440', '1127', 'uploads/productimage/1735381251_productBS6-TVS-Sport-110-2.jpg', 'uploads/productimage/1735381251_producttvs-star-sports-10.jpg', 'uploads/productimage/1735381251_productTVS-SPORT-WHITE-PIC.jpg', 'uploads/productimage/1735381251_productBS6-TVS-Sport-110-2.jpg', 'uploads/productimage/1735381251_producttvs-star-sports-10.jpg', 'uploads/productimage/1735381251_producttvs-star-sports-10.jpg', 'uploads/productimage/1735381251_productTVS-SPORT-WHITE-PIC.jpg', 'uploads/productimage/1735381251_productBS6-TVS-Sport-110-2.jpg', NULL, 'Black Green, Black Blue, Black Red, Mercury Grey, Volcanic Red, White And Red', '70 Kmpl', '109 cc', '10L', '112 kg to 110 kg', '1080 mm', '90 kmph', '109 cc', 'Petrol', NULL, '2', NULL, NULL, NULL, 'TVS Sport', 'TVS Sport, TVS Bikes in India', '<p>The TVS Sport is a popular commuter motorcycle in India, renowned for its fuel efficiency and affordability. Here are its key highlights:</p><p><strong>Engine and Performance:</strong></p><ul><li><strong>Engine:</strong> 109.7cc, four-stroke, single-cylinder Duralife engine.</li><li><strong>Power Output:</strong> 8.18 bhp at 7,350 rpm.</li><li><strong>Torque:</strong> 8.7 Nm at 4,500 rpm.</li><li><strong>Transmission:</strong> 4-speed manual gearbox.</li><li><strong>Fuel Efficiency:</strong> Achieved a record on-road mileage of 110.12 km/l. <span class=\"\" data-state=\"closed\"><br></span></li></ul><p><strong>Design and Features:</strong></p><ul><li><strong>Frame:</strong> Steel tubular frame.</li><li><strong>Suspension:</strong> Front telescopic hydraulic forks (110mm travel); rear 5-step adjustable shock absorbers (79mm travel).</li><li><strong>Brakes:</strong> Front 130mm drum; rear 110mm drum.</li><li><strong>Fuel Tank Capacity:</strong> 10 liters.</li><li><strong>Additional Features:</strong> All-gear electric start, LED DRLs, and an econometer to assist in achieving optimal fuel efficiency. <span class=\"\" data-state=\"closed\"><br></span></li></ul><p><strong>Dimensions:</strong></p><ul><li><strong>Length:</strong> 1,950 mm.</li><li><strong>Width:</strong> 705 mm.</li><li><strong>Height:</strong> 1,080 mm.</li><li><strong>Ground Clearance:</strong> 170 mm.</li></ul><p><strong>Recent Updates:</strong></p><ul><li>The BS6-compliant version introduced a larger 109cc engine, replacing the previous 99cc unit, with a 15% increase in fuel efficiency. <span class=\"\" data-state=\"closed\"><br></span></li><li>Enhanced features include LED DRLs and an updated instrument cluster.</li></ul>', 1, '2024-12-28 10:20:51', '2024-12-28 10:20:51'),
(61, 'Cars', 'Mercedes', NULL, 'Popular Cars', '3', 'Mercedes-Benz EQB', 'mercedes-benz-eqb', '70.90 - 77.50 Lakh', '72,94,920', '1,68,244', 'uploads/productimage/1735388447_product1.jpg', 'uploads/productimage/1735388447_product2.jpg', 'uploads/productimage/1735388447_product3.jpg', 'uploads/productimage/1735388447_product4.jpg', 'uploads/productimage/1735388447_product5.jpg', 'uploads/productimage/1735388447_product6.jpg', 'uploads/productimage/1735388447_product7.jpg', 'uploads/productimage/1735388447_product8.jpg', 'SUV', ',Iridium Silver,Cosmos Black,Rose Gold,Digital White,Mountain Grey,', NULL, NULL, NULL, NULL, NULL, '160 kmph', NULL, 'Electric (70.5 kWh battery pack)', NULL, 'both 5- and 7-seating layouts', 'good protection of all critical body areas of both the driver and passenger', 'FWD & AWD', '7.15 Min', 'The Mercedes-Benz EQB is an electric vehicle (EV) and does not have a fuel tank. Instead, it has two battery pack options:', '#eqb #mercedesbenz #eqc #mercedes #mercedeseq #eq #eqa #matic', '<p><div class=\"md:pt-0 dark:border-white/20 md:border-transparent md:dark:border-transparent w-full\"><div><div class=\"m-auto text-base px-3 md:px-4 w-full md:px-5 lg:px-4 xl:px-5\"><div class=\"mx-auto flex flex-1 gap-4 text-base md:gap-5 lg:gap-6 md:max-w-3xl\"><div class=\"flex justify-center\"></div></div></div></div></div></p><div class=\"flex-1 overflow-hidden @container/thread\"><div class=\"h-full\"><div class=\"react-scroll-to-bottom--css-kmocw-79elbk h-full\"><div class=\"react-scroll-to-bottom--css-kmocw-1n7m0yu\"><div class=\"flex flex-col text-sm md:pb-9\"><article class=\"w-full scroll-mb-[var(--thread-trailing-height,150px)] text-token-text-primary focus-visible:outline-2 focus-visible:outline-offset-[-4px]\" dir=\"auto\" data-testid=\"conversation-turn-3\" data-scroll-anchor=\"true\"><div class=\"m-auto text-base py-[18px] px-3 md:px-4 w-full md:px-5 lg:px-4 xl:px-5\"><div class=\"mx-auto flex flex-1 gap-4 text-base md:gap-5 lg:gap-6 md:max-w-3xl\"><div class=\"group/conversation-turn relative flex w-full min-w-0 flex-col agent-turn\"><div class=\"flex-col gap-1 md:gap-3\"><div class=\"flex max-w-full flex-col flex-grow\"><div data-message-author-role=\"assistant\" data-message-id=\"5ab0cd6b-9869-4f24-9547-66cdc055bdea\" dir=\"auto\" class=\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words text-start [.text-message+&amp;]:mt-5\" data-message-model-slug=\"gpt-4o-mini\"><div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\"><div class=\"markdown prose w-full break-words dark:prose-invert light\"><p>The <strong>Mercedes-Benz EQB</strong> is a compact, fully-electric SUV from the brand\'s EQ electric vehicle lineup. Here are some key highlights of the EQB:</p><h3>1. <strong>Electric Powertrain</strong></h3><ul><li><strong>Powerful Electric Motors</strong>: The EQB features a dual-motor all-wheel-drive system (in the EQB 350 4MATIC version) or a front-wheel-drive option (in the EQB 300). It offers smooth, efficient performance with impressive torque.</li><li><strong>Range</strong>: It offers a competitive range on a full charge, with estimates around <strong>250-270 miles</strong> (depending on the specific model and driving conditions) thanks to its <strong>66.5 kWh battery</strong>.</li><li><strong>Charging</strong>: The EQB can charge from 10% to 80% in about 30 minutes using fast DC charging, making it convenient for long trips.</li></ul><h3>2. <strong>Interior and Comfort</strong></h3><ul><li><strong>Spacious Cabin</strong>: The EQB is offered in both <strong>5-seat</strong> and <strong>7-seat configurations</strong>, providing versatility and ample space for passengers and luggage.</li><li><strong>Premium Materials</strong>: High-quality materials are used throughout the cabin, offering a modern, luxurious feel. The car comes with ambient lighting, a leather-wrapped steering wheel, and a selection of high-end upholstery.</li><li><strong>MBUX Infotainment System</strong>: The latest MBUX system is standard, featuring a <strong>10.25-inch touchscreen</strong> and a <strong>digital instrument cluster</strong> for an intuitive and high-tech driving experience. Voice control, navigation, and smartphone integration are seamlessly integrated.</li></ul><h3>3. <strong>Advanced Safety and Driver Assistance</strong></h3><ul><li><strong>Mercedes-Benz Safety Features</strong>: It comes with <strong>Active Brake Assist</strong>, <strong>Lane Keeping Assist</strong>, and <strong>Attention Assist</strong> as standard. Additional options include <strong>Adaptive Cruise Control</strong>, <strong>Blind Spot Assist</strong>, and <strong>Parking Assistance</strong>.</li><li><strong>360-Degree Camera</strong>: Helps with parking and maneuvering in tight spaces.</li></ul><h3>4. <strong>Performance and Handling</strong></h3><ul><li><strong>Smooth Ride</strong>: The EQB combines electric vehicle performance with the refinement Mercedes-Benz is known for. It delivers smooth acceleration, with the EQB 350 offering around <strong>288 hp</strong> and a 0-60 mph time of <strong>6.0 seconds</strong>.</li><li><strong>Dynamic Handling</strong>: The vehicle features <strong>Dynamic Select</strong> driving modes to suit various road conditions and preferences, enhancing comfort and performance.</li></ul><h3>5. <strong>Design</strong></h3><ul><li><strong>Sleek and Modern Styling</strong>: The EQB maintains Mercedes\' characteristic luxury SUV design with a clean, aerodynamic profile. It has a distinctive front end with a <strong>black grille</strong>, LED headlights, and elegant curves.</li><li><strong>Color Options</strong>: Available in a variety of sophisticated colors with stylish wheel options.</li></ul><h3>6. <strong>Sustainability</strong></h3><ul><li><strong>Eco-Friendly Manufacturing</strong>: The EQB is built with sustainability in mind, including the use of <strong>recycled materials</strong> for interior parts.</li><li><strong>Electric Drive System</strong>: As a fully electric SUV, it contributes to reducing carbon emissions compared to traditional gas-powered SUVs.</li></ul><h3>7. <strong>Pricing</strong></h3><ul><li><strong>Affordable Luxury</strong>: While priced higher than typical compact SUVs, the EQB offers a balance of premium features, technology, and electric efficiency, with prices starting around <strong>$55,000</strong> in the U.S. for the base model.</li></ul><p>*In summary, the Mercedes-Benz EQB is a stylish, comfortable, and technologically advanced electric SUV, ideal for those seeking a luxurious yet sustainable vehicle with practical features for everyday driving*</p></div></div></div></div><div class=\"mb-2 flex gap-3 empty:hidden -ml-2\"><div class=\"items-center justify-start rounded-xl p-1 flex\"><div class=\"flex items-center\"><span class=\"\" data-state=\"closed\"><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\" aria-label=\"Copy\" data-testid=\"copy-turn-action-button\"><span class=\"flex h-[30px] w-[30px] items-center justify-center\"><svg width=\"24\" height=\"24\" viewBox=\"0 0 24 24\" fill=\"none\" xmlns=\"http://www.w3.org/2000/svg\" class=\"icon-md-heavy\"><path fill-rule=\"evenodd\" clip-rule=\"evenodd\" d=\"M7 5C7 3.34315 8.34315 2 10 2H19C20.6569 2 22 3.34315 22 5V14C22 15.6569 20.6569 17 19 17H17V19C17 20.6569 15.6569 22 14 22H5C3.34315 22 2 20.6569 2 19V10C2 8.34315 3.34315 7 5 7H7V5ZM9 7H14C15.6569 7 17 8.34315 17 10V15H19C19.5523 15 20 14.5523 20 14V5C20 4.44772 19.5523 4 19 4H10C9.44772 4 9 4.44772 9 5V7ZM5 9C4.44772 9 4 9.44772 4 10V19C4 19.5523 4.44772 20 5 20H14C14.5523 20 15 19.5523 15 19V10C15 9.44772 14.5523 9 14 9H5Z\" fill=\"currentColor\"></path></svg></span></button></span><span class=\"hidden\"></span></div></div></div><div class=\"pr-2 lg:pr-0\"></div><div class=\"mt-3 w-full empty:hidden\"><div class=\"text-center\"></div></div></div><div class=\"absolute\"><span class=\"\" data-state=\"closed\"><button class=\"btn relative btn-secondary btn-small shadow-lg\"><div class=\"flex items-center justify-center\"><svg width=\"24\" height=\"24\" viewBox=\"0 0 24 24\" fill=\"none\" xmlns=\"http://www.w3.org/2000/svg\" class=\"icon-md\"><path d=\"M7.5 13.25C7.98703 13.25 8.45082 13.1505 8.87217 12.9708C8.46129 14.0478 7.62459 15.5792 6.35846 15.76C5.81173 15.8382 5.43183 16.3447 5.50993 16.8914C5.58804 17.4382 6.09457 17.8181 6.6413 17.7399C9.19413 17.3753 10.7256 14.4711 11.169 12.1909C11.4118 10.942 11.3856 9.58095 10.8491 8.44726C10.2424 7.16517 8.92256 6.24402 7.48508 6.25001C5.55895 6.25805 4 7.82196 4 9.74998C4 11.683 5.567 13.25 7.5 13.25Z\" fill=\"currentColor\"></path><path d=\"M16.18 13.25C16.667 13.25 17.1308 13.1505 17.5522 12.9708C17.1413 14.0478 16.3046 15.5792 15.0385 15.76C14.4917 15.8382 14.1118 16.3447 14.1899 16.8914C14.268 17.4382 14.7746 17.8181 15.3213 17.7399C17.8741 17.3753 19.4056 14.4711 19.849 12.1909C20.0918 10.942 20.0656 9.58095 19.5291 8.44726C18.9224 7.16517 17.6026 6.24402 16.1651 6.25001C14.2389 6.25805 12.68 7.82196 12.68 9.74998C12.68 11.683 14.247 13.25 16.18 13.25Z\" fill=\"currentColor\"></path></svg></div></button></span></div></div></div></div></article></div></div></div></div></div>', 1, '2024-12-28 12:20:47', '2024-12-28 12:20:47');
