(63, 'Bikes', 'Royal Enfield', NULL, 'Popular Bikes', '6', 'Royal Enfield Hunter 350', 'royal-enfield-hunter-350', '1.50 Lakh - 1.75 Lakh', '1.66', '2768', 'uploads/productimage/1735536774_product1.jpg', 'uploads/productimage/1735536774_product2.jpg', 'uploads/productimage/1735536774_product3.jpg', 'uploads/productimage/1735536774_product4.jpg', 'uploads/productimage/1735536774_product5.jpg', 'uploads/productimage/1735536774_product6.jpg', 'uploads/productimage/1735536774_product3.jpg', 'uploads/productimage/1735536774_product5.jpg', NULL, 'Classic Black, Classic Green, Classic Red and Classic Blue.', '36.2 Kmpl', '349 cc', '13 L', '181 kg', '1055 mm', '114 kmph', '349 cc', 'Petrol', NULL, '2', NULL, NULL, NULL, 'Royal Enfield Hunter 350', 'Royal Enfield Hunter 350, Royal Enfield Bikes in India', '<p>The Royal Enfield Hunter 350 is a stylish and modern roadster with a unique blend of retro charm and contemporary design. Here are the key highlights of the Hunter 350:</p><h3>1. <strong>Design and Style</strong></h3><ul><li>A compact and lightweight build compared to other Royal Enfield models.</li><li>Retro-inspired aesthetics combined with modern elements like sleek fuel tank designs, LED taillights, and bold color schemes.</li><li>Dual-tone paint options and attractive graphics for a sporty appearance.</li></ul><h3>2. <strong>Engine and Performance</strong></h3><ul><li>Powered by a 349cc, single-cylinder, air-cooled, fuel-injected engine.</li><li>Produces 20.2 bhp of power and 27 Nm of torque, offering a smooth and punchy performance for city rides and occasional highway cruising.</li><li>Mated to a 5-speed gearbox for efficient power delivery.</li></ul><h3>3. <strong>Chassis and Handling</strong></h3><ul><li>Built on Royal Enfield\'s J-platform chassis, ensuring better handling and stability.</li><li>Lightweight design enhances agility, making it an excellent choice for urban commuters.</li><li>17-inch alloy wheels with tubeless tires for better grip and cornering stability.</li></ul><h3>4. <strong>Suspension and Brakes</strong></h3><ul><li>Telescopic front forks and twin rear shock absorbers for a comfortable ride.</li><li>Disc brakes on both ends with dual-channel ABS (Anti-lock Braking System) for enhanced safety.</li></ul><h3>5. <strong>Features</strong></h3><ul><li>Semi-digital instrument cluster with an analog speedometer and a digital display for essential readouts.</li><li>Tripper navigation system (available as an accessory) for turn-by-turn navigation.</li><li>USB charging port for added convenience.</li></ul><h3>6. <strong>Variants and Pricing</strong></h3><ul><li>Available in two variants: <strong>Retro</strong> and <strong>Metro</strong>, with slight differences in features like wheels, ABS, and styling.</li><li>Competitive pricing makes it an attractive option in the 350cc segment.</li></ul><h3>7. <strong>Target Audience</strong></h3><ul><li>Ideal for young riders looking for a compact, stylish, and easy-to-ride motorcycle.</li><li>Perfect for daily commutes, weekend rides, and those entering the world of Royal Enfield.</li></ul><p>The Hunter 350 stands out as a versatile and approachable motorcycle with Royal Enfield\'s signature character, making it a strong contender in its class.</p>', 1, '2024-12-30 05:32:54', '2024-12-30 05:32:54'),
(64, 'Cars', 'Skoda', NULL, 'Popular Cars', '3', 'Skoda Superb', 'skoda-superb', '54 Lakh', '62,31,460', '1,18,612', 'uploads/productimage/1735542563_productS 1.webp', 'uploads/productimage/1735542563_productS 2.webp', 'uploads/productimage/1735542563_products 3.webp', 'uploads/productimage/1735542563_products 4.webp', 'uploads/productimage/1735542563_productS5.webp', 'uploads/productimage/1735542563_productS 6.webp', 'uploads/productimage/1735542563_productS 7.webp', 'uploads/productimage/1735542563_productS 8.webp', 'Sedan', 'Rosso Brunello, Magic Black and Water World Green.', '15 kmpl', '1984 cc', '66 liters', NULL, NULL, '250 kmph', '1984 cc', 'Petrol', 'Automatic', '5', '9 Airbags', 'FWD', NULL, 'The Skoda Superb has 1 Petrol Engine on offer. The Petrol engine is 1984 cc . It is available with Automatic transmission.Depending upon the variant and fuel ty', '#skodasuperb are #skodasuperb #skoda #skodaoctavia #superb #skodagram #skodafabia', '<p><div class=\"md:pt-0 dark:border-white/20 md:border-transparent md:dark:border-transparent w-full\"><div><div class=\"m-auto text-base px-3 md:px-4 w-full md:px-5 lg:px-4 xl:px-5\"><div class=\"mx-auto flex flex-1 gap-4 text-base md:gap-5 lg:gap-6 md:max-w-3xl\"><div class=\"flex justify-center\"></div></div></div></div></div></p><div class=\"flex-1 overflow-hidden @container/thread\"><div class=\"h-full\"><div class=\"react-scroll-to-bottom--css-ohwjk-79elbk h-full\"><div class=\"react-scroll-to-bottom--css-ohwjk-1n7m0yu\"><div class=\"flex flex-col text-sm md:pb-9\"><article class=\"w-full scroll-mb-[var(--thread-trailing-height,150px)] text-token-text-primary focus-visible:outline-2 focus-visible:outline-offset-[-4px]\" dir=\"auto\" data-testid=\"conversation-turn-3\" data-scroll-anchor=\"true\"><div class=\"m-auto text-base py-[18px] px-3 md:px-4 w-full md:px-5 lg:px-4 xl:px-5\"><div class=\"mx-auto flex flex-1 gap-4 text-base md:gap-5 lg:gap-6 md:max-w-3xl\"><div class=\"group/conversation-turn relative flex w-full min-w-0 flex-col agent-turn\"><div class=\"flex-col gap-1 md:gap-3\"><div class=\"flex max-w-full flex-col flex-grow\"><div data-message-author-role=\"assistant\" data-message-id=\"dfc222dd-eb58-4594-87ff-6775ff150948\" dir=\"auto\" class=\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words text-start [.text-message+&amp;]:mt-5\" data-message-model-slug=\"gpt-4o-mini\"><div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\"><div class=\"markdown prose w-full break-words dark:prose-invert light\"><p>The <strong>koda Superb</strong> is a flagship sedan from the Czech automaker koda Auto, known for its combination of spaciousness, luxury, and value for money. Here are some key highlights of the latest koda Superb:</p><h3>1. <strong>Design &amp; Exterior</strong></h3><ul><li><strong>Elegant Styling</strong>: The koda Superb features a sophisticated design with a bold grille, sleek lines, and a refined front and rear end.</li><li><strong>LED Lighting</strong>: Full LED headlights and rear lights offer enhanced visibility and a modern look.</li><li><strong>Premium Quality</strong>: The use of high-quality materials in the body gives it a premium feel.</li></ul><h3>2. <strong>Interior &amp; Comfort</strong></h3><ul><li><strong>Spacious Cabin</strong>: One of the standout features of the Superb is its generous interior space. It offers ample headroom and legroom for both front and rear passengers.</li><li><strong>Luxurious Features</strong>: Soft-touch materials, leather upholstery, and a large infotainment screen provide a comfortable and high-end experience.</li><li><strong>Clever Storage</strong>: koda\'s famous \"Simply Clever\" features include numerous practical storage solutions like the umbrella in the door and a large glove compartment.</li></ul><h3>3. <strong>Technology &amp; Infotainment</strong></h3><ul><li><strong>Digital Cockpit</strong>: The Superb comes with a fully digital instrument cluster, which displays all key driving information in a modern, customizable layout.</li><li><strong>Infotainment System</strong>: The car features a large touchscreen system (up to 9.2 inches), with Apple CarPlay, Android Auto, and navigation.</li><li><strong>Advanced Driver Assistance Systems (ADAS)</strong>: Features like adaptive cruise control, lane-keeping assist, and traffic sign recognition improve safety and convenience.</li></ul><h3>4. <strong>Performance &amp; Engine Options</strong></h3><ul><li><strong>Engine Choices</strong>: The Superb offers various powertrains, including turbocharged petrol and diesel engines. There\'s also a hybrid version (Plug-in Hybrid) available, providing a balance of performance and efficiency.</li><li><strong>Powerful &amp; Efficient</strong>: The engine range typically includes 1.5 TSI, 2.0 TSI, and 2.0 TDI engines, along with a 1.4 TSI plug-in hybrid option.</li><li><strong>Smooth Ride</strong>: Its well-tuned suspension system ensures a smooth and comfortable ride, even on rough roads.</li></ul><h3>5. <strong>Driving Experience</strong></h3><ul><li><strong>Handling</strong>: Despite its size, the Superb offers excellent handling, aided by a precise steering system and stable ride quality.</li><li><strong>Driving Modes</strong>: Multiple driving modes, such as Eco, Normal, and Sport, allow drivers to customize the driving experience to their preferences.</li></ul><h3>6. <strong>Safety Features</strong></h3><ul><li><strong>Top Safety Rating</strong>: The koda Superb has received excellent safety ratings in crash tests, with features such as automatic emergency braking, front assist, blind spot detection, and a reinforced body structure.</li><li><strong>Parking Assistance</strong>: Sensors and a parking camera make parking easier, and there is also an optional parking assistant.</li></ul><h3>7. <strong>Pricing &amp; Value</strong></h3><ul><li><strong>Affordable Luxury</strong>: The koda Superb is often considered great value for money, offering features comparable to more expensive luxury sedans, but at a more affordable price point.</li></ul><h3>8. <strong>Environmental Sustainability</strong></h3><ul><li><strong>Hybrid Option</strong>: The Superbs plug-in hybrid variant provides an environmentally friendly alternative with reduced emissions and better fuel efficiency.</li></ul><p>*The koda Superb remains a popular choice for those who want a premium-feeling sedan with a lot of practicality, solid technology, and a more budget-friendly price than many of its competitors*.</p></div></div></div></div><div class=\"mb-2 flex gap-3 empty:hidden -ml-2\"><div class=\"items-center justify-start rounded-xl p-1 flex\"><div class=\"flex items-center\"><span class=\"\" data-state=\"closed\"><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\" aria-label=\"Copy\" data-testid=\"copy-turn-action-button\"><span class=\"flex h-[30px] w-[30px] items-center justify-center\"><svg width=\"24\" height=\"24\" viewBox=\"0 0 24 24\" fill=\"none\" xmlns=\"http://www.w3.org/2000/svg\" class=\"icon-md-heavy\"><path fill-rule=\"evenodd\" clip-rule=\"evenodd\" d=\"M7 5C7 3.34315 8.34315 2 10 2H19C20.6569 2 22 3.34315 22 5V14C22 15.6569 20.6569 17 19 17H17V19C17 20.6569 15.6569 22 14 22H5C3.34315 22 2 20.6569 2 19V10C2 8.34315 3.34315 7 5 7H7V5ZM9 7H14C15.6569 7 17 8.34315 17 10V15H19C19.5523 15 20 14.5523 20 14V5C20 4.44772 19.5523 4 19 4H10C9.44772 4 9 4.44772 9 5V7ZM5 9C4.44772 9 4 9.44772 4 10V19C4 19.5523 4.44772 20 5 20H14C14.5523 20 15 19.5523 15 19V10C15 9.44772 14.5523 9 14 9H5Z\" fill=\"currentColor\"></path></svg></span></button></span><span class=\"hidden\"></span></div></div></div><div class=\"pr-2 lg:pr-0\"></div><div class=\"mt-3 w-full empty:hidden\"><div class=\"text-center\"></div></div></div><div class=\"absolute\"><span class=\"\" data-state=\"closed\"><button class=\"btn relative btn-secondary btn-small shadow-lg\"><div class=\"flex items-center justify-center\"><svg width=\"24